/*Data for the table `abstrak` */

insert  into `abstrak`(`No`,`Kelas`,`Abstrak`,`preProsesing`) values (459,'C','Perancangan Dan Implementasi Ethernet Over Internet Protocol (EOIP) Dengan IP Security Di PT Blesslink Rema. Ethernet Over Internet Protocol (EOIP) adalah sebuah teknologi komunikasi yang merupakan Propietary dari Mikrotik RouterOS yang memungkinkan pengguna untuk menghubungkan jaringan lokal melalui jaringan publik. Dengan menggunakan EOIP, kita dapat meminimalisir biaya pembangunan jaringan dan biaya operasional, mempermudah dalam perluasan konektivitas jaringan komputer secara geografis (skalabilitas) dan menyederhanakan topologi jaringan. Namun, EOIP memiliki kelemahan yaitu tidak tersediannya fitur enkripsi data. Sehingga data yang ditransmisikan rawan akan penyadapan. IP Security (IPSec) merupakan sebuah protokol keamanan yang berkerja dengan mengautentikasi dan mengenkripsi setiap paket data. IPSec yang memiliki Transport mode memungkinkan pengguna untuk menggunakan IPSec sekaligus EOIP sebagai Tunnel pada jaringan komputer yang akan dihubungkan. Kombinasi EOIP dan IPSec ini akan diimplementasikan di PT. Blesslink Rema untuk mengatasi ketidak percayaan pihak direksi PT. Blesslink Rema pada penggunaan internet sebagi sarana transfer data bagi dokumen-dokumen penting perusahaan. Penggunaan EOIP dan IPSecurity dipilih karena telah tersedianya perangkat Mikrotik RouterOS sehingga dapat meminimalkan biaya pengadaan infrastruktur jaringan.Keyword : VPN, EOIP, IPSec','rancang implementasi ethernet over internet protocol eoip ip security pt blesslink rema ethernet over internet protocol eoip teknologi komunikasi propietary mikrotik routeros mungkin guna hubung jaring lokal jaring publik eoip meminimalisir biaya bangun jaring biaya operasional mudah luas konektivitas jaring komputer geografis skalabilitas sederhana topologi jaring eoip lemah tersedian fitur enkripsi data data transmisi rawan sadap ip security ipsec protokol aman kerja autentikasi enkripsi paket data ipsec transport mode mungkin guna ipsec sekaligus eoip tunnel jaring komputer hubung kombinasi eoip ipsec implementasi pt blesslink rema atas tidak percaya direksi pt blesslink rema internet bagi sarana transfer data dokumen usaha eoip ipsecurity pilih tersedia angkat mikrotik routeros minimal biaya ada infrastruktur jaringan keyword vpn eoip ipsec'),(460,'C','Pembangunan Simulasi Manajemen Waktu Untuk Siswa SMA Dalam Organisasi Siswa Intra Sekolah (OSIS) Berbasis Dekstop (Studi Kasus SMA Negeri 1 Bandung). Manajemen waktu merupakan sebuah proses perencanaan dalam melakukan pengawasan atas jumlah waktu yang digunakan untuk kegiatan tertentu. Siswa SMA idealnya mampu memanajemen waktunya baik dalam berperan aktif dan rajin untuk mengikuti kegiatan akademik hingga menyelesaikan tugas-tugas yang diberikan oleh guru dengan baik. Namun siswa SMAN 1 Bandung yang mengalami kesulitan dalam mengatur waktunya, terutama bagi anggota OSIS. Hal ini dikarenakan siswa kesulitan dalam mempelajari konsep manajemen waktu, konsep urutan dalam prioritas kegiatan dan sulitnya belajar manajemen waktu di luar pelatihan yang disediakan sekolah. Tujuan dari penelitian ini yaitu membantu siswa dalam memahami konsep manajemen waktu, konsep urutan dalam prioritas kegiatan dengan cara yang lebih menyenangkan dan melatih siswa belajar manajemen waktu di luar pelatihan di sekolahan. Pembangunan game harus melalui tahapan sesuai dengan metode pengembangan yang dipilih yaitu metode pengembangan sistem waterfall dan menerapkan metode Getting Thing Done dalam pembangunan game-nya, David adalah karakter utama dari game ini, pemain diharuskan untuk merekrut anggota minimal 3 orang agar sekolah David dapat mengikuti lomba. Pengujian game dilakukan dengan menggunakan metode Black box, kuesioner serta wawancara. Berdasarkan hasil yang didapat dari penelitian yang dilakukan maka dapat diperoleh kesimpulan bahwa game ini dapat membantu siswa dalam melatih konsep manajemen waktu dengan cara yang interaktif, game ini dapat mempermudah siswa dalam mempelajari konsep prioritas kegiatan OSIS maupun kegiatan belajar di sekolah, dan mempermudah siswa dalam mempelajari manajemen waktu diluar pelatihan yang disediakan oleh sekolah. Keyword : Game Simulasi, SMAN 1 Bandung, Interaktif, Manajemen Waktu','bangun simulasi manajemen siswa sma organisasi siswa intra sekolah osis basis dekstop studi kasus sma neger bandung manajemen rencana awas tertentu siswa sma ideal manajemen waktu peran aktif rajin ikut akademik selesai tugas berik guru siswa sman bandung sulit atur waktu anggota osis karena siswa sulit mempelajari konsep manajemen konsep urut prioritas sulit belajar manajemen latih sedia sekolah tuju penelitian siswa paham konsep manajemen konsep urut prioritas senang latih siswa belajar manajemen latih sekolah bangun game tahap metode pengembangan pilih metode pengembangan sistem waterfall terap metode getting thing done bangun game david karakter game main harus rekrut anggota minimal sekolah david ikut lomba uji game metode black box kuesioner wawancara dapat penelitian oleh simpul game siswa latih konsep manajemen interaktif game mudah siswa mempelajari konsep prioritas osis belajar sekolah mudah siswa mempelajari manajemen luar latih sedia sekolah keyword game simulasi sman bandung interaktif manajemen'),(461,'C','Pembangunan Aplikasi Pengaman Suara Pada Voip (Voice Over IP) Menggunakan Algoritma AES-CTR Berbasis Android . Voice Over Internet Protocol atau disingkat VoIP, dikenal juga dengan sebutan IP Telephony. VoIP didefinisikan sebagai suatu sistem yang menggunakan jaringan internet untuk mengirimkan data paket suara dari suatu tempat ke tempat yang lain menggunakan perantara protokol IP. Manfaat yang diperoleh dalam berkomunikasi dengan menggunakan VoIP jika dibandingkan dengan menggunakan jaringan PSTN yaitu biaya yang dikeluarkan untuk melakukan panggilan telepon relatif lebih murah dan lain-lain. Namun, disamping manfaat yang diberikan oleh VoIP tersebut, maka VoIP juga memiliki kelemahan yaitu masih rendahnya tingkat keamanannya sehingga terjadinya penyadapan oleh pihak yang tidak berwenang. Untuk menghindari terjadinya penyadapan terdapat solusi pengamanan yang dapat dilakukan yaitu enkripsi dengan menggunakan Algoritma kriptografi AES-CTR dan Diffie-Hellman untuk proses pertukaran kuncinya. Advanced Encryption Standard (AES) merupakan algoritma kriptografi blok cipher simetrik yang dapat mengenkripsi dan dekripsi informasi. AES memiliki ukuran masing-masing 128, 192, dan 256 bit untuk mengenkripsi dan dekripsi data pada blok 128 bit. Counter mode merupakan salah satu mode dari AES yang dapat mengubah blok cipher menjadi stream cipher. Mode ini bekerja dengan cara mengenkripsi nilai berkelanjutan dari suatu counter sehingga proses enkripsi dan dekripsi menjadi lebih cepat. Selain itu dibutuhkan pertukaran kunci untuk proses enkripsi dan dekripsinya. Pertukaran kunci yang digunakan adalah Diffie-Hellman Key Exchange.Pertukaran kunci berguna untuk membagi kunci enkripsi yang sama antara 2 orang atau lebih. Dari hasil uji coba terhadap sistem VoIP tanpa menggunakan keamanan, paket RTP / suara dapat diambil dan didengarkan oleh penyerang. Sedangkan sistem VoIP dengan menggunakan keamanan, paket RTP / suara dapat diambil tetapi tidak dapat didengarkan oleh penyerang karena suara dihasilkan rusak.Keyword : VoIP, AES-CTR, Diffie-Hellman, RTP','bangun aplikasi aman suara voip voice over ip algoritma aes basis android voice over internet protocol singkat voip kenal sebut ip telephony voip definisi sistem jaring internet kirim data paket suara antara protokol ip manfaat oleh komunikasi voip banding jaring pstn biaya keluar panggil telepon relatif murah lain samping manfaat berik voip voip lemah rendah aman jadi sadap wenang hindar jadi sadap dapat solusi aman enkripsi algoritma kriptografi aes diffie tukar kunci advanced encryption standard aes algoritma kriptografi blok cipher simetrik enkripsi dekripsi informasi aes ukur bit enkripsi dekripsi data blok bit counter mode mode aes ubah blok cipher stream cipher mode kerja enkripsi nilai lanjut counter enkripsi dekripsi cepat butuh tukar kunci enkripsi dekripsi tukar kunci diffie y exchange pertukaran kunci guna bagi kunci enkripsi uji coba sistem voip aman paket rtp suara ambil dengar serang sistem voip aman paket rtp suara ambil dengar serang suara hasil rusak keyword voip aes diffie rtp'),(462,'E','Pengenalan Pola Garis Dasar Kalimat Pada Tulisan Tangan Dengan Menggunakan Algoritma Backpropagation . Grafologi adalah ilmu yang mempelajari karakter seseorang seseorang dengan cara menganalisa tulisan tangan. Menganalisa tulisan tangan sangatlah membantu dalam banyak bidang saat ini, misalnya dalam bidang pendidikan, kriminalitas dan dapat digunakan sebagai konseling. Salah satu cara yang digunakan dalam grafologi untuk mengetahui karakter seseorang, adalah dengan menganalisa pola garis dasar kalimat dari tulisan tangan.Pengenalan tulisan tangan dapat menggunakan jaringan saraf tiruan dengan cara mengklasifikasikan vektor-vektor masukan ke dalam kelas-kelas yang sudah ditentukan, salah satu metode jaringan saraf tiruan adalah backpropagation Data citra yang digunakan untuk analisis melalui tahapan proses image processing terlebih dulu seperti proses cropping, grayscale, edge detection, thresholding, normalisasi dan segmentasi citra. Pola garis dasar yang digunakan pada penelitian ini adalah empat pola garis dasar yaitu, pola garis dasaar naik, pola garis dasar turun, pola garis dasar lurus dan pola garis dasar acak. Setelah melakukan proses pembelajaran dan pengenalan yang telah dilakukan dengan menggunakan algoritma backpropagation dapat digunakan dalam mengenali pola garis dasar tulisan tangan dan diperoleh nilai akurasi sebesar 54.33%. Persentase pengenalan masing Â– masing pola : untuk pola garis dasar lurus 82.35%, untuk pola garis dasar naik 55%, untuk pola garis dasar turun 50% dan untuk pola garis dasar acak 30%. Keyword : Grafologi, Jaringan Saraf Tiruan, Backpropagation, Image Procesing, Garis Dasar, Tulisan Tangan.','pengenalan pola garis dasar kalimat tulis tang algoritma backpropagation grafologi ilmu mempelajari karakter orang orang analisa tulis tang analisa tulis tang sangat bidang bidang didik kriminalitas konseling grafologi karakter orang analisa pola garis dasar kalimat tulis tangan pengenalan tulis tang jaring saraf tiru klasifikasi vektor masuk kelas tentu metode jaring saraf tiru backpropagation data citra analisis tahap image processing terlebih cropping grayscale edge detection thresholding normalisasi segmentasi citra pola garis dasar penelitian pola garis dasar pola garis dasaar naik pola garis dasar turun pola garis dasar lurus pola garis dasar acak pembelajaran pengenalan algoritma backpropagation kenal pola garis dasar tulis tang oleh nilai akurasi persentase pengenalan masing masing pola pola garis dasar lurus pola garis dasar naik pola garis dasar turun pola garis dasar acak keyword grafologi jaring saraf tiru backpropagation image procesing garis dasar tulis tang'),(463,'D','Sistem Mail Marketing Di Yayasan CBN Indonesia . Yayasan Cahaya Bagi Negeri Indonesia (CBNI) adalah sebuah Production House yang menghasilkan produk berupa tayangan (film) kesaksian kisah nyata dan sekolah broadcasting. Yayasan Cahaya Bagi Negeri Indonesia (CBNI) adalah sebuah Production House yang menghasilkan produk berupa tayangan (film) kesaksian kisah nyata dan sekolah broadcasting. Perusahaan CBN berbentuk yayasan sehingga tidak dapat melakukan prosedur bisnis yang menghasilkan keuntungan berupa dana. Yayasan CBN mendapatkan sumber dana dari donasi para Mitra CBN yang telah berkomitmen dan bersedia memberikan bantuan berupa uang setiap bulan sesaui dengan kemampuan mitra yang telah disepakati. Donasi tersebut digunakan untuk membantu kegiatan operasional produksi di CBN. Proses kegiatannya CBN mengalami kesulitan dalam mengelola data campaign yang sudah dikirim dan data subcriber dan tidak dapat mengetahui status dari email yang dikirim kepada mitra dan subcriber. CBN dalam pengiriman email CBN mengalami kesulitan dalam membuat email dan dalam pengiriman email CBN kesulitan dalam menentukan topik email yang akan dikirim di periode berikutnya kepada subcriber dan mitra. Metode analisis perancangan Sistem Mail marketing menggunakan metode object oriented. Metode pembangunan perangkat lunak menggunakan model waterfall. Pemodelan perancangan sistem menggunakan Unified Modelling Language (UML), Sistem dibangun dengan menggunakan bahasa pemrograman PHP dan database MySQL. Sistem Mail marketing yang dibangun memberikan berbagai kemudahan bagi pihak perusahaan. Perusahaan dapat melakukan proses pengiriman email, melihat status tracking, pengelolaan campaign, dan mengambil keputusan untuk topik yang akan di kirim ke subcriber dan mitra. Sistem Mail marketing ini juga menyediakan layanan bagian administrasi bagi pihak perusahaan dalam mengelola data campaing, data subcriber, dan data tracking status.Berdasarkan hasil pengujian secara alpha (dengan menggunakan metode black-box), dan betha (berdasarkan wawancara dari pihak CBN) didapatkan hasil bahwa sistem secara keseluruhan telah berjalan sesuai dengan kebutuhan dan mencapai hasil yang sesuai dengan yang diharapkan dalam membantu kegiatan di CBN Indonesia.Keyword : Pengambilan keputusan, Mail marketing, internet, UML.','sistem mail marketing yayasan cbn indonesia yayasan cahaya neger indonesia cbni production house hasil produk upa tayang film saksi kisah nyata sekolah broadcasting yayasan cahaya neger indonesia cbni production house hasil produk upa tayang film saksi kisah nyata sekolah broadcasting usaha cbn bentuk yayasan prosedur bisnis hasil untung upa dana yayasan cbn dana donasi mitra cbn komitmen sedia bantu upa uang sesaui mampu mitra sepakat donasi operasional produksi cbn giat cbn sulit kelola data campaign kirim data subcriber status email kirim mitra subcriber cbn pengiriman email cbn sulit email pengiriman email cbn sulit tentu topik email kirim periode ikut subcriber mitra metode analisis rancang sistem mail marketing metode object oriented metode bangun angkat lunak model waterfall model rancang sistem unified modelling language uml sistem bangun bahasa pemrograman php database mysql sistem mail marketing bangun mudah usaha usaha pengiriman email status tracking pengelolaan campaign topik kirim subcriber mitra sistem mail marketing sedia layan administrasi usaha kelola data campaing data subcriber data tracking status berdasarkan uji alpha dengan metode black betha dasar wawancara cbn dapat sistem seluruh harap cbn indonesia keyword ambil mail marketing internet uml'),(464,'A','Pembangunan Sistem Informasi Eksekutif Penjualan Di PT Astra International TBK Toyota Sales Operation (AUTO 2000) Cabang Pasteur. PT Astra International Tbk Toyota Sales Operation (Auto 2000) Cabang Pasteur Bandung merupakan salah satu pelaku industri yang bergerak di bidang penjualan kendaraan bermotor atau mobil dengan merk Toyota. Auto 2000 Pasteur juga merupakan importir suku cadang untuk mobil merk Toyota serta memberikan jasa perawatan dan perbaikan kendaraan merk Toyota. Permasalahan yang terjadi di Auto 2000 Pasteur adalah Sistem Informasi Penjualan dan Sistem Informasi Bengkel yang dimiliki Auto 2000 Pasteur belum menyajikan informasi penjualan kendaraan dan informasi jasa service kendaraan khusus untuk seorang Branch Manager, sehingga Branch Manager kesulitan untuk memonitor aktifitas penjualan dan jasa service kendaraan. Akibatnya, Branch Manager menjadi kesulitan dalam mengidentifikasi permasalahan yang ada pada Auto 2000 Pasteur seperti berapa jumlah kendaraan yang terjual, jenis kendaraan yang laku dan kurang laku, customer yang berpotensi dan tidak, berapa jumlah unit service dan jenis kendaraan yang sering service dan tidak serta untuk membuat keputusan atau perencanaan kedepannya terkait permasalahan tersebut. Berdasarkan permasalahan yang ada pada Auto 2000 Pasteur, maka dibutuhkannya suatu pembangunan Sistem Informasi Eksekutif Penjualan. Tujuan pembangunan sistem informasi eksekutif ini membantu Branch Manager dalam mengadakan monitoring terhadap aktifitas penjualan unit kendaraan dan jasa service yang terjadi di Auto 2000 Pasteur serta mengidentifikasi masalah yang terkait dengan hasil monitoring dan membuat keputusan kedepannya. Sistem Informasi Eksekutif merupakan suatu sistem yang khusus dirancang bagi pihak eksekutif atau manajer tingkat perencanaan strategis yang menyediakan informasi mengenai kinerja keseluruhan perusahaan. Informasi diambil dari sistem informasi yang ada dan ditampilkan dalam berbagi tingkat rincian berbentuk grafik, tabel, atau narasi. Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini sudah membantu seorang Branch Manager dalam mengadakan monitoring terhadap aktifitas penjualan unit kendaraan dan jasa service yang terjadi di Auto 2000 Pasteur serta mengidentifikasi masalah yang terkait dengan hasil monitoring dan membuat keputusan kedepannya.Keyword : eksekutif, penjualan, monitoring, sistem informasi eksekutif.','bangun sistem informasi eksekutif jual pt astra international tbk toyota sales operation auto cabang pasteur pt astra international tbk toyota sales operation auto cabang pasteur bandung pela industri gerak bidang jual kendara motor mobil merk toyota auto pasteur importir suku cadang mobil merk toyota jasa rawat baik kendara merk toyota masalah auto pasteur sistem informasi jual sistem informasi bengkel milik auto pasteur saji informasi jual kendara informasi jasa service kendara branch manager branch manager sulit monitor aktifitas jual jasa service kendara akibat branch manager sulit identifikasi masalah auto pasteur berapa kendara jual kendara laku kurang laku customer potensi berapa unit service kendara service rencana depan masalah masalah auto pasteur butuh bangun sistem informasi eksekutif jual tuju bangun sistem informasi eksekutif branch manager adakan monitoring aktifitas jual unit kendara jasa service auto pasteur identifikasi monitoring depan sistem informasi eksekutif sistem rancang eksekutif manajer rencana strategis sedia informasi kinerja seluruh usaha informasi ambil sistem informasi tampil bagi rincian bentuk grafik tabel narasi uji simpul sistem branch manager adakan monitoring aktifitas jual unit kendara jasa service auto pasteur identifikasi monitoring kedepannya keyword eksekutif jual monitoring sistem informasi eksekutif'),(465,'D','Membangun Aplikasi Mobile Komunitas Berbasis Android. Menjadi bagian sebuah komunitas pastilah sangat menyenangkan. Komunitas yang terbentuk di masyarakat sangatlah beragam. Ada komunitas motor, IT, pecinta alam, pecinta kuliner, dan berbagai komunitas menarik dan unik lainnya. Di Indonesia komunitas berkembang sangat pesat, terutama di kota-kota besar. Data dari Bappeda Kota Bandung pada tahun 2008 di Bandung terdapat 5.291 komunitas kreatif. Saat ini banyak yang mengikuti lebih dari satu komunitas, dikarenakan masing-masing orang mempunyai kesukaan atau hobi lebih dari satu. Setiap komunitas dalam menyampaikan informasi dan berinteraksi dengan anggota melalui media sosial dan beberapa sudah menggunakan aplikasi mobile sendiri. Seseorang yang mengikuti lebih dari satu komunitas memerlukan banyak akun media sosial dan menggunakan banyak aplikasi mobile dari komunitas yang diikuti. Sehingga dibutuhkan satu aplikasi saja dari banyaknya komunitas yang diikuti. Kemudian kompresi gambar diperlukan ketika anggota mengupload foto, agar tidak membesarkan pemakaian space dihosting. Berdasarkan hal tersebut, maka dapat disimpulkan perlunya membangun perangkat lunak yang dapat membantu permasalahan para anggota dari komunitas seperti yang sudah dipaparkan sebelumnya. Aplikasi komunitas yang dibangun merupakan perangkat lunak yang berjalan pada perangkat android sehingga mudah untuk diakses dan dibawa kemana saja. Perangkat lunak yang dibangun menggunakan dua pemodelan, yaitu pemodelan terstruktur untuk sub sistem web Admin dan pemodelan berbasis objek untuk sub sistem mobile Pengguna. Platform yang digunakan sebagai pilot project untuk sub sistem mobile adalah android, dengan pertimbangan bahwa android saat ini memiliki pengguna paling besar di dunia. Berdasarkan hasil pengujian menggunakan metode pengujian alpha dan beta dapat disimpulkan bahwa perangkat lunak aplikasi komunitas telah membantu anggota komunitas untuk memperoleh informasi kegiatan komunitas, bergabung dengan lebih dari satu komunitas, bisa saling berinteraksi dengan anggota dikomunitas dan foto yang dikompresi bisa mengurangi ukuran gambar. Sehingga space hosting tidak terlalu besar. Keyword : Komunitas, Mobile Android, Kompresi','bangun aplikasi mobile komunitas basis android komunitas pasti senang komunitas terbentuk masyarakat sangat agam komunitas motor it cinta alam cinta kuliner komunitas tarik unik indonesia komunitas kembang pesat kota data bappeda kota bandung bandung dapat komunitas kreatif ikut komunitas karena suka hobi komunitas sampai informasi interaksi anggota media sosial aplikasi mobile orang ikut komunitas perlu akun media sosial aplikasi mobile komunitas ikut butuh aplikasi banyak komunitas ikut kompresi gambar perlu anggota mengupload foto besar pemakaian space dihosting simpul perlu bangun angkat lunak masalah anggota komunitas papar aplikasi komunitas bangun angkat lunak angkat android mudah akses bawa mana angkat lunak bangun model model struktur sub sistem web admin model basis objek sub sistem mobile guna platform pilot project sub sistem mobile android timbang android guna dunia uji metode uji alpha beta simpul angkat lunak aplikasi komunitas anggota komunitas oleh informasi komunitas gabung komunitas saling interaksi anggota komunitas foto kompresi urang ukur gambar space hosting keyword komunitas mobile android kompresi'),(466,'E','Penerapan Algoritma Negamax Untuk Menghasilkan Langkah Yang Optimal Pada Permainan Dam Daman . Permainan dam daman merupakan permainan tradisional, permainan ini dimainkan oleh dua pemain. Permainan ini dimainkan di papan atau karton yang telah digambar. Dalam permainan ini terdapat 16 bidak untuk setiap pemain. Tujuan permainan ini adalah untuk menghabiskan bidak lawan dengan aturan yang telah disepakati bersama sebagai akhir permainannya. Pada permainan dam daman ini terdapat banyak langkah. Satu bidak bisa mempunyai lebih dari dua kemungkinan langkah yang bisa diambil. Dari beberapa langkah tersebut ada yang menguntungkan, ada juga yang merugikan pemain. Jika pemain mengambil langkah bidak secara acak, maka kemungkinan kalah akan lebih besar. Untuk mencari langkah pergerakan bidak yang menguntungkan digunakan algoritma Depth-First Search. Salah satu algoritma DFS adalah algoritma negamax. Algoritma ini menggunakan dua buah fungsi, satu fungsi untuk memaksimalkan dan satu untuk meminimalkan kedua fungsi tersebut digabung menjadi satu fungsi yang dapat menegasikan dan terbalik setiap kali pemanggilannya. Dan untuk mempersempit pencarian digunakan algoritma alpha beta prunning. Tujuan dari penelitian ini adalah untuk mengetahui banyaknya kemungkinan langkah yang bisa diambil dan tingkat kemenangan dengan menggunakan algoritma negamax. Banyaknya kemungkinan langkah yang bisa diambil berdasarkan hasil pencarian algoritma negamax adalah sebanyak 10 langkah kemungkinan. Sedangkan tingkat kemenangan komputer masih rendah, yaitu hanya 40%. Algoritma negamax yang diterapkan pada permainan dam daman belum optimal. Keyword : Dam daman, negamax, alpha beta prunning','penerapan algoritma negamax hasil langkah optimal main dam daman main dam daman main tradisional main main main main main papan karton gambar main dapat bidak main tuju main habis bidak lawan atur sepakat main main dam daman dapat langkah bidak langkah ambil langkah untung rugi main main langkah bidak acak kalah langkah gerak bidak untung algoritma depth search algoritma dfs algoritma negamax algoritma buah fungsi fungsi maksimal minimal fungsi gabung fungsi negasi balik pemanggilan sempit cari algoritma alpha beta prunning tuju penelitian banyak langkah ambil menang algoritma negamax banyak langkah ambil cari algoritma negamax langkah menang komputer rendah algoritma negamax terap main dam daman optimal keyword dam daman negamax alpha beta prunning'),(467,'A','Pembangunan Sistem Informasi Distribusi Produk Dengan Pendekatan Metode Supply Chain Management Di KPS Gunung Gede Sukabumi. KPS Gunung Gede Sukabumi adalah koperasi yang memproduksi produk olahan susu. KPS Gunung Gede memiliki agen pemasaran yang tersebar di berbagai kota. KPS Gunung Gede melakukan pengadaan bahan baku kepada supplier untuk memenuhi kebutuhan produk yang dipesan oleh agen. Menentuan jumlah bahan baku, sering kali mangalami kesulitan dikarenakan ketidakpastian pemesanan yang dilakukan agen. Waktu yang diperlukan dalam pengadaan bahan baku ke supplier sampai bahan baku diterima memerlukan waktu tunggu sekitar satu minggu, akibatnya tidak dapat memenuhi pemesanan produk. Berdasarkan permasalahan yang ada pada saat ini maka dibutuhkan suatu pembangunan sistem informasi distribusi produk dengan pendekatan metode Supply Chain Management di KPS Gunung Gede Sukabumi. Tujuannya adalah mempermudah dalam menentukan jumlah bahan baku yang dipesan ke supplier untuk memenuhi kebutuhan produk yang dipesan oleh agen dan mempermudah dalam menjadwalkan pendistribusian produk ke setiap agen. Metode peramalan yang digunakan adalah single exponential smoothing. Perhitungan dalam menentukan jumlah persediaan produk menggunakan safety stock. Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem informasi yang dibangun ini mempermudah manager pengolahan susu KPS Gunung Gede Sukabumi dalam menentukan jumlah bahan baku yang dipesan, mengendalikan data produk dan bahan baku, mendapat informasi pengiriman produk dan melakukan persetujuan pemesanan produk dan pengadaan bahan baku. Keyword : Supply Chain Management, Single Exponential Smoothing, Safety Stock.','bangun sistem informasi distribusi produk dekat metode supply chain management kps gunung gede sukabumi kps gunung gede sukabumi koperasi produksi produk olah susu kps gunung gede agen pemasaran tersebar kota kps gunung gede ada bahan baku supplier penuh produk pesan agen tentu bahan baku mangalami sulit karena ketidakpastian mesan agen perlu ada bahan baku supplier bahan baku terima perlu tunggu akibat penuh mesan produk masalah butuh bangun sistem informasi distribusi produk dekat metode supply chain management kps gunung gede sukabumi tuju mudah tentu bahan baku pesan supplier penuh produk pesan agen mudah jadwal distribusi produk agen metode ramal single exponential smoothing hitung tentu sedia produk safety stock uji simpul sistem informasi bangun mudah manager olah susu kps gunung gede sukabumi tentu bahan baku pesan kendali data produk bahan baku informasi pengiriman produk tuju mesan produk ada bahan baku keyword supply chain management single exponential smoothing safety stock'),(468,'C','Pembangunan Game Edukasi Obat Herbal Berbasis Android . Obat herbal adalah obat yang berasal dari tumbuhan yang diproses atau diekstrak sedemikian rupa sehingga menjadi serbuk, pil atau cairan yang dalam prosesnya tidak menggunakan zat kimia. Minat masyarakat dalam menggunakan herbal terus meningkat. Akan tetapi kepercayaan masyarakat mulai berkurang akibat banyaknya produk jamu yang menggunakan bahan sintetis. Maka dari itu diperlukan upaya terus menerus untuk mengembalikan kepercayaan masyarakat akan obat melalui tanaman herbal dan salah satu upaya itu kita mulai dari anak-anak, karena anak-anak banyak yang belum mengenal obat-obat yang terbuat dari tanaman. Game edukasi dapat menjadi sebuah metode pembelajaran yang bisa digunakan pada saat ini. Pembelajaran yang dilakukan berupa cara bermain, alur cerita dan materi-materi yang terdapat dalam game. Game dengan menggunakan perangkat mobile memiliki kelebihan yaitu pembelajaran bisa dilakukan dimana saja dan kapan saja. Dengan banyaknya remaja yang menggunakan Android sebagai teknologi mobile di Indonesia, Android menjadi platform yang paling cocok untuk diterapkannya game edukasi. Pemodelan yang digunakan dalam pembangun game ini menggunakan UML (Unified Modelling Language). Game dibangun menggunakan Game Maker Studio. Berdasarkan hasil implementasi, pengujian alpha dan beta dapat disimpulkan game edukasi dapat membantu pengguna untuk mengenal tanaman obat dan memberikan visualisasi cara membuat obat herbal. Keyword : Tanaman Herbal, Obat Herbal, Game, Game Edukasi, Android','bangun game edukasi obat herbal basis android obat herbal obat asal tumbuh proses ekstrak demikian rupa serbuk pil cair proses zat kimia minat masyarakat herbal tingkat percaya masyarakat kurang banyak produk jamu bahan sintetis perlu terus kembali percaya masyarakat obat tanam herbal anak anak kenal obat buat tanam game edukasi metode pembelajaran pembelajaran upa main alur cerita materi dapat game game angkat mobile lebih pembelajaran mana kapan banyak remaja android teknologi mobile indonesia android platform cocok terap game edukasi model bangun game uml unified modelling language game bangun game maker studio implementasi uji alpha beta simpul game edukasi guna kenal tanam obat visualisasi obat herbal keyword tanam herbal obat herbal game game edukasi android'),(469,'D','Pembangunan Aplikasi M-Store Untuk Pemesanan Produk Di Viking Fanshop Bandung Menggunakan Platform Android . The Original Viking Persib Fanshop merupakan perusahaan yang bergerak dalam bidang pengelolaan, produksi dan penjualan berbagai macam merchandise pernak-pernik supporter Persib Bandung. Pembelian produk pada toko tersebut dilakukan costumer dengan cara melakukan pembelanjaan dan pemesanan langsung ke tempat lokasi distro tersebut maupun secara online. Costumer yang biasanya berasal dari luar Kota Bandung maupun yang berasal dari dalam Kota Bandung mereka terkadang merasa kesulitan dalam mencari alamat lokasi toko tersebut. Kurangnya informasi mengenai lokasi yang didapat akan sulit untuk menemukan toko tersebut. Kurangnya informasi mengenai produk Â– produk yang akan dibeli atau dipesan oleh costumer dapat membuat kostumer merasa kecewa, apabila costumer yang menghampiri lokasi distro dan ternyata produk yang diinginkan tidak ada, sehingga pihak toko menyarankan untuk membeli produk tersebut ke cabang lain. Dalam mengatasi hal tersebut maka Location based service serta web service dibutuhkan untuk memecahkan masalah yang terjadi saat ini.Perangkat lunak ini dibangun berbasis mobile dengan pertimbangan android merupakan sistem operasi yang mendominasi peredaran pasar smartphone di Indonesi dengan pembagian pasar sebesar 59,91 % di tahun 2014. Perangkat lunak yang dibangun dapat membantu costumer the original viking fanshop bandung dalam membeli produk yang diinginkan. Keyword : Pembelian, Pemesanan, Location Based service, Web service, rekomendasi','bangun aplikasi m mesan produk viking fanshop bandung platform android original viking persib fanshop usaha gerak bidang pengelolaan produksi jual macam merchandise pernak supporter persib bandung beli produk toko costumer belanja mesan lokasi distro online costumer asal kota bandung asal kota bandung kadang sulit alamat lokasi toko kurang informasi lokasi dapat sulit temu toko kurang informasi produk produk beli pesan costumer kostumer kecewa apabila costumer hampir lokasi distro produk ingin toko saran beli produk cabang atas location based service web service butuh pecah ini perangkat lunak bangun basis mobile timbang android sistem operasi dominasi edar pasar smartphone indonesi bagi pasar angkat lunak bangun costumer original viking fanshop bandung beli produk ingin keyword beli mesan location based service web service rekomendasi'),(470,'C','Pembangunan Aplikasi Multimedia Pembelajaran Matematika kelas VII Sekolah Menengah Pertama Sebagai Media Pembelajaran Di Rumah Belajar Gravitasi . Rumah Belajar Gravitasi merupakan lembaga bimbingan belajar yang berada di jalan Pelesiran 20C Bandung. Target siswa yang dituju oleh Gravitasi adalah siswa SD, SMP, dan SMA dengan berfokus pada mata pelajaran Matematika, Bahasa Inggris, dan IPA. Menurut Aditya yang merupakan manajer utama bahwa pada kali pembelajaran lebih terfokus pada siswa SMP. berdasarkan hasil survei kepada siswa SMP di Rumah Belajar Gravitas mengenai pelajaran yang diajarkan, 50% siswa memilih matematika sebagai pelajaran yang paling sulit dibanding pelajaran yang lainnya. Beberapa kendala yang terjadi pada kali ini ada pada kewajiban pengajar dalam menggambarkan mind mapping yang dapat menghabiskan waktu pembelajaran dan dalam mesiumlasikan contoh kasus pada siswa perlu dilakukan berulang kali karena siswa sulit mengerti. Aplikasi Multimedia Pembelajaran Matematika Kelas VII SMP merupakan aplikasi yang dibangun dengan menerapkan metode pembelajaran Computer Aided Learning (CAL) yang di dalamnya membahas materi matematika kelas VII SMP, mind mapping, simulasi contoh kasus, contoh soal, dan latihan soal. Pengujian yang dilakukan adalah pengujian alfa (black box) yang berfokus pada persyaratan fungsional perangkat lunak dan pengujian beta yang dilakukan dengan wawancara dan pretest-posttest. Berdasarkan hasil penelitian dan pengujian mengenai multimedia pembelajaran yang dibangun, didapat hasil bahwa setelah siswa belajar menggunakan aplikasi yang dibangun persentase hasil evaluasi pun meningkat. Kenaikan persentase berikut menunjukan bahwa penerapan aplikasi multimedia pembelajaran matematika kelas VII SMP dapat meningkatkan pemahaman siswa di Rumah Belajar Gravitasi.Keyword : Mind Mapping, Matematika, Multimedia Pembelajaran, Computer Aided Learning.','bangun aplikasi multimedia pembelajaran matematika kelas vii sekolah tengah media pembelajaran rumah belajar gravitasi rumah belajar gravitasi lembaga bimbing belajar lesir bandung target siswa tuju gravitasi siswa sd smp sma fokus mata pelajaran matematika bahasa inggris ipa aditya manajer pembelajaran fokus siswa smp survei siswa smp rumah belajar gravitas pelajaran ajar siswa pilih matematika pelajaran sulit banding pelajaran kendala wajib ajar gambar mind mapping habis pembelajaran mesiumlasikan contoh kasus siswa ulang siswa sulit erti aplikasi multimedia pembelajaran matematika kelas vii smp aplikasi bangun terap metode pembelajaran computer aided learning cal dalam bahas materi matematika kelas vii smp mind mapping simulasi contoh kasus contoh soal latih soal uji uji alfa black box fokus syarat fungsional angkat lunak uji beta wawancara pretest penelitian uji multimedia pembelajaran bangun dapat siswa belajar aplikasi bangun persentase evaluasi tingkat naik persentase ikut tunjuk penerapan aplikasi multimedia pembelajaran matematika kelas vii smp pemahaman siswa rumah belajar gravitasi keyword mind mapping matematika multimedia pembelajaran computer aided learning'),(471,'D','Pembangunan Aplikasi Pembelajaran Interaktif Pada Mata pelajaran IPA Kelas IV Di SDN Leuwi Bandung 01. Sekolah Dasar Negeri (SDN) Leuwi Bandung 01 merupakan salah satu Sekolah Dasar yang berlokasi di Kecamatan Dayeuhkolot Kabupaten Bandung. Proses belajarnya dilakukan dengan cara bertatap muka antara guru dengan murid yang menggunakan sarana buku dalam penyampaian materi IPA. Sedangkan untuk proses pembelajaran diluar kelas dilakukan secara mandiri oleh siswa dan dibantu dengan pemberian soal-soal latihan untuk dapat melatih/membantu siswa agar kompeten dalam memahami materi yang telah diberikan dikelas. Berdasarkan hasil kuisioner yang dilakukan terhadap 30 siswa diperoleh kesimpulan bahwa 16 dari 30 siswa atau sekitar 76,7% menyatakan bahwa siswa mengalami kesulitan dalam mengerjakan Pekerjaan Rumah (PR) atau soal-soal latihan materi IPA ketika mengerjakan dirumah. Maka dibutuhkan suatu aplikasi untuk membantu siswa belajar materi IPA secara mandiri atau mengulang materi yang sudah diberikan dikelas dapat diakses dirumah. Melihat dari pemasalahan yang ada sehingga perlu untuk menambah fasilitas pendukung pembelajaran yang mampu membantu siswa dalam memahami materi pelajaran serta meningkatkan minat belajar siswa. Materi yang ada pada buku pelajaran dapat lebih mudah dipahami jika disajikan dalam bentuk simulasi karena dapat digunakan untuk memperjelas materi yang ada. Pembangunan aplikasi pembelajaran ini harus melalui tahapan sesuai dengan metode pengembangan multimedia dan melakukan pengujian sistem yang terdiri dari pengujian black box dan beta, dimana pengujian black box berfokus pada persyaratan fungsional perangkat lunak, sedangkan pengujian beta berfokus pada pengujian lapangan seperti kuesioner dan wawancara. Berdasarkan hasil pengujian sistem, maka dapat disimpulkan bahwa aplikasi pembelajaran yang dibangun dapat membantu siswa dalam memahami materi mata pelajaran IPA dan meningkatkan minat belajar siswa pada mata pelajaran IPA. Keyword : Aplikasi, Pembelajaran, IPA, Simulasi.','bangun aplikasi pembelajaran interaktif mata pelajaran ipa kelas iv sdn leuwi bandung sekolah dasar neger sdn leuwi bandung sekolah dasar lokasi camat dayeuhkolot kabupaten bandung belajar tatap muka guru murid sarana buku sampai materi ipa pembelajaran luar kelas mandiri siswa bantu beri soal latih melatih membantu siswa kompeten paham materi berik kelas kuisioner siswa oleh simpul siswa siswa sulit kerja kerja rumah pr soal latih materi ipa kerja rumah butuh aplikasi siswa belajar materi ipa mandiri ulang materi berik kelas akses rumah masalah tambah fasilitas dukung pembelajaran siswa paham materi pelajaran minat belajar siswa materi buku pelajaran mudah paham saji simulasi jelas materi bangun aplikasi pembelajaran tahap metode pengembangan multimedia uji sistem diri uji black box beta mana uji black box fokus syarat fungsional angkat lunak uji beta fokus uji lapang kuesioner wawancara uji sistem simpul aplikasi pembelajaran bangun siswa paham materi mata pelajaran ipa minat belajar siswa mata pelajaran ipa keyword aplikasi pembelajaran ipa simulasi'),(472,'E','Implementasi Teknologi Intel Perceptual Computing Pada Pembangunan Game Kompilasi Permainan Tradisional . Di zaman yang serba canggih, permainan tradisional semakin terlupakan. Menurut Khasan kepala sekolah salah satu sekolah dasar Islam Athirah Kajaolalido, 99% siswa-siswanya belum mengenal permainan-permainan tradisional. Anak-anak lebih tertarik dengan permainan canggih seperti teknologi game yang perkembangannya semakin pesat. Padahal permainan tradisional memiliki manfaat bagi perkembangan anak seperti gerakan-gerakan yang menuntut ketangkasan anak seperti berlari, memukul, dan melempar tanpa disadari melatih motorik anak. Dalam upaya pelestarian permainan tradisional dan menarik minat anak untuk memainkannya, tidak sedikit pengembang game yang mengembangkan game dengan tema permainan tradisional, namun esensi gerakan dari permainan tradisional hilang karena penggunaan joystick,ataupun virtual button yang menjadi kendali dalam permainan. Untuk itu dalam pengembangan game dengan tema permainan tradisional seharusnya tidak melupakan esensi gerakan. Dengan teknologi yang berkembang saat ini memungkinkan gerakan anggota tubuh seperti tangan, dan wajah dapat dijadikan kendali dalam game. Intel Perceptual Computing merupakan salah satu bentuk dari teknologi yang memungkinkan manusia berinteraksi dengan komputer menggunakan bahasa alami seperti bahasa tubuh. Hal ini kemudian menjadi menarik untuk diimplementasikan terhadap pengembangan game bertemakan permainan tradisional sehingga dalam upaya pelestarian permainan tradisional, gerakan dalam permainan tradisional tetap dapat dirasakan anak-anak manfaatnya. Kemudian dilakukan tahap pengujian untuk memastikan permainan berjalan dengan baik. Pengujian yang digunakan dalam penelitian ini adalah pengujian blackbox dan pengujian beta. Berdasarkan hasil pengujian maka dapat diperoleh kesimpulan bahwa teknologi Intel Perceptual Computing dapat diimplementasikan dalam pembangunan game dengan tema permainan tradisional dengan melalui berbagai penyesuaian sehingga gesture yang digunakan dalam game menyerupai gerakan asli saat memainkan permainan tradisional. Keyword : permainan tradisional, Intel Perceptual Computing','implementasi teknologi intel perceptual computing bangun game kompilasi main tradisional zaman serba canggih main tradisional lupa khas kepala sekolah sekolah dasar islam athirah kajaolalido siswa kenal main tradisional anak tarik main canggih teknologi game kembang pesat main tradisional manfaat kembang anak gerak tuntut tangkas anak lari pukul lempar sadar latih motorik anak lestari main tradisional tarik minat anak ain pengembang game kembang game tema main tradisional esensi gerak main tradisional hilang joystick atau virtual button kendali main pengembangan game tema main tradisional harus lupa esensi gerak teknologi kembang mungkin gerak anggota tubuh tang wajah jadi kendali game intel perceptual computing teknologi mungkin manusia interaksi komputer bahasa alami bahasa tubuh tarik implementasi pengembangan game temak main tradisional lestari main tradisional gerak main tradisional tetap rasa anak manfaat tahap uji pasti main uji penelitian uji blackbox uji beta uji oleh simpul teknologi intel perceptual computing implementasi bangun game tema main tradisional suai gesture game rupa gerak asli ain main tradisional keyword main tradisional intel perceptual computing'),(473,'C','Pembangunan Aplikasi Virtual Di Studio Siaran Dan Ruang Kelas DJ Arie Radio Broadcasting School Bandung . Tujuan melakukan penelitian ini untuk membuat tampilan multimedia digital yang berisikan virtual tur tempat kursus DJ Arie Radio Broadcasting School Bandung. Saat ini di dunia yang teknologinya semakin berkembang maju, kebutuhan akan media pengenalan dan promosi serta informasi yang juga semakin meninggi. Virtual tur merupakan teknologi yang menggabungkan fotografi dengan informasi yang bertujuan untuk memberikan informasi secara menyeluruh dengan tampilan yang mirip seperti tampilan nyata. Informasi yang dimaksudkan dapat meliputi objek yang berada di ruangan luar maupun dalam. Disimpulkan bahwa dengan adanya aplikasi DJ Arie School dapat membantu pengguna untuk mengetahui informasi yang dibutuhkan dan membantu admin untuk menyampaikan informasi yang dibutuhkan oleh pengguna dan serta membuat minat pengguna aplikasi ini untuk daftar kursus di DJ Arie School Bandung. Keyword : Virtual Tur, Informasi, Pengenalan, Simulasi.','bangun aplikasi virtual studio siar kelas dj arie radio broadcasting school bandung tuju penelitian tampil multimedia digital risik virtual tur kursus dj arie radio broadcasting school bandung dunia teknologi kembang maju media pengenalan promosi informasi tinggi virtual tur teknologi gabung fotografi informasi tuju informasi seluruh tampil mirip tampil nyata informasi maksud liput objek ruang simpul aplikasi dj arie school guna informasi butuh admin sampai informasi butuh guna minat guna aplikasi daftar kursus dj arie school bandung keyword virtual tur informasi pengenalan simulasi'),(474,'C','Implementasi IP VPN Menggunakan Mikrotik Pada Jaringan XYZ MART. XYZ Mart merupakan suatu perusahaan di bidang perdagangan dan distribusi juga sudah masuk dalam sektor minimarket. Saat ini, XYZ Mart tersebar di Indonesia. XYZ Mart masih menggunakan sistem manjemen yang terpusat, yaitu setiap gerai harus melaporkan semua laporan informasi atau data pemasukan dan pengeluaran setiap harinya ke kantor pusat. Tentu dengan banyak gerai yang tersebar ini akan bertambah sulit untuk mengatur dan mengontrol sebuah data dari gerai-gerai yang tersebar tersebut. Padahal, kebutuhan akan laporan-laporan dan informasi data yang akurat, dan update sangat penting untuk kemajuan XYZ Mart. Saat ini laporan-laporan dan informasi data yang dikirim ke kantor pusat kurang efisien. Hal ini terjadi karena hanya mengandalkan koneksi internet untuk mengirimkan eMail yang berisi laporan-laporan dan informasi data ke kantor pusat. Juga, pada setiap gerai, manajemen bandwidth (QOS) yang dipakai tidak dikendalikan atau diatur, sehingga terjadi pemakaian bandwidth secara berlebihan oleh satu user atau beberapa user. Pemakaian secara berlebihan tersebut akan menyebabkan komputer yang lain tidak mendapatkan alokasi bandwidth. Pada akhirnya, jaringan pada setiap gerai XYZ Mart ini tidak dapat memberikan layanan (service) secara maksimal kepada seluruh user yang ada. Keadaan ini akan bertambah parah jika jaringannya ternyata hanya memiliki alokasi bandwith internet yang terbatas. Maka dari itu salah satu konsep yang bisa diterapkan untuk kelancaran dalam mengatur dan mengontrol sebuah data yaitu konsep IP VPN (Internet Protocol Â– Virtual Private Network). IP VPN (Internet Protocol Â– Virtual Private Network) adalah suatu layanan komunikasi data yang memungkinkan untuk dapat terkoneksi ke jaringan publik dan menggunakannya untuk dapat bergabung dengan jaringan lokal. Oleh karena itu, metode ini sangat tepat bagi perusahaan dengan banyak cabang seperti XYZ Mart. Keyword : XYZ Mart, IP VPN.','implementasi ip vpn mikrotik jaring xyz mart xyz mart usaha bidang dagang distribusi sektor minimarket xyz mart tersebar indonesia xyz mart sistem manjemen pusat gerai lapor lapor informasi data masuk pengeluaran hari kantor pusat gerai tersebar tambah sulit atur kontrol data gerai tersebar lapor informasi data akurat update maju xyz mart lapor informasi data kirim kantor pusat kurang efisien andal koneksi internet kirim email isi lapor informasi data kantor pusat gerai manajemen bandwidth qos pakai kendali atur pemakaian bandwidth lebih user user pemakaian lebih komputer alokasi bandwidth jaring gerai xyz mart layan service maksimal user ada tambah parah jaring alokasi bandwith internet batas konsep terap lancar atur kontrol data konsep ip vpn internet protocol virtual private network ip vpn internet protocol virtual private network layan komunikasi data mungkin koneksi jaring publik guna gabung jaring lokal metode tepat usaha cabang xyz mart keyword xyz mart ip vpn'),(475,'E','Implementasi Algoritma Simple Hirerachical Ordered Planner Pada Game Strategi Untuk Manajemen Sumber Daya Dan Pasukan . Game adalah salah satu bentu hasil yang diciptakan dari bahasa pemrograman. Dalam game terdapat banyak unsur meliputi gameplay,cerita , grafis , dan aturan yang ada didalamnya. Game juga ada yang memiliki Artificial Intelligence untuk berinteraksi dengan pemain sehingga pemain seakan Â– akan berhadapan dengan pemain lain yang sebenarnya. Game memiliki wilayah yang kompleks, untuk itu dibutuhkan algoritma yang dapat menjalani berbagai proses komputasi didalam game. Berdasarkan hasil penelitian sebelumnya game strategi yang telah diteliti memiliki algoritma greedy. Namun setelah di lakukan eksperimen terhadap game tersebut memiliki masalah pada saat menangani pemain yang agresif sehingga dalam efisiensi mengolah sumber daya kurang dari 50%. Untuk itu dalam hal algoritma untuk mengolah manajemen sumber daya yang baik diperlukan pada game. Salah satu alternatif yaitu algoritma simple hierarchical ordered planner yang ditanam pada game untuk menangani manajemen sumber daya dan pasukan. Pada penelitian ini di fokuskan bagaimana AI bekerja pada lingkungan sehingga algoritma ini akan ditanam pada lingkungan yang hampir mirip mendekati sesungguhnya. Penelitian mengkaji berbagai aspek dalam game strategi itu sendiri. Mengatur pekerja , mengatur pasukan, produksi sumber daya untuk keperluan lain. Berdasarkan hasil pengujian algoritma yang telah diteliti telah mencapai tujuan yaitu mendapatkan nilai rasio dari efisiensi sehingga algoritma ini bisa menghasilkan nilai rasio 80% dalam game strategi untuk manajemen sumber daya dan pasukan. Keyword : Game, Artifical Intelligence, algoritma,manajemen sumber daya, strategi.','implementasi algoritma simple hirerachical ordered planner game strategi manajemen daya pasuk game bentu cipta bahasa pemrograman game dapat unsur liput gameplay cerita grafis atur dalam game artificial intelligence interaksi main main akan hadap main game wilayah kompleks butuh algoritma komputasi dalam game penelitian game strategi teliti algoritma greedy laku eksperimen game menangani main agresif efisiensi o daya kurang algoritma o manajemen daya perlu game alternatif algoritma simple hierarchical ordered planner tanam game menangani manajemen daya pasuk penelitian fokus a kerja lingkung algoritma tanam lingkung mirip dekat sungguh penelitian kaji aspek game strategi atur kerja atur pasuk produksi daya perlu uji algoritma teliti tuju nilai rasio efisiensi algoritma hasil nilai rasio game strategi manajemen daya pasuk keyword game artifical intelligence algoritma manajemen daya strategi'),(476,'D','Pembangunan Aplikasi Mobile Searching Engine Untuk Panduan Belanja Pada Factory Outlet Black And White . Factory Outlet Black and White adalah usaha retail yang bergerak di bidang penjualan pakaian. Sistem yang sedang berjalan pada Factory Outlet ini sekarang yaitu pelanggan atau masyarakat jika datang ke Factory Outlet Black and White, mareka harus mencari barang terlebih dahulu di Factory Outlet tersebut. Jika barang tersebut tidak ditemukan maka pelanggan atau masyarakat harus mencari di Factory Outlet yang lainnya. Hal ini yang membuat pelanggan atau masyarakat yang mencari barang belanjaanya mengalami kesulitan dalam berbelanja dan banyak waktu pelanggan atau masyarakat terbuang begitu saja hanya karena sulitnya mencari barang belanjaanya. Sehingga untuk memudahkan pelanggan atau masyarakat yang senang berbelanja dengan memliki waktu yang sangat singkat maka dibangunlah aplikasi Mobile Searching Engine untuk dapat membantu pelanggan atau masyarakat dalam memandu panduan belanja secara online dengan menggunakan teknologi Location Based Service yang menampilkannya kedalam sebuah peta pada smartphone android. Aplikasi yang dibangun dapat menampilkan produk yang ditawarkan, ukuran produk, harga produk, stok produk, serta jarak terdekat antara Factory Outlet dan Pelanggan. Berdasarkan hasil pengujian, dapat disimpulkan bahwa hasil pengujian dapat dijalankan meskipun ada beberapa faktor yang memungkinkan bila terjadinya kesalahan pada saat aplikasi dijalankan. sedangkan hasil pengujian lainnya dapat disimpulkan bahwa aplikasi yang dibangun dapat membantu dalam mencari informasi seputar keberadaan Factory Outlet Black and White, barang yang dicari, dan jarak terdekat antara pelanggan dengan Factory Outlet Black and  White menggunakan teknologi Location Based Service. Keyword : Mobile Searching, TeknologiLocation Based Service, Peta','bangun aplikasi mobile searching engine pandu belanja factory outlet black and white factory outlet black and white usaha retail gerak bidang jual pakai sistem factory outlet langgan masyarakat factory outlet black and white mareka terlebih dahulu factory outlet langgan masyarakat factory outlet langgan masyarakat belanjaa sulit belanja langgan masyarakat buang sulit belanjaa mudah langgan masyarakat senang belanja lik singkat bangun aplikasi mobile searching engine langgan masyarakat pandu pandu belanja online teknologi location based service tampil dalam peta smartphone android aplikasi bangun tampil produk ditawarkan ukur produk harga produk stok produk jarak terdekat factory outlet langgan uji simpul uji jalan ski faktor mungkin jadi salah aplikasi jalan uji simpul aplikasi bangun informasi putar rada factory outlet black and white cari jarak terdekat langgan factory outlet black and white teknologi location based service keyword mobile searching teknologilocation based service peta'),(477,'E','Implementasi Algoritma Alpha Beta Pruning Untuk Mencari Posisi Agent Dalam Menentukan Keputusan Passing Pada Simulator Robot Soccer Dua Dimensi . Robot sepak bola atau yang dikenal dengan robosoccer merupakan salah satu contoh implementasi antara teknologi robotika dan kecerdasan buatan yang bertujuan untuk menciptakan sebuah robot yang dapat bermain sepak bola. Pemain sepak bola virtual atau agent dituntut untuk mempunyai kecerdasan individu maupun kerjasama tim dalam memilih aksi-aksi yang tepat pada kondisi tertentu. Salah satu aksi individu dalam sepak bola adalah mengoper bola pada teman satu tim atau yang biasa disebut passing. Passing pada pemain penyerang bertujuan untuk menciptakan ruang sehingga pemain dapat menciptakan gol ke gawang lawan dan dapat mempertahankan daerah pertahanan bagi pemain bertahan. Faktor yang mempengaruhi dalam mengoper bola antara lain posisi pemain, jarak musuh, jarak gawang lawan dan jarak bola. Alpha Beta Pruning merupakan metode yang digunakan untuk membantu mengoptimalkan pencarian posisi teman dalam mengoper bola. Sehingga dalam situasi menyerang dapat memperbesar peluang mencetak gol ke gawang lawan dan dalam situasi bertahan dapat mempertahankan daerah pertahanan. Algoritma Alpha Beta pruning diuji dengan cara membuat sebuah skenario dimana agent yang akan menerima bola ditempatkan pada posisi tertentu, hasil dari pengujian skenario tersebut algoritma Alpha beta Pruning memilih posisi agent yang mempunyai nilai tertinggi. Sedangkan hasil pemanfaatan algoritma Alpha Beta pruning pada tim yang dikembangkan menunjukkan performa umpan bola yang lebih baik dibandingkan ketika tim belum menggunakan algoritma Alpha Beta pruning. Dimana akurasi umpan bola yang dilakukan oleh tim yang dikembangkan menghasilkan 71,42% umpan yang berhasil dari 119 kali percobaan dan 28,57% umpan yang gagal dari 119 kali percobaan. Keyword : Alpha Beta Pruning, Robotika, Simulasi Robot Sepak Bola, Umpan Bola','implementasi algoritma alpha beta pruning agent tentu passing simulator robot soccer dimensi robot sepak bola kenal robosoccer contoh implementasi teknologi robotika cerdas buat tuju cipta robot main sepak bola main sepak bola virtual agent tuntut cerdas individu kerjasama tim pilih aksi tepat tertentu aksi individu sepak bola oper bola tim sebut passing passing main serang tuju cipta main cipta gol gawang lawan tahan daerah tahan main tahan faktor pengaruh oper bola main jarak musuh jarak gawang lawan jarak bola alpha beta pruning metode optimal cari oper bola situasi serang besar luang cetak gol gawang lawan situasi tahan tahan daerah tahan algoritma alpha beta pruning uji skenario mana agent bola tempat tertentu uji skenario algoritma alpha beta pruning pilih agent nilai tinggi manfaat algoritma alpha beta pruning tim kembang performa umpan bola banding tim algoritma alpha beta pruning mana akurasi umpan bola tim kembang hasil umpan hasil coba umpan gagal coba keyword alpha beta pruning robotika simulasi robot sepak bola umpan bola'),(478,'D','Aplikasi Peta Objek Wisata Kabupaten Pangandaran Berbasis Android . Penelitian ini berjudul Aplikasi Peta Objek Wisata Kabupaten Pangandaran Berbasis Android. Penelitian ini dilatar belakangi oleh kasus peta objek wisata Kabupaten Pangandaran yang masih manual, dan laporan data jumlah pengunjung objek wisata yang hanya diberikan 1 bulan sekali. Hal ini mengakibatkan kesulitan dalam pencarian lokasi objek wisata dan mengakibatkan pihak yang tidak bertanggung jawab memanipulasi data jumlah pengunjung. Oleh sebab itu dilakukan penelitian pada Dinas Pariwisata Kabupaten Pangandaran, dengan tujuan untuk membuat aplikasi yang dapat membantu mengolah data pariwisata, dan membantu wisatawan mendapatkan informasi objek wisata Kabupaten Pangandaran. Hasil penelitian ini berupa aplikasi peta objek wisata kabupaten Pangandaran berbasis android, yang memiliki beberapa fungsi seperti menunjukan informasi objek wisata berupa lokasi, jalur, jarak dengan menggunakan teknologi mobile GPS, menampilkan jumlah pengunjung di setiap objek wisata, menampilkan informasi hotel dan reservasi,serta informasi tentang UKM. Keyword : Peta, Android, Teknologi Mobile, GPS.','aplikasi peta objek wisata kabupaten pangandaran basis android penelitian judul aplikasi peta objek wisata kabupaten pangandaran basis android penelitian latar belakang kasus peta objek wisata kabupaten pangandaran manual lapor data unjung objek wisata berik akibat sulit cari lokasi objek wisata akibat tanggung jawab manipulasi data unjung penelitian nas pariwisata kabupaten pangandaran tuju aplikasi o data pariwisata wisatawan informasi objek wisata kabupaten pangandaran penelitian upa aplikasi peta objek wisata kabupaten pangandaran basis android fungsi tunjuk informasi objek wisata upa lokasi jalur jarak teknologi mobile gps tampil unjung objek wisata tampil informasi hotel reservasi serta informasi ukm keyword peta android teknologi mobile gps'),(479,'E','Implementasi Augmented Reality Untuk Perumahan SBTN Regency Berbasis Android . Dalam melaksanakan berbagai kegiatan promosi pihak marketing office sbtn regency melakukan promosi perumahan dengan berbagai cara seperti brosur, spanduk, online, dan seorang sales freelance dalam menjelaskan rumah yang dipasarkan. Media promosi tersebut hanya menampilkan informasi rumah dalam bentuk gambar, dan para sales hanya menjelaskan rumah sesuai brosur kepada para konsumen. Para konsumen kesulitan dalam membayangkan bentuk rumah dari brosur tersebut. Konsumen apabila ingin melihat bentuk rumah secara detail harus mendatangi kantor pemasaran. Dengan menerapkan teknologi augmented reality, brosur yang biasa digunakan untuk memberi contoh dapat digantikan dengan model perumahan tiga dimensi yang ditampilkan secara virtual menggunakan perangkat mobile android. Aplikasi ini dibuat dengan menggunakan bahasa pemrograman C#. Aplikasi yang dibangun membutuhkan beberapa tools yaitu, Android SDK, Unity3D sebagai editor, SweetHome3D untuk membuat objek 3D. Pengujian aplikasi dilakukan dengan menggunakan metode blackbox dan beta. Berdasarkan dari hasil pengujian, aplikasi yang dibuat dapat berjalan dengan diimplementasikan pada sebuah brosur dan dapat memberikan informasi lebih detail kepada calon konsumen selain itu aplikasi ini mempermudah sales dalam proses promosi. Diharapkan dengan dibuatnya media promosi berbasis augmented reality ini, proses promosi dapat terlaksana dengan baik dan terasa lebih menyenangkan. Dengan menggunakan aplikasi ini, user dapat melihat objek rumah 3D apabila kamera mendeteksi marker masing-masing tipe rumah. Keyword : android, augmented reality, media promosi, rumah','implementasi augmented reality rumah sbtn regency basis android laksana promosi marketing office sbtn regency promosi rumah brosur spanduk online sales freelance rumah pasar media promosi tampil informasi rumah gambar sales rumah brosur konsumen konsumen sulit bayang rumah brosur konsumen apabila rumah detail datang kantor pemasaran terap teknologi augmented reality brosur contoh ganti model rumah dimensi tampil virtual angkat mobile android aplikasi buat bahasa pemrograman aplikasi bangun butuh tools android sdk unity d editor sweethome d objek uji aplikasi metode blackbox beta uji aplikasi buat implementasi brosur informasi detail calon konsumen aplikasi mudah sales promosi harap buat media promosi basis augmented reality promosi laksana asa senang aplikasi user objek rumah apabila kamera deteksi marker tipe rumah keyword android augmented reality media promosi rumah'),(480,'A','Analisis Fungsionalitas Sistem Informasi Pelayanan Jasa Bagi Pelanggan (SIPEJABAT) Menggunakan Metode Kansei Engineering (Pada Balai Besar Bahan Dan Barang Teknik (B4T) Bandung). Balai Besar Bahan Dan Barang Teknik (B4T) adalah perusahaan yang bergerak dalam bidang pengujian sertifikasi barang dan bahan teknik, perusahaan B4T memiliki sebuah sistem untuk pelanggan yang di sebut SIPEJABAT. SIPEJABAT merupakan sistem pelayanan jasa bagi pelanggan yang berada di B4T, yang dapat membantu pelanggan dalam melihat informasi pengujian produk. Penelitian ini dilatar belakangi oleh masih banyak kekurangan dari fungsionalitas sistem SIPEJABAT tersebut khususnya bagi pelanggan, beberapa kekurangan yang dihadapi pelanggan pada saat ini adalah, pada saat ingin melihat proses pengujian produk bahan dan barang, hanya beberapa informasi saja yang dapat di lihat, seperti informasi tanggal pemesanan, nama produk, tanggal produk akan selesai diuji, Adanya informasi yang kurang memenuhi kebutuhan pelanggan terhadap sistem saat ini, perusahaan mengalami kesulitan tersendiri dengan adanya pelanggan yang selalu menanyakan informasi pengujian kalibrasi melalui email, dan telepon. Oleh sebab itu dilakukan penelitian pada sistem informasi SIPEJABAT. Salah satu metode yang digunakan untuk mengetahui kebutuhan fungsionalitas seperti apa yang dibutuhkan oleh pelanggan, yaitu menggunakan metode Kansei Engeneering yang dapat membantu mengetahui kebutuhan dari fungsionalitas SIPEJABAT. Hasil yang di peroleh dari penelitian ini yaitu kebutuhan fungsionalitas yang di inginkan oleh pelanggan dalam sistem SIPEJABAT, seperti adanya informasi detail pengujian bahan dan barang teknik, mulai dari informasi pengujian produk sampai informasi status pembayaran, dengan menggunakan metode Kansei Engineering. Keyword : Sipejabat, Kansei Engineering, Fungsionalitas, B4T','analisis fungsionalitas sistem informasi layan jasa langgan sipejabat metode kansei engineering pada balai bahan teknik b t bandung balai bahan teknik b t usaha gerak bidang uji sertifikasi bahan teknik usaha b t sistem langgan sebut sipejabat sipejabat sistem layan jasa langgan b t langgan informasi uji produk penelitian latar belakang kurang fungsionalitas sistem sipejabat khusus langgan kurang hadap langgan uji produk bahan informasi lihat informasi mesan produk produk selesai uji informasi kurang penuh langgan sistem usaha sulit tersendiri langgan tanya informasi uji kalibrasi email telepon penelitian sistem informasi sipejabat metode fungsionalitas butuh langgan metode kansei engeneering fungsionalitas sipejabat oleh penelitian fungsionalitas ingin langgan sistem sipejabat informasi detail uji bahan teknik informasi uji produk informasi status bayar metode kansei engineering keyword sipejabat kansei engineering fungsionalitas b t'),(481,'E','Analisis Gray Level Difference Method Dan Metode Naive Bayes Mengindentifikasi Penyakit Lidah Manusia . Lidah adalah kumpulan otot rangka pada bagian lantai mulut yang dapat membantu pencernaan makanan dengan mengunyah dan menelan. Lidah dikenal sebagai indera pengecap yang banyak memiliki struktur tunas pengecap. Jika lidah ini tak berfungsi, dengan sendirinya akan berpengaruh terhadap rasa makanan ataupun selera makan kita. Tidak berfungsinya lidah sebagaimana mestinya disebabkan adanya kelainan atau penyakit. Salah satu cara agar dapat membedakan ciri tersebut ialah dengan cara mengenali perbedaan tekstur pada citra Terdapat beberapa metode untuk memperoleh ciri-ciri tekstur dalam suatu citra, Salah satu metode untuk memperoleh ciri-ciri citra tekstur adalah Gray level difference atau bisa di singkat (GLDM). Ciri-ciri tekstur yang didapat dari metode ini diantaranya adalah kontras, Angular Singular Moment, energi, invers different moment dan Mean. Dari hasil ciri-ciri tersebut kemudian digunakan untuk klasifikasi dengan menggunakan Naïve Bayes yang menentukan hasil klasifikasi berdasarkan nilai probabilitas terbesar. Objek yang diuji adalah citra jenis Penyakit lidah manusia. Dari penelitian yang telah dilakukan, dapat ditarik kesimpulan sebagai berikut : naïve bayes dapat melakukan klasifikasi citra berdasarkan tekstur yang diekstraksi dengan metode gray level difference moment. Dikarenakan data hasil ekstraksi ciri adalah berupa data continue, atau biasa disebut data nominal, sehingga saat proses klasifikasi data hasil ekstraksi ciri tersebut dapat langsung digunakan sebagai inputan dalam klasifikasi naïve bayes. Berdasarkan hasil pengujian, kesimpulan yang didapatkan adalah naïve bayes dapat mengklasifikasi citra dengan baik, dikarenakan data hasil ekstraksi ciri tekstur penyakit dengan metode Gray level difference moment memiliki interval jarak yang berjauhan antar kelasnya. Sehingga klasifikasi naïve bayes dapat berjalan dengan baik saat melakukan klasifikasi. Sehingga didapatkan hasil nilai ke akuratan 85%. Keyword : tekstur citra, ekstraksi ciri, gray level difference method, gldm, Naive bayes','analisis gray level difference method metode naive bayes mengindentifikasi sakit lidah manusia lidah kumpul otot rangka lantai mulut cerna makan kunyah telan lidah kenal indera pengecap struktur tunas pengecap lidah fungsi sendiri pengaruh makan atau selera makan fungsi lidah bagaimana mesti sebab lain sakit bedak ciri ialah kenal beda tekstur citra dapat metode oleh ciri tekstur citra metode oleh ciri citra tekstur gray level difference singkat gldm ciri tekstur dapat metode antara kontras angular singular moment energi invers different moment mean ciri klasifikasi na ve bayes tentu klasifikasi nilai probabilitas terbesar objek uji citra sakit lidah manusia penelitian tarik simpul ikut na ve bayes klasifikasi citra tekstur ekstraksi metode gray level difference moment karena data ekstraksi ciri upa data continue sebut data nominal klasifikasi data ekstraksi ciri inputan klasifikasi na ve bayes uji simpul dapat na ve bayes klasifikasi citra karena data ekstraksi ciri tekstur sakit metode gray level difference moment interval jarak jauh antar las klasifikasi na ve bayes klasifikasi dapat nilai akurat keyword tekstur citra ekstraksi ciri gray level difference method gldm naive bayes'),(482,'A','Pembangunan Sistem Informasi Customer Relationship management Di Koperasi Pegawai Dan Pensiunan PT Pos Indonesia (KOPPOS) . Koperasi pegawai Dan Pensiunan PT.Pos Indonesia (KOPPOS) adalah koperasi usaha berjenis koperasi dan memiliki beberapa unit bisnis seperti unit simpan pinjam dan unit toko. Situasi yang ada saat ini adalah ketua koperasi mengalami kesulitan dalam melakukan pendekatan kepada anggota KOPPOS , pemasaran dan promosi produk kepada anggota karena ketua KOPPOS tidak maksimal dalam melakukan pendekatan kepada anggota KOPPOS, pemasaran dan promosi produk kepada anggota Dengan menerapkan konsep CRM (Customer Relationship Management), KOPPOS dapat melakukan pendekatan dengan mengidentifikasi anggota dengan anggota segmentasi. Tujuan dari proses segmentasi anggota adalah untuk mengetahui perilaku anggota dan menerapkan strategi pendekatan kepada anggota KOPPOS serta pemasaran dan promosi produk yang tepat sehingga menguntungkan bagi koperasi. Model segmentasi RFM (Recency, frekuensi, dan moneter) berdasarkan kebaruan, frekuensi, dan moneter. Teknik pengelompokan anggota transaksi berdasarkan transaksi yang terakhir dilakukan, jumlah transaksi yang dilakukan dalam jangka waktu tertentu dan total rata-rata pembelian yang dilakukan dalam jangka waktu tertentu. Berdasarkan hasil pengujian, aplikasi yang dibangun sudah mencapai tujuan membantu KOPPOS ketua dalam melakukan anggota pendekatan bisnis dari KOPPOS, pemasaran dan promosi produk kepada anggota. Pengambilan keputusan dilaksanakan setelah melalui proses analisis, pemodelan, dan evaluasi data yang disimpan dalam database untuk menghasilkan hubungan yang saling menguntungkan antara koperasi dan anggotanya. Keyword : KOPPOS, CRM, segmentasi, RFM','bangun sistem informasi customer relationship management koperasi gawai pensiun pt pos indonesia koppos koperasi gawai pensiun pt pos indonesia koppos koperasi usaha jenis koperasi unit bisnis unit simpan pinjam unit toko situasi ketua koperasi sulit dekat anggota koppos pemasaran promosi produk anggota ketua koppos maksimal dekat anggota koppos pemasaran promosi produk anggota terap konsep crm customer relationship management koppos dekat identifikasi anggota anggota segmentasi tuju segmentasi anggota perilaku anggota terap strategi dekat anggota koppos pemasaran promosi produk tepat untung koperasi model segmentasi rfm recency frekuensi moneter baru frekuensi moneter teknik pengelompokan anggota transaksi transaksi transaksi jangka tertentu total rata beli jangka tertentu uji aplikasi bangun tuju koppos ketua anggota dekat bisnis koppos pemasaran promosi produk anggota ambil laksana analisis model evaluasi data simpan database hasil saling untung koperasi anggota keyword koppos crm segmentasi rfm'),(483,'C','Perancangan Dan Pembangunan Sistem One Card Payment Dan Absen Elektronik Pada Satu Sistem Terintregrasi Menggunakan Teknologi Radio Frequency Identification (RFID) Di SMKN 6 Garut. Sekolah Menengah Kejuruan (SMK) Negeri 6 Garut merupakan salah satu sekolah kejuruan negeri yang berada di perbatasan antara Kota Garut dan Bandung, Jawa Barat. Sekolah ini merupakan sekolah kejuruan unggulan yang memiliki fasilitas cukup lengkap dan baik. Semakin banyaknya siswa yang mendaftar kesekolah ini, maka mutu dan kualitas sekolah pun harus ditingkatkan. Ditemukanya masalah berupa banyaknya siswa yang mengantri saat melakukan iuran bulanan dan kesulitan pihak tata usaha dalam mencatatnya, serta proses absensi dikelas yang masih ditemukanya kecurangan saat proses tersebut. Dibangunlah sistem one card payment dan absen elektronik yang bertujuan untuk memudahkan pihak tata usaha dalam proses iuran bulanan, meminimalisir antrian siswa daam proses iuran bulanan serta membantu guru dalam meminimalisir kecurangan saat absensi dikelas. Berdasarkan hasi pengujian, sistem ini dinilai sudah cukup baik dalam meminimalisir kecurangan saat absensi, membantu dan mempercepat pekerjaan tata usaha serta mengurangi jumlah antrian saat melakukan proses iuran buanan. Keyword : Absen sekolah, pembayaran iuran bulanan, Absen RFID.','rancang bangun sistem one card payment absen elektronik sistem terintregrasi teknologi radio frequency identification rfid smkn garut sekolah tengah juru smk neger garut sekolah juru neger batas kota garut bandung jawa sekolah sekolah juru unggul fasilitas lengkap banyak siswa daftar seko mutu kualitas sekolah tingkat ditemuka upa banyak siswa antri iur bulan sulit tata usaha catat absensi kelas ditemuka curang bangun sistem one card payment absen elektronik tuju mudah tata usaha iur bulan meminimalisir antri siswa daam iur bulan guru meminimalisir curang absensi kelas has uji sistem nilai meminimalisir curang absensi cepat kerja tata usaha urang antri iur buanan keyword absen sekolah bayar iur bulan absen rfid'),(484,'C','Pembangunan Aplikasi Augmented Reality Untuk Pembelajaran Interaktif Tindakan keperawatan Menggunakan Speech Recognition Di SMK Kesehatan Bhakti kencana Cimahi . SMK Kesehatan Bhakti Kencana Cimahi merupakan salah satu institusi pendidikan yang menghasilkan tenaga kesehatan termasuk perawat untuk memenuhi harapan masyarakat akan pelayanan tenaga kesehatan yang berkualitas. Kegiatan pembelajaran tindakan keperawatan yang dilakukan di SMK Kesehatan Bhakti Kencana Cimahi ini masih menggunakan metode konvensional, dimana pengajar menyampaikan materi hanya menggunakan buku panduan. Alat peraga yang ada di sekolah pun masih terbatas, sehingga tidak semua siswa/i mendapat bagian untuk menggunakan alat peraga. Selain itu, pada saat kegiatan praktikum banyak ditemui kesalahan dalam melakukan percobaan yang dapat berakibat fatal. Solusi yang diharapkan dapat memecahkan permasalahan tersebut adalah dengan membangun Aplikasi Augmented Reality untuk Pembelajaran Interaktif Tindakan Keperawatan Menggunakan Speech Recognition. Aplikasi Augmented Reality untuk Pembelajaran Interaktif Tindakan Keperawatan Menggunakan Speech Recognition di SMK Kesehatan Bhakti Kencana Cimahi ini dibutuhkan sebagai media bantu pembelajaran untuk menyampaikan materi pembelajaran yang lebih interaktif agar mampu membantu siswa dalam mempelajari tindakan keperawatan sehingga lebih mudah menyerap, merangsang perhatian, dan pikiran dalam kegiatan belajar untuk mencapai tujuan belajar. Selain itu muatan materi pelajaran dapat dimodifikasi menjadi lebih menarik dan mudah dipahami. Keyword : Pembelajaran, Interaktif, Konvensional, Tindakan Keperawatan, Augmented Reality, Speech Recognition.','bangun aplikasi augmented reality pembelajaran interaktif tindak rawat speech recognition smk sehat bhakti kencana cimahi smk sehat bhakti kencana cimahi institusi didik hasil tenaga sehat rawat penuh harap masyarakat layan tenaga sehat kualitas pembelajaran tindak rawat smk sehat bhakti kencana cimahi metode konvensional mana ajar sampai materi buku pandu alat raga sekolah batas siswa  alat raga praktikum temu salah coba akibat fatal solusi harap pecah masalah bangun aplikasi augmented reality pembelajaran interaktif tindak rawat speech recognition aplikasi augmented reality pembelajaran interaktif tindak rawat speech recognition smk sehat bhakti kencana cimahi butuh media bantu pembelajaran sampai materi pembelajaran interaktif siswa mempelajari tindak rawat mudah serap rangsang hati pikir belajar tuju belajar muat materi pelajaran modifikasi tarik mudah paham keyword pembelajaran interaktif konvensional tindak rawat augmented reality speech recognition'),(485,'A','Penerapan Knowledge Management System Pada Bidang Keperawatan Rumah Sakit Pelabuhan Cirebon  Rumah Sakit Pelabuhan Cirebon (RSPC) adalah perusahaan yang menyediakan jasa pelayanan kesehatan masyarakat, yang memiliki tujuan untuk melayani kesehatan bagi para pelangganya, masyarakat umum, serta pegawai rumah sakit itu sendiri dan keluarganya. Untuk menjaga kualitasnya, maka Rumah Sakit Pelabuhan Cirebon selalu mengikuti perkembangan ilmu pengetahuan dan salah satunya adalah pada bidang keperawatan, seperti contohnya yaitu dengan menerapkan pemerataan pengetahuan dan informasi atau berbagi pengetahuan diantara para perawat. Akan tetapi pada prakteknya terdapat beberapa permasalahan yang dihadapi oleh pihak rumah sakit seperti: manajer keperawatan mengalami kesulitan dalam mengetahui apakah tindakan yang dilakukan oleh para perawat sudah sesuai atau tidak sesuai dengan SOP, asisten manajer askep & mutu mengalami kesulitan dalam penyebaran dan pembaharuan SOP, kepala ruangan mengalami kesulitan dalam pengelolaan pengalaman dan tindakan yang dilakukan perawat. Permasalahan-permasalahan tersebut disebabkan oleh perkembangan pola keperawatan yang semakin maju sehingga mengakibatkan perawat belum dapat menyesuaikan diri dengan pola keperawatan yang baru. Knowledge Management System merupakan solusi yang tepat untuk menjawab permasalahan, dengan menggunakan text mining dapat membantu manajer keperawatan mengetahui tindakan perawat berdasarkan pengalaman tindakan perawat, membantu asisten manajer askep & mutu dalam pembuatan maupun pembaharuan SOP dan membantu kepala ruangan untuk berbagi pengalaman tindakan antar perawat. Berdasarkan hasil pengujian sistem, knowledge management system telah mampu membantu manajer keperawatan dalam monitoring tindakan perawat, membantu asisten manajer askep & mutu dalam pembuatan dan pembaharuan SOP, dan mampu membantu kepala ruangan untuk melakukan sharing pengalaman tindakan antar personil keperawatan. Keyword : Knowledge Management System Keperawatan, Text Mining, Monitoring','penerapan knowledge management system bidang rawat rumah sakit labuh cirebon rumah sakit labuh cirebon rspc usaha sedia jasa layan sehat masyarakat tuju layan sehat pelangga masyarakat gawai rumah sakit keluarga jaga kualitas rumah sakit labuh cirebon ikut kembang ilmu pengetahuan satu bidang rawat contoh terap rata pengetahuan informasi bagi pengetahuan antara rawat praktek dapat masalah hadap rumah sakit manajer rawat sulit tindak rawat sop asisten manajer askep mutu sulit sebar baharu sop kepala ruang sulit pengelolaan alam tindak rawat masalah sebab kembang pola rawat maju akibat rawat suai pola rawat knowledge management system solusi tepat jawab masalah text mining manajer rawat tindak rawat alam tindak rawat asisten manajer askep mutu buat baharu sop kepala ruang bagi alam tindak antar rawat uji sistem knowledge management system manajer rawat monitoring tindak rawat asisten manajer askep mutu buat baharu sop kepala ruang sharing alam tindak antar personil rawat keyword knowledge management system rawat text mining monitoring'),(486,'A','Penerapan Knowledge Management System Untuk Pelayanan Keperawatan Di Bidang Keperawatan RSUD Al-Ihsan Bandung . Bidang Keperawatan merupakan salah satu bagian dari struktur organisasi RSUD Al-Ihsan Bandung yang mempunyai tugas mengelola pelayanan keperawatan di rumah sakit. Pelayanan keperawatan merupakan suatu bagian integral dalam pelaksanaan kesehatan terhadap pasien. Berdasarkan hasil wawancara yang telah dilakukan dengan Ibu Oom Umriah, S.Kep., Ners. selaku Kepala Seksi Pelayanan di Bidang Keperawatan RSUD Al-Ihsan Bandung menyatakan bahwa saat ini proses pelaksanaan asuhan keperawatan yang dilaksanakan kurang dari cukup, hal ini dikarenakan masih adanya asuhan keperawatan yang tidak terdokumentasi dan tersimpan dengan baik sehingga perawat sulit dalam mencari informasi keperawatan. Proses penyebaran pengetahuan yang dilaksanakan melalui forum diskusi masih terbatas sehingga mengakibatkan pengetahun yang berkembang tidak langsung tersebar kepada perawat. Berdasarkan permasalahan yang telah diuraikan diatas, maka dibutuhkan suatu sistem yang dapat menyimpan, menyerap, menyebarkan, dan memperbaharui pengetahuan untuk pelayanan keperawatan dengan menerapkan knowledge management system. Proses konversi pengetahuan yang dilakukan yaitu dengan proses SECI (sosialisasi, eksternalisasi, kombinasi dan internaliasasi). Proses pemanfaatan pengetahuan dengan menggunakan metode teks mining yang menggunakan algoritma TF/IDF dan VSM (Vector Space Model). Berdasarkan hasil pengujian dapat disimpulkan bahwa knowledge management system ini sudah cukup membantu Bidang Keperawatan dalam hal ini Kepala Seksi Pelayanan yang dibantu Kepala Ruangan dalam mengelola pengetahuan untuk pelayanan keperawatan serta membantu perawat dalam menemukan dan menyebarkan pengetahuan secara langsung. Keyword : Knowledge Management System, Pelayanan Keperawatan, SECI, Teks Mining, Algoritma TF/IDF, VSM (Vector Space Model)','penerapan knowledge management system layan rawat bidang rawat rsud al bandung bidang rawat struktur organisasi rsud al bandung tugas kelola layan rawat rumah sakit layan rawat integral laksana sehat pasien wawancara ibu oom umriah s kep ners sela kepala seksi layan bidang rawat rsud al bandung laksana asuh rawat laksana kurang karena asuh rawat dokumentasi simpan rawat sulit informasi rawat sebar pengetahuan laksana forum diskusi batas akibat pengetahun kembang tersebar rawat masalah urai atas butuh sistem simpan serap sebar baharu pengetahuan layan rawat terap knowledge management system konversi pengetahuan ci sosialisasi eksternalisasi kombinasi internaliasasi manfaat pengetahuan metode teks mining algoritma tf idf vsm vector space model uji simpul knowledge management system bidang rawat kepala seksi layan bantu kepala ruang kelola pengetahuan layan rawat rawat temu sebar pengetahuan keyword knowledge management system layan rawat ci teks mining algoritma tf idf vsm vector space model'),(487,'E','Analisis Perbandingan Pendeteksian Tepi Citra Menggunakan Metode Canny, Wavelet Dan Elisabeth Pada Citra CT-Scan. Dalam radioterapi, deteksi tepi citra menjadi bagian yang penting karena proses ini merupakan langkah awal pemisahan objek dalam objek pada citra yang memiliki perbedaan karakteristik dan ciri dan ciri khas tersendiri. Batas antara satu objek dengan objek lainnya dalam citra yang berbeda telah jelas karakteristiknya, maka selanjutnya citra medis dapat dilakukan analisa citra lebih lanjut dan juga diagnosa kondisi penyakit pasien yang terlihat dengan menginterpretasikan citra medis. Deteksi tepi ini juga dilakukan pada citra medis untuk mendapatkan bentuk dasar organ yang diinginkan atau bahkan ukuran yang jelas antara satu organ dengan organ yang lain dari hasil pencitraan medis. Deteksi tepi sendiri memiliki beberapa metode, dalam penelitian ini akan dilakukan analisa perbandingan antara tiga metode pendeteksian tepi yaitu , metode Canny, metode Wavelet dan metode Elisabeth. Karena memiliki beberapa kelebihan dalam mengekstrak tepian dengan kebebasan pemilihan parameter yang digunakan. Metode canny juga merupakan salah satu algoritma deteksi tepi modern menurut paper Perbandingan Metode Pendeteksian Tepi (Studi Kasus: Citra USG Janin), dengan hasil yang diperoleh metode Canny, tak jarang didalam bidang kedokteran menggunakan metode ini. Metode Elisabeth merupakan pendeteksian tepi baru yang menggabungkan antara metode Sobel dan Prewitt, menurut paper New Edge Detection Method Using Elisabeth Method, dengan hasil bahwa metode elisabethdikatakan baik untuk deteksi tepi karena metode elisabeth memiliki kelebihan dari sobel dan prewitt. Pada hasil pengujian yang dilakukan dengan citra uji yang digunakan adalah citra CT-Scan, metode Canny masih memiliki keunggulan untuk nilai persentase akurasi yang paling tinggi dibandingkan metode Wavelet dan Elisabeth. Keyword : pengolahan citra, Deteksi Tepi, Canny, Wavelet, Elisabeth,','analisis banding deteksi tepi citra metode canny wavelet elisabeth citra ct radioterapi deteksi tepi citra langkah pemisahan objek objek citra beda karakteristik ciri ciri khas tersendiri batas objek objek citra beda karakteristik lanjut citra medis analisa citra diagnosa sakit pasien interpretasi citra medis deteksi tepi citra medis dasar organ ingin ukur organ organ citra medis deteksi tepi metode penelitian analisa banding metode deteksi tepi metode canny metode wavelet metode elisabeth lebih ekstrak tepi bebas pemilihan parameter metode canny algoritma deteksi tepi modern paper banding metode deteksi tepi studi kasus citra usg janin oleh metode canny jarang dalam bidang dokter metode metode elisabeth deteksi tepi gabung metode sobel prewitt paper new edge detection method using elisabeth method metode elisabethdikatakan deteksi tepi metode elisabeth lebih sobel prewitt uji citra uji citra ct metode canny unggul nilai persentase akurasi banding metode wavelet elisabeth keyword olah citra deteksi tepi canny wavelet elisabeth'),(488,'A','Penerapan Knowledge Management System Pada Divisi Product Support PT. Untited Tractors, Tbk Perwakilan Bandung. PT United Tractors,Tbk perwakilan Bandung merupakan distributor peralatan berat terbesar di Indonesia. Selain penjualan unit alat berat, PT. United Tractors fokus terhadap penjualan Parts Genuine dan penyediaan mekanik yang terdidik dan terlatih.Perusahaan mempunyai divisi khusus yang bertugas menangani service alat berat dan suku cadang (Spareparts) yaitu divisi Product Support . Permasalahan yang kerap dihadapi karyawan pada divisi product support adalah perpindahan pekerjaan pada saat terjadi rotasi karyawan.Perpindahan pekerjaan seharusnya dilakukan dengan cepat dan karyawan yang sudah dimutasikan harus sudah sepenuhnya mengerjakan tugas baru,tetapi hingga saat ini seringkali adanya tumpang tindih pekerjaan karena karyawan baru masih mengerjakan pekerjaan di cabang lamanya, hal ini terjadi karena karyawan lama tidak menyimpan history dokumen pekerjaan nya di perusahaan sehingga berakibat karyawan baru harus mempelajari dan memahami dokumen pekerjaan dari awal.Pengelolaan modul-modul knowledge ini tidak disimpan dengan baik serta masih dimiliki oleh masing-masing karyawan dan belum menjadi milik perusahaan, sehingga pada saat karyawan membutuhkan modul knowledge tertentu, akan membutuhkan waktu yang lama untuk mencari dan mendapatkan dokumen knowledge tersebut dari karyawan lain. Karyawan juga kesulitan dalam mengetahui pengetahuan dari pengalaman karyawan lain , dikarenakan media yang kurang memadai untuk memfasilitasi karyawan dalam hal bertukar pengalaman. Knowledge Management System PT. United Tractors,tbk perwakilan Bandung merupakan solusi yang tepat untuk menjawab masalah tersebut. Kelebihan dari sistem informasi ini adalah website yang dapat diakses secara online dapat menyampaikan informasi pengetahuan secara langsung kepada karyawan Pt.United Tractors,Tbk perwakilan Bandung. Berdasarkan hasil pengujian sistem, Knowledge Management System PT. United Tractors,tbk perwakilan Bandung ini telah mampu membantu karyawan divisi product support dalam mendapatkan pengetahuan pada saat terjadi pepindahan pekerjaan,melakukan pengelolaan pengetahuan yaitu membuat,memperbaharui serta membagikan dokumen pelatihan, modul knowledge dan mengetahui pengalaman karyawan lain sebagai solusi terbaik dalam menyelesaikan suatu masalah. Keyword : Knowledge Management System, knowledge, divisi product support, modul knowledge, dokumen knowledge.','penerapan knowledge management system divisi product support pt untited tractors tbk wakil bandung pt united tractors tbk wakil bandung distributor ralat terbesar indonesia jual unit alat pt united tractors fokus jual parts genuine sedia mekanik didik terlatih perusahaan divisi tugas menangani service alat suku cadang spareparts divisi product support masalah kerap hadap karyawan divisi product support pindah kerja rotasi karyawan perpindahan kerja harus cepat karyawan mutasi penuh kerja tugas baru tetapi seringkali tumpang tindih kerja karyawan kerja kerja cabang lama karyawan simpan history dokumen kerja usaha akibat karyawan mempelajari paham dokumen kerja awal pengelolaan modul knowledge simpan milik karyawan usaha karyawan butuh modul knowledge tertentu butuh dokumen knowledge karyawan karyawan sulit pengetahuan alam karyawan karena media kurang memadai fasilitas karyawan tukar alam knowledge management system pt united tractors tbk wakil bandung solusi tepat jawab lebih sistem informasi website akses online sampai informasi pengetahuan karyawan pt united tractors tbk wakil bandung uji sistem knowledge management system pt united tractors tbk wakil bandung karyawan divisi product support pengetahuan pindah pekerjaan melakukan pengelolaan pengetahuan membuat memperbaharui bagi dokumen latih modul knowledge alam karyawan solusi baik selesai keyword knowledge management system knowledge divisi product support modul knowledge dokumen knowledge'),(489,'E','Implementasi Algoritma Genetika Untuk Menyelesaikan Permainan Puzzle Kakuro. Puzzle kakuro adalah permainan penjumlahan angka dimana pemain harus mengisi setiap kotak yang tersedia dengan angka bulat dari 1 hingga 9 dan harus memenuhi beberapa syarat dalam pengisiannya. Untuk menyelesaikan puzzle kakuro berukuran 14 x 14 dengan menggunakan implementasi algoritma Backtracking diperlukan waktu 20 menit. Untuk dapat menyelesaikan puzzle kakuro 14 x 14 dengan waktu yang lebih cepat maka diperlukan suatu metode yang lain. Algoritma genetika merupakan suatu metode heuristik yang dikembangkan berdasarkan prinsip genetika dan proses seleksi alamiah teori evolusi Darwin. Proses pencarian penyelesaian atau proses terpilihnya sebuah penyelesaian dalam algoritma genetika berlangsung sama seperti terpilihnya suatu individu untuk bertahan hidup dalam proses evolusi. Keuntungan dari penggunaan algoritma genetika adalah kemampuannya untuk menemukan solusi pada ruang masalah yang cukup besar dan solusi yang diharapkan tidak harus paling optimal, tetapi cukup bisa diterima. Berdasarkan hal tersebut maka algoritma genetika dapat menjadi pilihan untuk menyelesaikan permainan puzzle kakuro dengan ukuran 14 x 14.  Keyword : Algoritma Genetika, Puzzle Kakuro.','implementasi algoritma genetika selesai main puzzle kakuro puzzle kakuro main jumlah angka mana main isi kotak tersedia angka bulat penuh syarat isi selesai puzzle kakuro berukuran implementasi algoritma backtracking perlu menit selesai puzzle kakuro cepat perlu metode algoritma genetika metode heuristik kembang prinsip genetika seleksi alamiah teori evolusi darwin cari selesai pilih selesai algoritma genetika pilih individu tahan evolusi untung algoritma genetika mampu temu solusi solusi harap optimal terima algoritma genetika pilih selesai main puzzle kakuro ukur keyword algoritma genetika puzzle kakuro'),(490,'E','Identifikasi Retina Mata Menggunakan Metode Run Length Dan Naive Bayesian. Retina merupakan salah satu anggota tubuh manusia yang dapat digunakan sebagai identitas seseorang. Retina mengandung banyak pembuluh darah yang membentuk pola unik, setiap manusia memiliki pola yang berbeda. Cara membedakan suatu retina dengan yang lainnya yaitu dengan membedakan tekstur citra retina tersebut. Metode run length adalah suatu metode yang dapat mengekstrak ciri suatu citra berdasarkan tekstur, ciri yang didapat adalah Short Run Emphasis (SRE), Long Run Emphasis (LRE), Grey Level Uniformity (GLU), Run Length Uniformity (RLU), dan Run Percentage (RPC). Hasil dari ekstraksi ciri citra berdasarkan tekstur tersebut kemudian akan digunakan sebagai nilai masukan untuk menentukan hasil klasifikasi citra berdasarkan tekstur menggunakan metode naive bayesian. Metode naive bayesian merupakan sebuah metode pengklasifikasian probabilistik sederhana yang menghitung sekumpulan probabilitas dengan menjumlahkan frekuensi dan kombinasi nilai dari dataset yang diberikan. Berdasarkan hasil penelitian yang telah dilakukan dapat diketahui identifikasi citra retina mata dapat dilakukan dengan klasifikasi berdasarkan tekstur menggunakan metode run length sebagai metode untuk ekstraksi tekstur pada citra retina mata dan metode naive bayesian sebagai metode untuk klasifikasi. Dari hasil pengujian yang telah dilakukan identifikasi citra retina mata berdasarkan tekstur menggunakan metode run length dan naive bayesian didapat tingkat akurasi sebesar 100%. Keyword : Identifikasi Retina, Run Length, Naive Bayesian, Kecerdasan Buatan','identifikasi retina mata metode run length naive bayesian retina anggota tubuh manusia identitas orang retina kandung buluh darah bentuk pola unik manusia pola beda bedak retina bedak tekstur citra retina metode run length metode ekstrak ciri citra tekstur ciri dapat short run emphasis sre long run emphasis lre grey level uniformity glu run length uniformity rlu run percentage rpc ekstraksi ciri citra tekstur nilai masuk tentu klasifikasi citra tekstur metode naive bayesian metode naive bayesian metode klasifikasi probabilistik sederhana hitung kumpul probabilitas jumlah frekuensi kombinasi nilai dataset berik penelitian tahu identifikasi citra retina mata klasifikasi tekstur metode run length metode ekstraksi tekstur citra retina mata metode naive bayesian metode klasifikasi uji identifikasi citra retina mata tekstur metode run length naive bayesian dapat akurasi keyword identifikasi retina run length naive bayesian cerdas buat'),(491,'C','Pembangunan Sistem Pantau Smart Fish Farm Menggunakan Arduino Berbasis Internet Of Things (IOT) Terhadap Budidaya Ikan . UD. Caesar merupakan sebuah usaha dagang yang dikelola secara perorangan dan bergerak di bidang peternakan yaitu, pada sektor perikanan. Kualitas ikan ternak yang baik bergantung bagaimana ketelitian peternak itu sendiri. Selama ini sistem pemantauan kolam masih. Proses yang berjalan saat ini di UD Caesar harus dilakukan pemantauan suhu, pemberian pakan ikan harus dilakukan secara langsung kendala tersebut kadang tidak dapat di tangani pemilik peternakan dalam hal waktu. Sehingga proses yang seharusnya dilakukan secara rutin menjadi tidak dilakukan secara rutin. Smart fish farm merupakan aplikasi yang digunakan untuk dapat memantau kondisi suhu kolam dari jarak jauh dengan menggunakan internet yang secara rutin mengecek suhu pada kolam ikan dan penjadwalan pakan ikan yang dapat diatur oleh peternak. Aplikasi smart fish farm dibangun dengan memanfaatkan arduino yang tehubung jaringan internet dan web service. Pembangunan aplikasi ini harus melalui tahapan yang sesuai dengan metode pembangunan perangkat lunak dan melakukan pengujian sistem yang terdiri dari pengujian black box dan beta, dimana pengujian black box berfokus pada pengujian fungsionalitas aplikasi Smart fish farm, sedangkan pengujian beta berfokus pada pengujian lapangan seperti kuesioner, dan wawancara. Berdasarkan hasil pengujian yang telah dilakukan pada aplikasi smart fish farm dapat disimpulkan bahwa pihak pengelola kolam ikan cukup terbantu dalam memantau dan mengontrol kegiatan pada kolam ikan yang dapat dipantau dari jarak jauh. Keyword : Sistem pantau, Arduino, web service, internet of things','bangun sistem pantau smart fish farm arduino basis internet things iot budidaya ikan ud caesar usaha dagang kelola orang gerak bidang ternak sektor ikan kualitas ikan ternak gantung teliti ternak sistem pemantauan kolam ud caesar pemantauan suhu beri pakan ikan kendala kadang tangani milik ternak harus rutin rutin smart fish farm aplikasi pantau suhu kolam jarak internet rutin ecek suhu kolam ikan jadwal pakan ikan atur ternak aplikasi smart fish farm bangun manfaat arduino tehubung jaring internet web service bangun aplikasi tahap metode bangun angkat lunak uji sistem diri uji black box beta mana uji black box fokus uji fungsionalitas aplikasi smart fish farm uji beta fokus uji lapang kuesioner wawancara uji aplikasi smart fish farm simpul pengelola kolam ikan bantu pantau kontrol kolam ikan pantau jarak keyword sistem pantau arduino web service internet things'),(492,'D','Pembangunan Aplikasi Pengawasan Menggunakan Webcam Untuk Kosan Berbasis Mobile Android . Kasus pencurian spesialis kosan di kota Bandung kini kian mengingkat, hal ini didasari dengan seiring banyaknya penangkapan pelaku pencurian spesialis kosan. Namun demikian, sulitnya memantau keadaan di kosan mengakibatkan besar peluang terjadinya tindak pencurian. Sistem keamanan menggunakan kamera sebagai pemantau atau yang biasa di sebut CCTV (Closed Circuit Television) akhir-akhir ini semakin marak dipergunakan, tujuannya adalah untuk memantau keadaan sekitar, mencegah dan mengetahui segala tindak kriminal yang telah terjadi namun untuk memiliki sistem pemantauan tersebut membutuhkan biaya yang relatif mahal untuk membeli perangkat keras dan jasa pemasangannya serta pemantauan hanya bisa dilakukan secara offline. Berdasarkan hal tersebut, maka dapat disimpulkan perlunya membangun perangkat lunak yang dapat membantu memantau keadaan kosan. Monitor Kosan adalah sebuah perangkat lunak yang terdiri dari dua subsistem yaitu subsistem desktop untuk mengirimkan hasil pemantauan kosan dan subsistem mobile untuk menerima hasil pemantauan kosan yang bisa di akses secara online. Platform yang digunakan sebagai pilot project untuk subsistem mobile adalah android, dengan pertimbangan bahwa android saat ini memiliki pengguna paling besar di Indonesia.Berdasarkan hasil pengujian menggunakan metode pengujian alpha dan beta dapat disimpulkan bahwa perangkat lunak Monitor Kosan telah membantu penghuni kosan untuk memantau keadaan di kosan, mencegah dan mengetahui tindak kriminal yang telah terjadi dan memiliki sistem aplikasi pengawasan kamera. Keyword : Webcam, Android, Desktop, Kosan, Pencurian.','bangun aplikasi awas webcam kosan basis mobile android kasus curi spesialis kosan kota bandung kian mengingkat dasar iring banyak penangkapan pela curi spesialis kosan sulit pantau ada kosan akibat luang jadi tindak curi sistem aman kamera pemantau sebut cctv closed circuit television akhir marak guna tuju pantau ada cegah segala tindak kriminal sistem pemantauan butuh biaya relatif mahal beli angkat keras jasa pemasangan pemantauan offline simpul perlu bangun angkat lunak pantau ada kosan monitor kosan angkat lunak diri subsistem subsistem desktop kirim pemantauan kosan subsistem mobile pemantauan kosan akses online platform pilot project subsistem mobile android timbang android guna indonesia berdasarkan uji metode uji alpha beta simpul angkat lunak monitor kosan huni kosan pantau ada kosan cegah tindak kriminal sistem aplikasi awas kamera keyword webcam android desktop kosan curi'),(493,'A','Pembangunan Customer Relationship Management (CRM) Di CV.NJ. CV. NJ adalah sebuah perusahaan yang bergerak di bidang pembuatan dan penjualan makanan yaitu tahu dan tempe. Keadaan saat ini yaitu CV. NJ masih sulit dalam mempertahankan pelanggan, itu dikarenakan kurang maksimalnya CV. NJ dalam melakukan pendekatan dengan pelanggan karena pendekatan yang dilakukan tidak teratur, tidak adanya tindak lanjut yang dilakukan terhadap pelanggan setelah pelanggan melakukan transaksi secara teratur atau pemberian reward yang tidak sesuai dengan karakteristik pelanggan. serta tidak adanya pengendalian secara kusus terhadap pelanggan yang mengakibatkan kurangnya pengetahuan dari CV. NJ mengenai keinginan pelanggan, sehingga membuat direktur CV. NJ kesulitan dalam melakukan pengendalian terhadap pelanggan yang mengakibatkan pelanggan mengurangi atau menunda transaksi yang dilakukan. Dengan menerapkan konsep Customer Relationship Management (CRM), perusahaan dapat melakukan pendekatan dengan pelanggan melalui kritik saran yang diberikan oleh pelanggan, serta dapat mengetahui karakteristik pelanggan bedasarkan hasil segmentasi pelanggan sehingga dapat dengan mudah dalam melakukan pengendalian terhadap pelanggan. Model RFM merupakan model untuk menentukan segmentasi pelanggan berdasarkan recency, frequency, dan monetary. Yaitu teknik pengelompokan pelanggan dari transaksi berdasarkan transaksi terakhir yang dilakukan, banyaknya transaksi yang dilakukan dalam jangka waktu tertentu dan total pembelian yang dilakukan dalam jangka waktu tertentu. Berdasarkan hasil pengujian black box dan pengujian beta, aplikasi yang dibangun telah mencapai tujuan yaitu Sistem informasi CRM ini dapat membantu dalam melakukan pendekatan dengan pelanggan melalui sarana kritik dan saran serta membantu dalam melakukan pengendalian untuk mempertahankan pelanggan dengan memberikan pinjaman uang, pengiriman gratis serta hadiah paket kepada pelanggan setelah melakukan transaksi sesuai karakteristik pelanggan. Keyword : Pelanggan, CRM, segmentasi, RFM, Pengendalian Pelanggan','bangun customer relationship management crm cv nj cv nj usaha gerak bidang buat jual makan tempe ada cv nj sulit tahan langgan karena kurang maksimal cv nj dekat langgan dekat atur tindak langgan langgan transaksi atur beri reward karakteristik langgan pengendalian kusus langgan akibat kurang pengetahuan cv nj ingin langgan direktur cv nj sulit pengendalian langgan akibat langgan urang tunda transaksi terap konsep customer relationship management crm usaha dekat langgan kritik saran berik langgan karakteristik langgan bedasarkan segmentasi langgan mudah pengendalian langgan model rfm model tentu segmentasi langgan recency frequency monetary teknik pengelompokan langgan transaksi transaksi banyak transaksi jangka tertentu total beli jangka tertentu uji black box uji beta aplikasi bangun tuju sistem informasi crm dekat langgan sarana kritik saran pengendalian tahan langgan pinjam uang pengiriman gratis hadiah paket langgan transaksi karakteristik langgan keyword langgan crm segmentasi rfm pengendalian langgan'),(494,'E','Implementasi Algoritmaa Fuzzy K-Nearest Neigbour (Fuzzy K-NN) Untuk Klasifikasi Proposal Skripsi Berdasarkan Kelompok Keilmuan Di Teknik Informatika UNIKOM. Skripsi merupakan mata kuliah penutup yang diambil oleh mahasiswa/mahasiswi yang sedang menempuh jenjang pendidikan strata 1 di perguruan tinggi negeri atau pun perguruan tinggi swasta, skripsi menjadi salah satu syarat untuk kelulusannya. Berkembangnya ilmu pengetahuan setiap waktunya membuat semakin beragamnya tema Â– tema skripsi yang bermunculan, sehingga menimbulkan adanya keanekaragaman proposal skripsi. Sehingga pihak akademik membuat sebuah pengelompokan kepada tema Â– tema skripsi tersebut Walaupun demikian masih saja terjadi kesalahan pengelompokan proposal skripsi. Faktor pemicu salah memilih kelompok keilmuan karena masih berkaitannya satu kelompok keilmuan dengan kelompok keilmuan yang lain. Untuk melakukan identifikasi proposal skripsi dapat dilakukan dengan memanfaatkan metode klasifikasi.Dalam penelitian ini metode fuzzy k-nearest neighbour (FK-NN) diimplementasikan untuk klasifikasi proposal skripsi berdasarkan kelompok keilmuan. Dengan melakukan pengolahan kata sebelumnya serta menggunakan TFIDF sebagai metode pembobotan kata sehingga kata input dapat diolah sesuai kebutuhan. Parameter yang digunakan sebagai faktor penilaian yakni dilihat dari judul dan deskripsi proposal skripsi.Berdasarkan hasil pengujian didapatkan niai keakuratan yang terbesar yakni dengan presentase sebesar 51% pada nilai K=7 dan K=8, maka dari itu dapat disimpulkan bahwa dalam penelitian yang dilakukan nilai K yang menghasilkan keakuratan terbaik yakni pada nilai K=7 dan K=8. Keyword : proposal skripsi, Fuzzy K-Nearest Neighbour, TF-IDF, Klasifikasi','implementasi algoritmaa fuzzy k neigbour fuzzy k klasifikasi proposal skripsi kelompok ilmu teknik informatika unikom skripsi mata kuliah penutup ambil mahasiswa mahasiswi tempuh jenjang didik strata guru neger guru swasta skripsi syarat lulus kembang ilmu pengetahuan waktu agam tema tema skripsi muncul timbul keanekaragaman proposal skripsi akademik pengelompokan tema tema skripsi walaupun salah pengelompokan proposal skripsi faktor pemicu pilih kelompok ilmu kait kelompok ilmu kelompok ilmu identifikasi proposal skripsi manfaat metode klasifikasi dalam penelitian metode fuzzy k neighbour fk implementasi klasifikasi proposal skripsi kelompok ilmu olah tfidf metode bobot input o parameter faktor nilai lihat judul deskripsi proposal skripsi berdasarkan uji dapat nia akurat terbesar presentase nilai k= k= simpul penelitian nilai hasil akurat baik nilai k= k= keyword proposal skripsi fuzzy k neighbour tf klasifikasi'),(495,'E','Implementasi Augmented Reality Dengan Metode Face Detection Sebagai Media Promosi Helm Di Toko Zona Helm . Toko Zona Helm merupakan salah satu toko penjualan helm yang menjual berbagai macam merek dan model helm di daerah Kabupaten Bandung. Kesulitan toko Zona Helm dalam hal promosi yang masih menggunakan media poster dan pembicaraan verbal ini menyebabkan konsumen kurang berminat terhadap toko tersebut. Konsumen yang datang ke toko Zona Helm juga kesulitan dalam memilih model helm serta mencobanya satu persatu, meskipun toko ini telah melakukan kerjasama dengan distributor helm dan dapat melakukan pemesanan helm ke distributor sesuai keinginan konsumen. Salah satu solusi teknologi yang sedang berkembang sebagai media promosi adalah kaca virtual berbasis Augmented Reality. Penerapan media promosi berbasis Augmented Reality ini di toko Zona Helm adalah aplikasi kaca virtual helm, dimana konsumen seolah-olah mencoba model helm yang dijual di toko tersebut. Aplikasi ini menggunakan metode deteksi wajah dengan menggunakan haar cascade classifier. Haar Cascade Classifer merupakan metode yang menggunakan teknik sliding windows untuk mendeteksi fitur-fitur wajah pada gambar atau frame-frame dari webcam. Pengujian yang telah dilakukan pada aplikasi kaca virtual helm ini berupa pengujian alpha, beta, dan akurasi. Hasil pengujian alpha menunjukan bahwa aplikasi ini sudah berjalan sesuai dengan fungsionalitas aplikasi. Hasil pengujian akurasi menunjukkan bahwa aplikasi ini masih memiliki beberapa faktor yang mempengaruhi munculnya objek 3D helm, baik dari segi jarak, cahaya maupun sudut gerak wajah. Pengujian beta yang telah dilakukan menggunakan kuesioner terhadap 30 responden dapat diambil kesimpulan bahwa aplikasi ini cukup menarik minat responden dan memudahkan konsumen dalam memilih helm serta mudah digunakan. Keyword : Helm, Augmented Reality, Kaca Virtual, Media Promosi, haar cascade classifier.','implementasi augmented reality metode face detection media promosi helm toko zona helm toko zona helm toko jual helm jual macam merek model helm daerah kabupaten bandung sulit toko zona helm promosi media poster bicara verbal konsumen kurang minat toko konsumen toko zona helm sulit pilih model helm coba satu ski toko kerjasama distributor helm mesan helm distributor ingin konsumen solusi teknologi kembang media promosi kaca virtual basis augmented reality penerapan media promosi basis augmented reality toko zona helm aplikasi kaca virtual helm mana konsumen o coba model helm jual toko aplikasi metode deteksi wajah haar cascade classifier haar cascade classifer metode teknik sliding windows deteksi fitur wajah gambar frame webcam uji aplikasi kaca virtual helm upa uji alpha beta akurasi uji alpha tunjuk aplikasi fungsionalitas aplikasi uji akurasi aplikasi faktor pengaruh muncul objek helm segi jarak cahaya sudut gerak wajah uji beta kuesioner responden ambil simpul aplikasi tarik minat responden mudah konsumen pilih helm mudah keyword helm augmented reality kaca virtual media promosi haar cascade classifier'),(496,'A','Penerapan Knowledge Management System Pada PT. Indorama Synthetics TBK. PT Indorama Synthetics Tbk merupakan salah satu produsen dan eksportir polyester terbesar di Indonesia. Semua keberhasilan itu tak luput dari peran sumber daya manusia yang dimiliki oleh perusahaan. Sumber daya manusia ini harus disiapkan dengan baik agar memiliki kualitas dan daya saing agar mampu menghadapi persaingan global yang semakin ketat. Untuk memperoleh sumber daya manusia yang berkualitas diperlukan proses training dan pengelolaan pengetahuan yang baik. Permasalahan yang terjadi yaitu pengetahuan yang dimiliki setiap karyawan hanya tersimpan pada memori masing-masing karyawan, sehingga pengetahuan tersebut sulit untuk dibagikan kepada karyawan lainnya. Selain itu sulitnya dalam pengelolaan (membuat, memperbaharui, menyimpan dan menyebarkan) pengetahuan berupa materi training dan pengalaman yang berkaitan dengan kegiatan training.Penerapan knowledge management system merupakan solusi yang tepat untuk mengatasi masalah tersebut berupa pengalaman dari karyawan lain maupun trainer dan forum diskusi. Sistem ini dapat mempermudah kepala seksi departemen training dalam melakukan pengelolaan materi yang berkaitan dengan proses training. Selain itu, proses sharing pengalaman dari karyawan lain dan forum yang disediakan diharapkan dapat membantu mempermudah karyawan dalam pencarian solusi ketika terdapat permasalahan dalam bekerja. Kelebihan dari sistem informasi ini adalah sistem yang dapat diakses secara online sehingga karyawan tidak perlu menunggu trainer maupun teknisi ketika terdapat permasalahan. Berdasarkan hasil pengujian sistem yang dilakukan dengan pengujian black box berupa wawancara dan pengujian beta dengan menggunakan kuesioner, knowledge management system ini mampu membantu kepala departemen training dalam pengelolaan (membuat, memperbaharui, menyimpan dan menyebarkan) pengetahuan tersebut yang berupa materi training dan pengalaman. Selain itu mempermudah kayawan dalam pencarian solusi ketika terjadi permasalahan dalam bekerja. Keyword : Knowledge Management System, Sharing, Pengalaman, Training.','penerapan knowledge management system pt indorama synthetics tbk pt indorama synthetics tbk produsen eksportir polyester terbesar indonesia hasil luput peran daya manusia milik usaha daya manusia siap kualitas daya saing saing global ketat oleh daya manusia kualitas perlu training pengelolaan pengetahuan masalah pengetahuan milik karyawan simpan memori karyawan pengetahuan sulit bagi karyawan sulit pengelolaan buat baharu simpan sebar pengetahuan upa materi training alam kait training penerapan knowledge management system solusi tepat atas upa alam karyawan trainer forum diskusi sistem mudah kepala seksi departemen training pengelolaan materi kait training sharing alam karyawan forum sedia harap mudah karyawan cari solusi dapat masalah kerja lebih sistem informasi sistem akses online karyawan tunggu trainer teknisi dapat masalah uji sistem uji black box upa wawancara uji beta kuesioner knowledge management system kepala departemen training pengelolaan buat baharu simpan sebar pengetahuan upa materi training alam mudah kayawan cari solusi masalah kerja keyword knowledge management system sharing alam training'),(497,'B','Pembangunan Perangkat Lunak Data Mart GP Shoes . GP SHOES adalah salah satu perusahaan swasta yang kegiatan utamanya memproduksi sepatu pria dan wanita. Perusahaan ini di percaya sebagai suplier bagi perusahaan lainnya. Saat ini dalam menyajikan suatu informasi strategis produksi ataupun laporan strategis produksi yang dibutuhkan oleh manajer produksi masih secara manual dan membutuhkan waktu yang cukup lama dalam proses pencarian datanya. Tentunya akan menghambat dalam pengambilan keputusan produksi oleh manajer produksi. Akibatnya akan menjadi suatu kerugian bagi perusahaan. Berdasarkan permasalahan yang ada pada divisi produksi di GP SHOES, maka perlu dibangunnya sebuah perangkat lunak data mart untuk memudahkan dalam pengambilan keputusan pihak manajer produksi untuk mendapatkan informasi strategis yang cepat sehingga dapat digunakan perencanaan jangka panjang. Data Mart dapat menyajikan informasi secara cepat, mudah dan detail yang digunakan untuk analisa data dan juga dapat mendukung pembuatan laporan strategis produksi secara ringkas atau memiliki periode waktu berupa tabel dan grafik. Pembangunan aplikasi data mart menggunakan sistem SSIS (SQL Server Integration Service), ETL, OLAP dan untuk pembangunan data mart menggunakan analisis Objek serta skema yang di gunakan adalah skema constellation . Berdasarkan hasil pengujian blackbox dan beta, maka diperoleh kesimpulan bahwa data mart ini dapat menyajikan suatu informasi strategis yang cepat dan ringkas dalam menganalisis informasi strategis, serta dapat mempermudah dalam pembuatan laporan informasi strategis yang di butuhkan oleh manajer produksi di GP SHOES. Keyword : Data Mart , Skema Constellation, SSIS , OLTP, ETL, OLAP.','bangun angkat lunak data mart gp shoes gp shoes usaha swasta utama produksi sepatu pria wanita usaha percaya suplier usaha saji informasi strategis produksi atau lapor strategis produksi butuh manajer produksi manual butuh cari data tentu hambat ambil produksi manajer produksi akibat rugi usaha masalah divisi produksi gp shoes bangun angkat lunak data mart mudah ambil manajer produksi informasi strategis cepat rencana jangka data mart saji informasi cepat mudah detail analisa data dukung buat lapor strategis produksi ringkas periode upa tabel grafik bangun aplikasi data mart sistem ssis sql server integration service etl olap bangun data mart analisis objek skema guna skema constellation uji blackbox beta oleh simpul data mart saji informasi strategis cepat ringkas analisis informasi strategis mudah buat lapor informasi strategis butuh manajer produksi gp shoes keyword data mart skema constellation ssis oltp etl olap'),(498,'E','Pengembangan Aplikasi Pengenalan Koleksi Batu ARTEFAK Menggunakan Marker Dengan Teknologi Multitouch (Studi Kasus Museum Geologi Bandung). Museum Geologi Bandung adalah salah satu sarana pendidikan, objek pariwisata dan penyedia berbagai sumber informasi geologi. Terdapat beberapa media penyampaian informasi yang digunakan, yaitu media visual, media audio visual dan aplikasi interaktif. Dari ketiga media tersebut memiliki kekurangan yaitu membutuhkan penggunaan tempat yang cukup luas dan aplikasi interaktif yang ada di museum geologi hanya dapat digunakan oleh satu orang pengguna sehingga pengunjung harus antri untuk mencoba aplikasi interaktif tersebut. Salah satu solusi untuk mengurangi masalah tersebut yaitu menerapkan teknologi multitouch yang memungkinkan pengguna untuk mengontrol aplikasi grafis dengan beberapa sentuhan. Metode pembuatan multitouch menggunakan teknik Rear Diffused Illumination (Rear-DI), dimana metode ini memanfaat sinar inframerah yang diletakan dibawah dan diarahkan ke layar sentuhan. Pantulan inframerah dari sentuhan atau marker pada layar sentuhan akan dibaca oleh kamera yang telah dilengkapi oleh filter inframerah, lalu dilakukan proses image processing menggunakan perangkat lunak tambahan Reactivision yang menghasilkan data titik kordinat (X,Y), sudut (Angel) dan ID. Data dikirimkan ke aplikasi menggunakan komunikasi protokol TUIO (Tangible User Interface Protocol), namun TUIO menggunakan UDP yang memiliki kelemahan banyak data yang hilang sehingga perlu dikonversikan ke TCP menggunakan FLOSC (Flash OSC) lalu dikirimkan ke aplikasi. Aplikasi ditampilkan ke layar sentuhan menggunakan proyektor sebagai output. Berdasarkan hasil dari pengujian secara fungsionalitas aplikasi ini sudah berjalan sesuai dengan yang diharapkan. Hasil dari uji peforma, aplikasi ini mampu membaca 6 marker dan mendeteksi 20 sentuhan secara bersamaan. Untuk pengembangan kedepannya sebaiknya menggunakan kamera dengan kecepatan lebih dari 30fps dan menggunakan lensa Angle of View yang lebar tetapi bukan lensa yang berjenis fish eye. Keyword : museum, geologi, artefak, multitouch, media, interaktif, Rear Diffused','pengembangan aplikasi pengenalan koleksi batu artefak marker teknologi multitouch studi kasus museum geologi bandung museum geologi bandung sarana didik objek pariwisata sedia informasi geologi dapat media sampai informasi media visual media audio visual aplikasi interaktif media kurang butuh luas aplikasi interaktif museum geologi guna unjung antri coba aplikasi interaktif solusi urang terap teknologi multitouch mungkin guna kontrol aplikasi grafis sentuh metode buat multitouch teknik rear diffused illumination rear mana metode manfaat sinar inframerah letak bawah arah layar sentuh pantul inframerah sentuh marker layar sentuh baca kamera lengkap filter inframerah image processing angkat lunak tambah reactivision hasil data titik kordinat x y sudut angel data kirim aplikasi komunikasi protokol tuio tangible user interface protocol tuio udp lemah data hilang konversi tcp flosc flash osc kirim aplikasi aplikasi tampil layar sentuh proyektor output uji fungsionalitas aplikasi harap uji peforma aplikasi baca marker deteksi sentuh sama pengembangan depan baik kamera cepat fps lensa angle view lebar lensa jenis fish eye keyword museum geologi artefak multitouch media interaktif rear diffused'),(499,'D','Perancangan Sistem Dengan Android Sebagai Alat Pemantauan Sumur Pantau (Studi Kasus: Pusat Sumber Daya Air Tanah Dan Geologi Lingkungan (PAG) Bandung). Sumber daya air tanah merupakan salah satu sumber air minum yang penting di indonesia. Konservasi air tanah adalah upaya melindungi dan memelihara keberadaan, kondisi dan lingkungan air tanah guna mempertahankan kelestarian atau kesinambungan ketersediaan dalam kuantitas dan kualitas yang memadai, demi kelangsungan fungsi dan kemanfaatannya untuk memenuhi kebutuhan makhluk hidup, baik waktu sekarang maupun pada generasi yang akan datang.Dalam pemantauan sumber daya air tanah Pusat Sumber Daya Air Tanah dan Geologi Lingkungan (PAG) dengan sistem saat ini alat yang digunakan untuk mengirimkan data-data dari alat sensor kedalam server adalah RTU(Remote Terminal Unit). RTU adalah sistem yang telah dipasarkan oleh sebuah perusahaan. Alat RTU termasuk dalam alat yang mahal. Melihat permasalahan tersebut maka dibentuklan sebuah aplikasi yang bisa menggantikan tugas RTU. Aplikasi Sumur Pantau, yaitu sebuah sistem yang dirancang untuk melakukan pemantauan secara langsung pada sumur pantau. Apliakasi akan menunjukkan data-data kedalaman air saat ini dan data-data pendukung lainnya.Dengan dengan menggabungkan mikrokontroller arduino dan aplikasi pada android. Dengan pembangunan sistem ini, untuk memberikan kemudahan bagipemantau sumur pantau yang dapat memantau sesuai dengan waktu yang inginkan dan dimana saja.Keyword : Sumur Pantau,Arduino,Ketinggian Air','rancang sistem android alat pemantauan sumur pantau studi kasus pusat daya air tanah geologi lingkung pag bandung daya air tanah air minum indonesia konservasi air tanah lindung pelihara rada lingkung air tanah guna tahan lestari sinambung ketersediaan kuantitas kualitas memadai demi langsung fungsi manfaat penuh makhluk generasi datang dalam pemantauan daya air tanah pusat daya air tanah geologi lingkung pag sistem alat kirim data alat sensor dalam server rtu remote terminal unit rtu sistem pasar usaha alat rtu alat mahal masalah dibentuklan aplikasi ganti tugas rtu aplikasi sumur pantau sistem rancang pemantauan sumur pantau apliakasi data dalam air data dukung lainnya dengan gabung mikrokontroller arduino aplikasi android bangun sistem mudah bagipemantau sumur pantau pantau ingin mana saja keyword sumur pantau arduino ketinggian air'),(500,'C','Pembangunan Aplikasi Multimedia Interaktif Pertolongan Pertama Pada Kecelakaan (Studi Kasus PMI Bandung). Palang Merah Indonesia (PMI Kota Bandung) merupakan sebuah organisasi perhimpunan nasional yang bergerak dalam bidang sosial kemanusiaan.Dimana Palang Merah Indonesia (PMI Kota Bandung) menaungi organisasi terkait yang terdapat diinstansi-instansi pendidikan yang ada dikota ini. PMI selalu menjadwalkan pelatihan kepada setiap anggota PMR dengan berbagai tingkatan. Berdasarkan wawancara yang sudah dilakukan kepada Bapak Nana Setiawandi selaku perwakilan dari PMI muncul masalah yang dapat menghambat proses pelatihan seperti materi yang disampaikan terlalu banyak sedangkan waktu yang diberikan sangat terbatas, peserta pelatihan yang merupakan anggota palang merah remaja dimana biasanya diusia mereka sangat cepat merasa bosan dan jenuh dikarenakan banyaknya materi yang harus diterima sehingga penyampaian materi tidak ektif, metode penyampaian materi yang tidak menarik dan tidak ada standarisasi terhadap materi yang akan disampaikan (setiap fasilitator bisa menyampaikan materi apa saja terhadap peserta pelatihan). Seiring dengan perkembangan teknologi, media untuk melakukan pembelajaran pun menjadi semakin beragam. Salah satunya yaitu dengan pembangunan multimedia interaktif. Multimedia interaktif adalah suatu multimedia yang dilengkapi dengan alat pengontrol yang dapat dioperasikan oleh pengguna, sehingga pengguna dapat memilih apa yang dikehendaki untuk proses selanjutnya. Penggunaan multimedia interaktif ini adalah untuk membantu membuat materi yang disampaikan menjadi lebih menarik. Karakteristik terpenting dari multimedia interaktif adalah peserta tidak hanya memperhatikan media atau objek saja, melainkan dituntut untuk berinteraksi selama mengikuti pembelajaran. Ada pula Augmented Reality ini adalah sebagai media untuk menerangkan pengenalan dari alat-alat yang berkaitan dengan pertolongan pertama pada kecelakaan, pengenalan alat perlindungan diri (alat-alat yang perlu digunakan oleh penolong pada saat melakukan penyelamatan kepada korban), serta pengenalan terhadap macam-macam luka. Dimana nantinya fasilitator akan menyampaikan materi dengan bantuan marker yang akan menampilkan materi, sehingga cara penyampaian dapat berbeda dengan biasanya. Guna memaksimalkan teknologi Augmented Reality ini digunakan pula teknologi Speech Recognition, Speech Recognition dimana penerapannya adalah sebagai navigasi pada menu utama serta navigasi dalam menentukan arah ketika fasilitator sedang menggunakan marker. Keyword : Multimedia Pembelajaran, Pertolongan Pertama, PMI Kota Bandung','bangun aplikasi multimedia interaktif tolong celaka studi kasus pmi bandung palang merah indonesia pmi kota bandung organisasi himpun nasional gerak bidang sosial kemanusiaan dimana palang merah indonesia pmi kota bandung naung organisasi dapat instansi didik kota pmi jadwal latih anggota pmr tingkat wawancara bapak nana setiawandi sela wakil pmi hambat latih materi sampai berik batas serta latih anggota palang merah remaja mana usia cepat bosan jenuh karena banyak materi terima sampai materi ektif metode sampai materi tarik standarisasi materi sampai tiap fasilitator sampai materi serta latih iring kembang teknologi media pembelajaran agam satu bangun multimedia interaktif multimedia interaktif multimedia lengkap alat pengontrol operasi guna guna pilih hendak lanjut multimedia interaktif materi sampai tarik karakteristik terpenting multimedia interaktif serta hati media objek lain tuntut interaksi ikut pembelajaran augmented reality media terang pengenalan alat kait tolong celaka pengenalan alat lindung alat penolong selamat korban pengenalan macam luka mana nanti fasilitator sampai materi bantu marker tampil materi sampai beda guna maksimal teknologi augmented reality teknologi speech recognition speech recognition mana penerapan navigasi menu navigasi tentu arah fasilitator marker keyword multimedia pembelajaran tolong pmi kota bandung'),(501,'C','Analisis Performansi Layanan Internet Dengan Menggunakan Teknologi Broaband Over Powerline (Studi Kasus : Icon+Bandung). Sebagai penyedia layanan internet, Perusahaan Indonesia Comnet Plus (ICON+) tentu kepuasan pelanggan adalah hal yang diutamakan Dari 70 keluhan yang masuk setiap harinya, dalam satu tahun terakhir terdapat 3 perusahan yang sering (6-10 kali) mengalami keluhan terhadap jaringan internet. Yaitu, perusahaan A, perusahaan B, dan perusahaan C. Dimana nilai bandwidth masing-masing perusahaan tersebut adalah 2 Mbps untuk perusahaan A, 3 Mbps untuk perusahaan B, dan 5Mbps untuk perusahaan C. Namun di kondisi lain terdapat perusahaan dengan bandwidth yang sama namun jarang (2-4 kali) mengalami gangguan internet yaitu perusahaan D, Perusahaan E dan Perusahaan F. Nilai bandwidth masing-masing perusahaan tersebut adalah 2 Mbps untuk perusahaan D, 3 Mbps untuk perusahaan E, dan 5Mbps untuk perusahaan F Tugas Akhir ini bertujuan untuk mengetahui performansi dari 7 perusahaan sebagai sample penelitian. Kegiatan observasi dilakukan dengan mengukur kinerja mengukur kinerja BPL pada masing masing perusahaan. Selanjutnya dibandingkan kinerja BPL untuk parameter QoS: delay, jitter, packet loss, throughput, dan bandwidth. Untuk mendapatkan nilai throughput dilakukan dengan mendownload file melalui browser kemudian dibandingkan hasilnya dengan standart TIPHON. Sedangkan untuk delay, jitter dan packet loss didapatkan dengan melakukan percakapan VoIP kemudian hasilnya di bandingkan dengan standart TIPHON. Dari semua pengukuran jika dibandingkan dari 7 perusahaan tersebut didapat kesimpulan bahwa perusahaan A yang mempunyai nilai lebih rendah/ lebih buruk dari ke 6 perusahaan lainnya. Keyword : BPL, QoS , VoIP, TIPHONS','analisis performansi layan internet teknologi broaband over powerline studi kasus icon+bandung sedia layan internet usaha indonesia comnet plus icon+ puas langgan utama keluh hari dapat usah keluh jaring internet usaha usaha usaha mana nilai bandwidth usaha mbps usaha mbps usaha mbps usaha dapat usaha bandwidth jarang ganggu internet usaha usaha usaha nilai bandwidth usaha mbps usaha mbps usaha mbps usaha tugas tuju performansi usaha sample penelitian observasi ukur kinerja ukur kinerja bpl masing masing usaha lanjut banding kinerja bpl parameter qos delay jitter packet loss throughput bandwidth nilai throughput mendownload file browser banding hasil standart tiphon delay jitter packet loss dapat cakap voip hasil banding standart tiphon ukur banding usaha dapat simpul usaha nilai rendah buruk usaha keyword bpl qos voip tiphons'),(502,'D','Pembangunan Aplikasi Monitouring Untuk Club Motor Dengan Pemanfaatan Location Base Service (LBS) Menggunakan Metode Advance Positioning Pada Platform Android . Location Base Service (LBS) adalah sebuah layanan informasi yang dapat diakses dari perangkat bergerak dan memanfaatkan posisi geografis dari perangkat bergerak tersebut. LBS dapat mencakup berbagai konteks seperti pekerjaan, kesehatan dan masih banyak lagi pengaplikasiannya. Dalam tugas akhir ini, akan dibangun sebuah aplikasi bernama Monitouring dengan memanfaatkan LBS yang akan membantu mendeteksis lokasi Rider ketika touring motor sedang berlangsung. Sistem ini menggunakan metode Advance Positioning atau lebih dikenal dengan nama Assisted Global Positioning System (A-GPS) yang diterapkan pada perangkat mobile android. Metode ini digunakan untuk memecahkan permasalahan yang dialami oleh Rider dalam malakukan touring dimana tidak menutup kemungkinan ada Rider yang tersesat dan terpisah dari rombongannya.Dari hasil pengujian, metode A-GPS sangat baik digunakan untuk membantu kegiatan touring.Keyword : Location Base Service, A-GPS, Android.','bangun aplikasi monitouring club motor manfaat location base service lbs metode advance positioning platform android location base service lbs layan informasi akses angkat gerak manfaat geografis angkat gerak lbs cakup konteks kerja sehat aplikasi tugas bangun aplikasi nama monitouring manfaat lbs mendeteksis lokasi rider touring motor sistem metode advance positioning kenal assisted global positioning system a terap angkat mobile android metode pecah masalah alami rider malakukan touring mana tutup rider tersesat pisah rombongannya dari uji metode a touring keyword location base service a android'),(503,'D','Pembangunan Aplikasi Jasa Service Online Pada Platform Android . Sarana dan prasarana merupakan segala sesuatu yang merupakan penunjang utama terselenggaranya suatu proses kegiatan, alat sarana dan prasarana yang sering kita gunakan untuk menunjang aktivitas, lambat laun akan timbul gejala kerusakan karena sering digunakan. Namun untuk mencegah terjadinya kerusakan total, maka dibutuhkan perbaikan dan perawatan yang baik dan rutin. Apabila telah terjadi kerusakan kita sering kebinggungan bahkan tidak mengetahui siapa yang dapat melakukan perbaikan dan perawatan alat sarana- prasarana tersebut. Berdasarkan perihal diatas maka dibutuhkannya suatu aplikasi pada platform android yang dapat membantu masyarakat dalam menemukan jasa yang sesuai dengan kerusakan yang dialami. Aplikasi yang dibangun menggunakan metode topsis sebagai rekomendasi jasa, sebagai dasar perhitungan metode topsis diambil tiga kriteria yaitu harga, rating dan banyaknya service. Dengan adanya aplikasi tersebut diharapkan dapat mempermudah pengguna jasa dalam menemukan jasa dengan informasi yang lebih detail dan memberikankeamanan dalam melakukan transaksi kepada jasa. Keyword : Jasa, Service, Android','bangun aplikasi jasa service online platform android sarana prasarana segala suatu penunjang terselenggara alat sarana prasarana guna tunjang aktivitas lambat laun timbul gejala rusak cegah jadi rusak total butuh baik rawat rutin apabila rusak kebinggungan siapa baik rawat alat sarana prasarana perihal atas butuh aplikasi platform android masyarakat temu jasa rusak alami aplikasi bangun metode topsis rekomendasi jasa dasar hitung metode topsis ambil kriteria harga rating banyak service aplikasi harap mudah guna jasa temu jasa informasi detail memberikankeamanan transaksi jasa keyword jasa service android'),(504,'A','Pembangunan Sistem Informasi Manajemen Operasional Di Rumah Makan Warung Cepot . Rumah Makan (RM.) Warung Cepot merupakan tempat usaha yang bergerak dalam bidang kuliner. RM. Warung Cepot saat ini terletak di dua lokasi, dimana kedua lokasi tersebut terletak di tempat yang berbeda. Berdasarkan hasil wawancara dengan Bapak Wawan selaku Manager Operasional Warung Cepot, jumlah transaksi penjualan dalam jangka waktu satu bulan terdapat lebih dari 350 dan penyimpanan data transaksi penjualan barang dilakukan dengan cara menyimpan dalam bentuk dokumen transaksi penjualan menyebabkan Manager Operasional kesulitan dalam mengawasi dan mengevaluasi hasil target penjualan per bulan. Jumlah bahan baku yang mencapai 82 jenis dan proses pencatatan pemakaian dan penambahan masih dilakukan dengan cara menuggu hingga jam operasional berakhir membuat bagian Pitch Control kesulitan dalam menentukan jumlah bahan baku yang harus dibeli dan bagian ADM. Gudang/keuangan kesulitan dalam hal pengawasan bahan baku tersebut. Pendekatan untuk menyelesaikan permasalahan yang telah diuraikan adalah dengan membangun sebuah Sistem Informasi Manajemen Operasional si Rumah Makan Warung Cepot. Sistem Informasi Manajemen Operasional menerapkan metode peramalan untuk membantu manajer dalam melakukan perencanaan penjualan barang. Metode peramalan yang diterapkan adalah metode single moving average (SMA) . Setelah proses perencanaan , proses yang selanjutnya adalah proses monitoring perencanaan tersebut . Proses monitoring diterapkan untuk memantau proses perencanaan supaya berjalan dengan baik . Proses terakhir yang dilakukan adalah proses evaluasi .Proses evaluasi adalah hasil dari proses Â– proses sebelumnya dan sebagai penentu untuk proses perencanaan berikutnya. Sistem Informasi Manajemen Operasional menggunakan model pembangunan perangkat lunak yaitu model waterfall, sedangkan analisis sistem menggunakan pemodelan terstruktur dengan menggunakan Data Flow Diagram(DFD). Berdasarkan implementasi dan pengujian yang telah dilakukan maka dapat disimpulkan bahwa Sistem Informasi Manajemen Operasional yang dibangun dapat membantu menyelesaikan masalah Â– masalah yang telah dikemukakan oleh pihak Rumah makan Warung Cepot. Keyword : Sistem Informasi Manajemen, Operasional, Peramalan , Single Moving Average','bangun sistem informasi manajemen operasional rumah makan warung cepot rumah makan rm warung cepot usaha gerak bidang kuliner rm warung cepot terletak lokasi mana lokasi terletak beda wawancara bapak wawan sela manager operasional warung cepot transaksi jual jangka dapat simpan data transaksi jual simpan dokumen transaksi jual manager operasional sulit awas evaluasi target jual per bahan baku catat pemakaian penambahan menuggu jam operasional akhir pitch control sulit tentu bahan baku beli adm gudang keuangan sulit awas bahan baku dekat selesai masalah urai bangun sistem informasi manajemen operasional si rumah makan warung cepot sistem informasi manajemen operasional terap metode ramal manajer rencana jual metode ramal terap metode single moving average sma rencana lanjut monitoring rencana monitoring terap pantau rencana supaya evaluasi proses evaluasi penentu rencana ikut sistem informasi manajemen operasional model bangun angkat lunak model waterfall analisis sistem model struktur data flow diagram dfd implementasi uji simpul sistem informasi manajemen operasional bangun selesai muka rumah makan warung cepot keyword sistem informasi manajemen operasional ramal single moving average'),(505,'E','Analisis Perbandingan Algoritma (Left-Corner-Parsing Dan Algoritma CYK (Cocke-Younger-Kasami)Untuk Memeriksa Pola Kalimat Baku Bahasa Indonesia. Seorang penulis harus memperhatikan pola kalimat dalam bahasa tulisan, karena pola kalimat akan berpengaruh dalam proses penyampaian dan penerima pesan. Berdasarkan pola dasarnya, bahasa indonesia mengenal beberapa pola kalimat (1) S-P, (2) S-P-O, (3) S-P-Pel, (4) S-P-K, (5) S-P-O-Pel, (6) S-P-O-Pel-K, (7) S-P-O-K, dan (8) S-P-Pel-K. Hal inilah yang mendasari proses penulisan perlu memperhatikan pola kalimat, sehingga perlu diadakan penelitian tentang pemeriksaan pola kalimat.Algoritma yang digunakan dalam memeriksa kalimat sangat banyak macamnya, dua diantaranya algoritma LCP (Left Corner Parsing) dan algoritma CYK (Cocke-Younger-Kasami). Algoritma LCP (Left Corner Parsing) merupakan algoritma gabungan dari Top down Parsing dan Bottom up Parsing. Proses dari algoritma LCP (Left Corner Parsing) dimulai secara Bottom Up dan diakhiri secara Top Down. Algoritma CYK menggunakan struktur array dua dimensi dalam pengecekkannya. Setiap kata diperiksa kelompok katanya, kemudian dilakukan pengecekkan struktur kalimatnya. Dari perbedaan cara kerja algoritma, maka akan dipelajari dan dibandingkan kemampuan masing-masing algoritma dalam memeriksa pola kalimat baku bahasa Indonesia. Kedua algoritma tersebut dilakukan analisis sehingga diketahui tingkat akurasi dari masing-masing algoritma dalam memeriksa pola kalimat baku.Hasil pengujian pemeriksaan pola kalimat baku didapatkan tingkat akurasi dari algoritma CYK (Cocke-Younger-Kasami) sebesar 65% dengan laju error 0.35 dan algoritma left corner parsing sebesar 60% dengan laju error 0.40. Namun tingkat akurasi yang didapat belum cukup besar karena kamus POS Tag yang digunakan masih terdapat kekurangan yaitu masih banyak kata yang tidak dapat dikenali. Keyword : Algoritma, Left Corner Parsing, Cocke-Younger-Kasami, Pola Kalimat, Bahasa Indonesia.','analisis banding algoritma left algoritma cyk cocke periksa pola kalimat baku bahasa indonesia penulis hati pola kalimat bahasa tulis pola kalimat pengaruh sampai penerima pesan pola dasar bahasa indonesia kenal pola kalimat s s s s s s s s ini dasar penulisan hati pola kalimat adakan penelitian pemeriksaan pola kalimat algoritma periksa kalimat macam antara algoritma lcp left corner parsing algoritma cyk cocke algoritma lcp left corner parsing algoritma gabung top down parsing bottom up parsing algoritma lcp left corner parsing mulai bottom up akhir top down algoritma cyk struktur array dimensi ecek periksa kelompok ecek struktur kalimat beda algoritma dipelajari banding mampu algoritma periksa pola kalimat baku bahasa indonesia algoritma analisis tahu akurasi algoritma periksa pola kalimat baku hasil uji pemeriksaan pola kalimat baku dapat akurasi algoritma cyk cocke laju error algoritma left corner parsing laju error akurasi dapat kamus pos tag dapat kurang kenal keyword algoritma left corner parsing cocke pola kalimat bahasa indonesia'),(506,'A','Pembangunan Sistem Informasi Customer Relationship Management (CRM) Di PT. Angga Sarana Media . PT. Angga Sarana Media (ASM) merupakan sebuah perusahaan yang bergerak di bidang jasa periklanan yang berpusat di Bandung. PT. Angga Sarana Media sebagai pelaku bisnis yang sudah lama berkecimpung dalam bidang periklanan perlu memikirkan bagaimana untuk meningkatkan pertumbuhan jangka panjang dan profitabilitas perusahaan. PT. Angga Sarana Media masih memiliki permasalahan dalam hal menyesuaikan pemberian jenis pelayanan yang tepat kepada pelanggan, dan juga kesulitan menentukan rekomendasi daftar jasa yang akan ditawarkan ke pelanggan. Berdasarkan permasalahan-permasalahan yang ada pada saat ini di PT. Angga Sarana Media, maka dibutuhkannya suatu pembangunan sistem informasi Customer Relationship Management (CRM) di PT. Angga Sarana Media. Tujuan pembangunan informasi CRM ini memudahkan dalam menyesuaikan pemberian jenis pelayanan yang tepat kepada pelanggan serta menentukan rekomendasi daftar jasa yang akan ditawarkan kepada pelanggan berdasarkan transaksi.CRM (Customer Relationship Management) adalah metodologi, strategi, perangkat lunak (software) dan aplikasi web yang mampu membantu sebuah perusahaan untuk mengelola hubungan dengan pelanggan. Konsep CRM banyak digunakan sebagai acuan pada industri informasi sebagai metodologi kapabilitas internet yang membantu perusahaan mengelola hubungan dengan pelanggan. Jenis CRM yang dibangun menggunakan CRM Analitikal. Adapun metode yang digunakan dalam segmentasi pelanggan menggunakan metode RFM (Recency, Frequency, Monetary). Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini dapat membantu perusahaan untuk menyesuaikan pemberian jenis pelayanan yang tepat kepada pelanggan, dan juga membantu perusahaan dalam menentukan rekomendasi daftar jasa yang akan ditawarkan ke pelanggan. Keyword : sistem informasi, customer relationship management, analitikal, segmentasi, RFM.','bangun sistem informasi customer relationship management crm pt angga sarana media pt angga sarana media asm usaha gerak bidang jasa iklan pusat bandung pt angga sarana media pela bisnis kecimpung bidang iklan pikir tumbuh jangka profitabilitas usaha pt angga sarana media masalah suai beri layan tepat langgan sulit tentu rekomendasi daftar jasa ditawarkan langgan masalah pt angga sarana media butuh bangun sistem informasi customer relationship management crm pt angga sarana media tuju bangun informasi crm mudah suai beri layan tepat langgan tentu rekomendasi daftar jasa ditawarkan langgan transaksi crm customer relationship management metodologi strategi angkat lunak software aplikasi web usaha kelola langgan konsep crm acu industri informasi metodologi kapabilitas internet usaha kelola langgan crm bangun crm analitikal adapun metode segmentasi langgan metode rfm recency frequency monetary uji simpul sistem usaha suai beri layan tepat langgan usaha tentu rekomendasi daftar jasa ditawarkan langgan keyword sistem informasi customer relationship management analitikal segmentasi rfm'),(507,'B','Penerapan Data Warehouse Pada Koperasi Anugerah Rejeki . Peminjaman Koperasi Anugerah Rejeki ingin berperan secara aktif dalam upaya membangun dan mengembangkan potensi dan kemampuan ekonomi masyarakat untuk meningkatkan kesejahteraan ekonomi dan sosialnya. Kendala yang terjadi saat ini di Koperasi Anugerah Rejeki ditemukan belum tersedianya desain data yang dapat dimanfaatkan untuk kebutuhan laporan maupun untuk menganalisis data, karena belum tersedianya laporan yang menampilkan informasi dari berbagai aspek penting. Data warehouse menjadikan data perusahaan yang tersebar menjadi terintegrasi sehingga membantu pihak perusahaan dalam menganalisis data yang ada untuk pengambilan keputusan yang bersifat strategis secara cepat dan tepat. Pembangunan data warehouse ini menggunakan pemodelan skema Snowflake dan perancangan OLAP (On-Line Analytical Processing) untuk pengolahan dan analisis datanya dengan menggunakan teknik Roll-Up dan Drill-Down. Setelah melakukan pengujian hasil penelitian ini diharapkan dapat membantu pihak perusahaan dalam menganalisis data dalam jumlah besar sehingga memudahkan dalam mengambil sebuah keputusan strategi bisnis untuk mengetahui kebutuhan koperasi. Keyword : Data Warehouse, Koperasi Anugerah Rejeki, OLAP','penerapan data warehouse koperasi anugerah rejeki peminjaman koperasi anugerah rejeki peran aktif bangun kembang potensi mampu ekonomi masyarakat sejahtera ekonomi sosial kendala koperasi anugerah rejeki tersedia desain data manfaat lapor analisis data tersedia lapor tampil informasi aspek data warehouse jadi data usaha tersebar integrasi usaha analisis data ambil sifat strategis cepat tepat bangun data warehouse model skema snowflake rancang olap on analytical processing olah analisis data teknik roll drill uji penelitian harap usaha analisis data mudah strategi bisnis koperasi keyword data warehouse koperasi anugerah rejeki olap'),(508,'D','Pembangunan Aplikasi Diskon Pakaian Dengan Rekomendasi Toko Terdekat Berbasis Android . Diskon merupakan bentuk pengurangan harga secara langsung terhadap pembelian selama periode waktu tertentu. Perilaku konsumen yang semakin lama juga semakin beragam seperti strategi pemasaran yang tidak akan pernah berhenti diterapkan pengusaha untuk menarik minat beli konsumen. Informasi mengenai diskon pakaian dan lokasi toko pakaian di Kota Bandung, biasanya mereka peroleh dengan langsung mengunjungi toko-toko pakaian atau bertanya kepada kerabat mereka. Dibutuhkan usaha yang lebih untuk mendapatkan informasi diskon pakaian dan rekomendasi toko pakaian terdekat.Bandung Fashion Sale adalah suatu aplikasi yang merekomendasikan toko pakaian terdekat dibutuhkan toko yang memiliki jarak yang paling dekat dengan keberadaan pengguna. Aplikasi ini memiliki beberapa fitur untuk membantu para pencari diskon pakaian dalam mencari toko dan produk diskon, salah satu fitur unggulannya adalah fitur rekomendasi toko terdekat yang menggunakan metode Haversine Formula untuk menentukan jarak toko terdekat. Selain itu untuk mendukung kinerja perangkat lunak yang lebih baik, perangkat lunak ini memanfaatkan teknologi pihak ketiga yaitu teknologi Global Positioning System untuk mendeteksi data lokasi. Aplikasi ini dibangun berbasis mobile dengan pertimbangan bahwa belum adanya aplikasi sejenis yang khusus menginformasikan diskon di Kota Bandung pada platform Android. Aplikasi yang dibangun dapat membantu para pencari diskon untuk mendapatkan informasi produk diskon dan rekomendasi toko pakaian terdekat. Keyword : Diskon, Android, Rekomendasi, Haversine Formula.','bangun aplikasi diskon pakai rekomendasi toko terdekat basis android diskon urang harga beli periode tertentu perilaku konsumen agam strategi pemasaran henti terap usaha tarik minat beli konsumen informasi diskon pakai lokasi toko pakai kota bandung oleh unjung toko pakai berta kerabat butuh usaha informasi diskon pakai rekomendasi toko pakai terdekat bandung fashion sale aplikasi rekomendasi toko pakai terdekat butuh toko jarak rada guna aplikasi fitur pencar diskon pakai toko produk diskon fitur unggul fitur rekomendasi toko terdekat metode haversine formula tentu jarak toko terdekat dukung kinerja angkat lunak angkat lunak manfaat teknologi teknologi global positioning system deteksi data lokasi aplikasi bangun basis mobile timbang aplikasi jenis informasi diskon kota bandung platform android aplikasi bangun pencar diskon informasi produk diskon rekomendasi toko pakai terdekat keyword diskon android rekomendasi haversine formula'),(509,'A','Pembangunan Sistem Informasi Customer Relationship Management Pada Donini Sentra Binatu Bandung . Donini Sentra Binatu merupakan perusahaan yang bergerak dalam bidang jasa pencucian Dry Cleaning & Laundry Satuan, secara profesional menggunakan teknologi mutakhir dengan didukung mesinÂ–mesin yang canggih dan modern. Namun, terdapat beberapa masalah yang sedang dihadapi berkaitan dengan hubungan pelanggan. Donini Sentra Binatu belum melakukan penindaklanjutan promosi agar dapat menarik minat calon pelanggan, sulit dalam menyesuaikan pemberian diskon yang tepat berdasarkan jenis pelanggan dan belum melakukan proses penindaklanjutan agar pelanggan yang Loyal maupun tidak Loyal dapat kembali melakukan transaksi.Customer Relationship management (CRM) digunakan agar Donini Sentra Binatu dapat memelihara hubungan dengan pelanggan dalam menciptakan transaksi. Dalam pembuatan sistem informasi CRM ini, framework of Dynamic CRM digunakan sebagai acuan agar fitur CRM dapat dibangun secara cepat dan tepat. Sedangkan, Model RFM digunakan untuk melakukan proses segmentasi berdasarkan perilaku pelanggan yang terdiri dari tiga atribut domain, yaitu tanggal transaksi terakhir (recency), jumlah transaksi (frequency), dan nominal dari transaksi (monetary).Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini sudah membantu Donini Sentra Binatu dalam menarik minat calon pelanggan melalui informasi promosi, melakukan proses pengelompokan pelanggan untuk menentukan jenis pelanggan dalam menyesuaikan pemberian diskon yang tepat, pengiriman informasi diskon melalui SMS dan memudahkan manajer dalam proses penanganan keluhan pelanggan. Keyword : Framework of Dynamic CRM, RFM, Customer Relationship Management, Sistem Informasi','bangun sistem informasi customer relationship management donini sentra binatu bandung donini sentra binatu usaha gerak bidang jasa cuci dry cleaning laundry satu profesional teknologi mutakhir dukung mesin  mesin canggih modern dapat hadap kait langgan donini sentra binatu penindaklanjutan promosi tarik minat calon langgan sulit suai beri diskon tepat langgan penindaklanjutan langgan loyal loyal transaksi customer relationship management crm donini sentra binatu pelihara langgan cipta transaksi buat sistem informasi crm framework dynamic crm acu fitur crm bangun cepat tepat model rfm segmentasi perilaku langgan diri atribut domain transaksi recency transaksi frequency nominal transaksi monetary  berdasarkan uji simpul sistem donini sentra binatu tarik minat calon langgan informasi promosi pengelompokan langgan tentu langgan suai beri diskon tepat pengiriman informasi diskon sms mudah manajer penanganan keluh langgan keyword framework dynamic crm rfm customer relationship management sistem informasi'),(510,'E','Analisis Algoritma Backpropagation Levenberg Marquardit Untuk Pengenalan Motif Kain Batik . Batik merupakan budaya yang telah lama berkembang dan dikenal oleh masyarakat Indonesia. Motif batik di setiap daerah memiliki keunikan dan ciri khas masing-masing, baik dalam ragam hias maupun tata warna batik itu sendiri. Salah satu cara untuk mengidentifikasi motif pada kain batik yaitu melalui pengenalan pola. Penelitian mengenai pengenalan pola pada kain batik sudah pernah dilakukan oleh Bernadinus Arisandi [3] dengan menggunakan metode Rotated Wavelet Filter dan Neural Network Filter dengan hasil pada penggunaan data training yang berbeda dengan data testing diperoleh akurasi tertinggi 78,26%. Selain itu juga sudah pernah dilakukan penelitian mengenai pengenalan motif batik oleh Johanes Widagdho Yodha [6] dengan menggunakan Deteksi Tepi Canny dan K-Nearest Neighbor dengan hasil pada penggunaan data training yang berbeda dengan data testing diperoleh akurasi tertinggi 66,67%.Algoritma Levenberg Marquadt merupakan pengembangan dari algoritma backpropagation. Algoritma ini dibangun untuk mengatasi beberapa kekurangan yang ada pada algoritma backpropagation dengan memanfaatkan teknik optimisasi numerik standar yaitu menggunakan pendekatan matriks Jacobian. Tujuan dari Levenberg Marquadt adalah meminimalkan total error. Pengujian dari algoritma Levenberg Marquardt dilakukan dengan metode cross validation. Data yang digunakan pada proses pelatihan berjumlah 50 buah motif dasar dengan masing-masing motif 10 buah dan 45 buah motif campuran dengan masing-masing motif 5 buah. Sedangkan jumlah motif yang akan dilakukan pengujian yaitu 42 buah, dengan masing-masing motif 3 buah. Dari 4 skenario pengujian yaitu menggunakan 1 sampai 4 hidden layer, hasil pengujian menunjukkan akurasi tertinggi sebesar 62.5% dengan akurasi pada batik motif dasar sebesar 80% dan akurasi pada batik motif campuran sebesar 15.79%. Akurasi ini didapatkan dari susunan variabel yang memiliki jumlah neuron pada hidden layer sebanyak 3 neuron dan 4 neuron, learning rate yang bernilai 0.01, batas epoh sebesar 7000, dan target error sebesar 0.035. Keyword : backpropagation, levenberg marquardt, batik, pattern recognition','analisis algoritma backpropagation levenberg marquardit pengenalan motif kain batik batik budaya kembang kenal masyarakat indonesia motif batik daerah unik ciri khas ragam hias tata warna batik identifikasi motif kain batik pengenalan pola penelitian pengenalan pola kain batik bernadinus arisandi [ ] metode rotated wavelet filter neural network filter data training beda data testing oleh akurasi tinggi penelitian pengenalan motif batik johanes widagdho yodha [ ] deteksi tepi canny k neighbor data training beda data testing oleh akurasi tinggi % algoritma levenberg marquadt pengembangan algoritma backpropagation algoritma bangun atas kurang algoritma backpropagation manfaat teknik optimisasi numerik standar dekat matriks jacobian tuju levenberg marquadt minimal total error uji algoritma levenberg marquardt metode cross validation data latih berjum buah motif dasar motif buah buah motif campur motif buah motif uji buah motif buah skenario uji hidden layer uji akurasi tinggi akurasi batik motif dasar akurasi batik motif campur akurasi dapat susun variabel neuron hidden layer neuron neuron learning rate nilai batas epoh target error keyword backpropagation levenberg marquardt batik pattern recognition'),(511,'E','Otomasi Pembentukan Abstrak Bahasa Indonesia Berdasarkan Keseluruhan Dokumen Menggunakan Term Frequency-Inverse Document Frequency (TF-IDF). Abstrak adalah sebuah ringkasan dari keseluruhan dokumen penelitian agar pembaca tahu maksud dari penelitian tersebut. Dari abstrak, pembaca dapat mengetahui jalan pikiran penulis laporan/artikel ilmiah tersebut dan mengetahui gambaran umum tulisan secara lengkap. Dalam membentuk paragraf abstrak pada sebuah dokumen jurnal dari setiap sub bab tentunya membutuhkan pencarian kalimat yang singkat dan jelas. Pencarian kalimat pada setiap sub bab dalam dokumen jurnal yang banyak akan membantu penulis laporan/artikel ilmiah dalam membentuk abstrak dengan keterbatasan pembentukan abstrak harus singkat, bagian harus seimbang dan menghindari kalimat yang panjang. Dalam penelitian ini dibangun sistem pembentukan abstrak secara otomatis dengan menerapkan metode Term Frequency Â– Inverse Document frequency. Metode Term Frequency Â– Inverse Document Frequency (TF-IDF) akan mencari kalimat pada sub judul pendahuluan, analisis, dan kesimpulan sehingga akan terbentuklah kalimat abstrak secara otomatis dengan mengutamakan isi kalimat yang berada pada sub judul tersebut. Analisis sistem pembentukan abstrak otomatis yang dibangun memiliki 3 tahapan yaitu input jurnal, praproses, pembentukan abstrak. Input jurnal yang dipilih berupa jurnal berformat doc. Praproses yang dilakukan dalam tahap ini adalah pemecahan kalimat, case folding, filtering, tokenizing, synonim checking, dan stopword. Tahap selajutnya melakukan perhitungan menggunakan tf-idf dan tahap terakhir menentukan hasil abstrak dengan metode cosine similarity. Berdasarkan hasil pengujian, maka dilakukan tahap pengujian terhadap sistem dan secara manual. Maka diperoleh jarak antara hasil manual dengan sistem rata-rata hanya berbeda 2 sampai 4 kalimat saja. Akurasi dengan persentase 100% didapat oleh jurnal ke 7 dan 9 sedangkan akurasi dengan pesentase terendah 60% didapat oleh jurnal ke 1. Keyword : Term Frequency Â– Inverse Document Frequency (TF-IDF), Kecerdasan Buatan, Pembentukan Abstrak Otomatis.','otomasi bentuk bahasa indonesia seluruh dokumen term frequency document frequency tf ringkas seluruh dokumen penelitian baca maksud penelitian baca pikir penulis laporan artikel ilmiah gambar tulis lengkap bentuk paragraf dokumen jurnal sub bab tentu butuh cari kalimat singkat cari kalimat sub bab dokumen jurnal penulis laporan artikel ilmiah bentuk batas bentuk singkat imbang hindar kalimat penelitian bangun sistem bentuk otomatis terap metode term frequency inverse document frequency metode term frequency inverse document frequency tf kalimat sub judul dahulu analisis simpul terbentuk kalimat otomatis utama isi kalimat sub judul analisis sistem bentuk otomatis bangun tahap input jurnal praproses bentuk input jurnal pilih upa jurnal format doc praproses tahap cah kalimat case folding filtering tokenizing synonim checking stopword tahap selajut hitung tf tahap tentu metode cosine similarity uji tahap uji sistem manual oleh jarak manual sistem rata beda kalimat akurasi persentase dapat jurnal akurasi pesentase terendah dapat jurnal keyword term frequency inverse document frequency tf cerdas buat bentuk otomatis'),(512,'A','Pembangunan Sistem Informasi Manajemen Sumber Daya Manusia Di PT. Surya Bahana Mahkota. PT. Surya Bahana Mahkota adalah perusahaan yang bergerak di bidang penjualan, perbaikan dan suku cadang untuk produk mobil suzuki untuk daerah Nusa Tenggara Timur. Salah satu cara untuk mencapai tujuan perusahaan adalah memiliki sumber daya manusia yang berkompeten, namun bagi perusahaan tidak mudah dalam mendapatkan sumber daya manusia (SDM) yang mampu mencapai tujuan tersebut. Masalah yang terjadi pada saat ini adalah dalam proses perekrutan pegawai masih sering terjadi ketidaksesuaian antara jumlah dan kriteria pegawai yang dibutuhkan dengan yang diterima oleh perusahaan dikarenakan perencanaan SDM yang dilakukan kurang efektif sehingga menyebabkan penerimaan jumlah pegawai yang diterima terkadang melebihi dari jumlah pegawai yang dibutuhkan dan proses penyelenggaraan evaluasi kinerja pegawai yang dilakukan oleh pihak departemen sumber daya manusia masih kurang tepat dan sangat diragukan hasilnya karena evaluasi masih dilakukan oleh atasan berdasarkan kebijakan pribadi atasan itu sendiri. Proses perekrutan pegawai menggunakan metode Weighted Product (WP). Metode Weighted Product merupakan pengambilan keputusan dengan cara perkalian untuk menghubungkan rating atribut, dimana rating setiap atribut harus dipangkatkan dulu dengan bobot atribut yang bersangkutan. Metode yang digunakan dalam proses evaluasi kinerja pegawai adalah metode 360 derajat yang mana metode penilaian kinerja yang memungkinkan pegawai untuk memperoleh penilaian dari segala arah, dari atasan, bawahan dan rekan kerjanya. Berdasarkan hasil pengujian yang telah dilakukan, sistem ini sudah mampu membantu Manager departemen sumber daya manusia dalam menentukan perencanaan SDM yang efektif dan tepat dalam melakukan proses perekrutan pegawai baru dan cukup memudahkan untuk menentukan keputusan pegawai yang paling tepat yang dibutuhkan oleh perusahaan. Selain itu sistem ini juga bisa membantu untuk menyelenggarakan proses evaluasi kinerja pegawai yang lebih objektif dan mempermudah Manager dalam pengambilan keputusan untuk pemberian kompensasi kenaikan gaji, promosi jabatan dan pemutusan hubungan kerja kepada pegawai. Keyword : Perekrutan, Penilaian Kinerja, Metode 360 derajat, Weighted Product','bangun sistem informasi manajemen daya manusia pt surya bahana mahkota pt surya bahana mahkota usaha gerak bidang jual baik suku cadang produk mobil suzuki daerah nusa tenggara timur tuju usaha daya manusia kompeten usaha mudah daya manusia sdm tuju rekrut gawai ketidaksesuaian kriteria gawai butuh terima usaha karena rencana sdm kurang efektif penerimaan gawai terima kadang lebih gawai butuh selenggara evaluasi kinerja gawai departemen daya manusia kurang tepat raguk hasil evaluasi atas bijak pribadi atas rekrut gawai metode weighted product wp metode weighted product ambil kalian hubung rating atribut mana rating atribut pangkat bobot atribut sangkut metode evaluasi kinerja gawai metode derajat metode nilai kinerja mungkin gawai oleh nilai segala arah atas bawah rekan kerja uji sistem manager departemen daya manusia tentu rencana sdm efektif tepat rekrut gawai mudah tentu gawai tepat butuh usaha sistem selenggara evaluasi kinerja gawai objektif mudah manager ambil beri kompensasi naik gaji promosi jabat pemutusan gawai keyword rekrut nilai kinerja metode derajat weighted product'),(513,'B','Pembangunan Data Warehouse Pada PT. Pupuk Iskandar Muda . PT. Pupuk Iskandar Muda atau biasa disebut dengan PT PIM adalah anak perusahaan PT.Pupuk Indonesia (Persero) BUMN yang bergerak di bidang industri kimia memproduksi pupuk urea. Kehadiran PT. Pupuk Iskandar Muda dapat memenuhi kebutuhan pupuk untuk petani dan perkebunan yang sangat luas di beberapa wilayah provinsi Aceh, Sumatera Utara,Sumatera Barat, Riau, Kepulauan Riau, dan Kalimantan Barat. Saat ini jumlah data yang ada pada PT.Pupuk Iskandar Muda cukup besar sehingga mengakibatkan lambatnya dalam mengakses informasi, kemudian disetiap bagian memiliki perbedaan tipe data dan penamaan data. Bentuk laporan belum mendukung untuk dilihat dari berbagai aspek dalam pengambilan keputusan perusahaan, sehingga diperlukan sistem yang dapat menampilkan informasi secara multi dimensional. Oleh sebab itu, perusahaan tersebut memerlukan data warehouse untuk dapat mengelola data produksi dan data penjualan untuk mendapat informasi dalam mengambil keputusan. Data perusahaan yang digunakan adalah data penjualan, produksi, gudang, pelanggan, barang, pabrik, bahan. Data warehouse menjadikan data perusahaan yang tersebar menjadi terintegrasi sehingga membantu pihak perusahaan dalam menganalisis data yang ada untuk pengambilan keputusan yang bersifat strategis secara cepat dan tepat. Pembangunan data warehouse ini menggunakan pemodelan skema Fact constellations dan perancangan OLAP (On-Line Analytical Processing) untuk pengolahan dan analisis datanya dengan menggunakan teknik Roll-Up dan Drill-Down. Perangkat lunak data warehouse ini dapat membantu pihak perusahaan dalam pengintegrasian data. Informasi yang dihasilkan dapat menjadi alat bantu analisis untuk perusahaan PT.Pupuk Iskandar Muda. Keyword : Data warehouse, Fact Constellations, Roll-Up, Drill-Down, OLAP','bangun data warehouse pt pupuk iskandar muda pt pupuk iskandar muda sebut pt pim anak usaha pt pupuk indonesia sero bumn gerak bidang industri kimia produksi pupuk urea hadir pt pupuk iskandar muda penuh pupuk tan kebun luas wilayah provinsi aceh sumatera utara sumatera riau pulau riau kalimantan data pt pupuk iskandar muda akibat lambat akses informasi tiap beda tipe data nama data lapor dukung lihat aspek ambil usaha perlu sistem tampil informasi multi dimensional usaha perlu data warehouse kelola data produksi data jual informasi data usaha data jual produksi gudang langgan pabrik bahan data warehouse jadi data usaha tersebar integrasi usaha analisis data ambil sifat strategis cepat tepat bangun data warehouse model skema fact constellations rancang olap on analytical processing olah analisis data teknik roll drill angkat lunak data warehouse usaha integrasi data informasi hasil alat bantu analisis usaha pt pupuk iskandar muda keyword data warehouse fact constellations roll drill olap'),(514,'D','Pembangunan Aplikasi photo Tangging Untuk Petugas Pencatata Meter Listrik Menggunakan Teknologi Geotagging Pada Platform Android . Banyak keluhan dari pelanggan berkaitan dengan prosedur pencatatan meter listrik berdasarkan berita yang dilansir website tribun news, menyebutkan bahwa banyak pelanggan yang merasa dirugikan oleh petugas pencatat meteran karena main tembak. Pembayaran tidak sesuai dengan kenyataan yang tertera di meteran, angka meteran di tagihan lebih besar daripada angka yang tertera di meteran yang sebenarnya. Hal ini disebabkan karena petugas pencatat meter listrik tidak berkeliling melakukan pengecekan pemakaian listrik pelanggan.Perlunya membangun sebuah aplikasi photo tagging untuk petugas pencatat meter listrik dengan menggunakan teknologi geotagging pada platform android. Teknologi geotagging adalah gabungan fitur kamera yang dapat melakukan sinergi langsung dengan fitur GPS guna memberikan informasi secara realtime dimana dan bagaimana kondisi sebuah objek. Dengan pembangunan aplikasi ini diharapkan menjadi solusi yang tepat untuk melakukan pengawasan kepada petugas pencatat meter listrik yang sedang melakukan pencatatan pemakaian listrik pelanggan. Berdasarkan hasil pengujian aplikasi yang dilakukan maka dapat disimpulkan bahwa sub sistem web dan sub sistem mobile dari perangkat lunak yang dibangun sudah berjalan sesuai dengan yang diharapkan baik itu dari segi pegujian blackbox maupun dari pengujian beta. Keyword : Geotagging, GPS, Android, Meter Listrik','bangun aplikasi photo tangging tugas pencatata meter listrik teknologi geotagging platform android keluh langgan kait prosedur catat meter listrik berita lansir website tribun news langgan rugi tugas catat ter main tembak bayar nyata tera ter angka ter tagih daripada angka tera ter sebab tugas catat meter listrik keliling ecek pemakaian listrik pelanggan perlu bangun aplikasi photo tagging tugas catat meter listrik teknologi geotagging platform android teknologi geotagging gabung fitur kamera sinergi fitur gps guna informasi realtime mana objek bangun aplikasi harap solusi tepat awas tugas catat meter listrik catat pemakaian listrik langgan uji aplikasi simpul sub sistem web sub sistem mobile angkat lunak bangun harap segi pegujian blackbox uji beta keyword geotagging gps android meter listrik'),(515,'C','Pembangunan Aplikasi E-Training Pada Stroke Mcdonald\'s Berbasis Multimedia Interaktif . Perekrutan crew (karyawan) baru di McDonaldÂ’s mempunyai 3 tahapan yang harus di lalui yaitu Interview, Training dan OnFloor. Hampir di seluruh McDonald’s Indonesia rata - rata crew baru yang mengalami kesulitan ditahapanke dua yaitu training, meskipun pada tahapan training diberikan Hands Out (modul) materi tentang prosedur pembuatan produk dan penggunaan equipment di McDonaldÂ’s, crew baru tersebut mengalami kesulitan untuk memahami modul, bentuk penyampaian materi dengan metode membaca Hands Out tidaklah cukup, kegiatan praktikum memegang peranan yang sangat penting, karena crew akan mendapatkan pemahaman dan pengalaman yang lebih baik terhadap materi yang diberikan. Pada kenyataannya, kegiatan praktikum tidak dapat dilakukan sesuai dengan yang direncanakan, karena antara materi yang di sampaikan dalam Hands Out dan praktek penggunaan equipment tidak mudah dipahami, yang berakibat terjadinya kesalahan dan merasa canggung dalam penggunaan equipment di McDonald\'s pada saat diterjunkan kelapangan langsung.E-training merupakan singkatan dari Electronic training adalah cara baru dalam proses pelatihan yang menggunakan media elektronik khususnya internet sebagai sistem pembelajarannya. E-Training sendiri adalah bagian e-learning berupa kumpulan training yang digunakan untuk membantu peserta / karyawan mencapai tujuan pembelajaran institusi sebagai syarat meningkatkan keterampilan dan kinerjanya, disampaikan melalui elektronis dengan kombinasi audio, animasi,dan instruksi berbasis multimedia interaktif. Metode pembangunan perangkat lunak yang digunakan adalah model waterfall, yakni sebuah pendekatan kepada perkembangan perangkat lunak yang sistematik dan sekuensial yang mulai pada tingkat kemajuan sistem. Berdasarkan hasil penelitian, E-Training pada Store McDonaldÂ’s dapat membantu crew dalam memahami tata cara penggunaan equipment, serta memberikan gambaran cara memasak produk dengan diberikannya simulasi pada setiap materi yang dipelajari dengan kombinasi audio, animasi, dan instruksi. Keyword : E-Training, Training, Hands Out, Store McDonalds, Multimedia','bangun aplikasi e stroke mcdonald s basis multimedia interaktif rekrut crew karyawan mcdonald  s tahap lalu interview training onfloor mcdonald s indonesia rata rata crew sulit ditahapanke training ski tahap training berik hands out modul materi prosedur buat produk equipment mcdonald  s crew sulit paham modul sampai materi metode baca hands out tidak praktikum pegang r crew pemahaman alam materi berik nyata praktikum rencana materi sampai hands out praktek equipment mudah paham akibat jadi salah canggung equipment mcdonald s terjun lapang langsung e singkat electronic training latih media elektronik khusus internet sistem pembelajaran e e upa kumpul training serta karyawan tuju pembelajaran institusi syarat terampil kinerja sampai elektronis kombinasi audio animasi dan instruksi basis multimedia interaktif metode bangun angkat lunak model waterfall dekat kembang angkat lunak sistematik sekuensial maju sistem penelitian e store mcdonald  s crew paham tata equipment gambar asak produk berik simulasi materi dipelajari kombinasi audio animasi instruksi keyword e training hands out store mcdonalds multimedia'),(516,'A','Pembangunan Sistem Informasi Customer Relationship Management Berbasis Web Di Little Wings Bookcafe Bandung . Little Wings BookCafe adalah sebuah cafe yang berkonsepkan perpustakaan yang berada di bilangan Cigadung Raya Barat, Kota Bandung bagian utara. Cafe ini menyediakan kebutuhan masyarakat khususnya anak muda akan literasi atau membaca. Di cafe ini terdapat banyak buku yang terdiri dari novel sampai buku textbook, cafe ini berada di bawah naungan perusahaan terbatas (PT) bernama PT Teras Nusantara. Saat penelitian ditemukan beberapa masalah seperti penjualan yang dilakukan oleh cafe tidak memiliki inovasi serta pemberian strategi penjualan seperti diskon, promo dan promosi lain yang tidak terarah dan mengakibatkan manajer berkeinginan mempertahankan pelanggan yang biasa mendatangi Cafe dan meningkatkan pembelian di tempat.dan tidak ditemukannya sistem yang memudahkan pelanggan menyampaikan keluhan, kritik dan saran lebih mudah tanpa harus datang ke cafe. Berdasarkan masalah yang telah diuraikan maka dibutuhkanlah Sistem Informasi Customer Relationship Management (CRM) di berbasis web agar memudahkan pelanggan dalam mengakses sistem. Adapun jenis CRM yang dibangun untuk sistem adalah Analitikal. Diharapkan pula dapat membantu memberikan solusi terhadap permasalahan yang dihadapi LittleWings BookCafe. Keyword : Manajemen Pelanggan, Penjualan, Kritik, Saran, Keluhan, Cafe.','bangun sistem informasi customer relationship management basis web little wings bookcafe bandung little wings bookcafe cafe konsep pustaka bilang cigadung raya kota bandung cafe sedia masyarakat khusus anak muda literasi baca cafe dapat buku diri novel buku textbook cafe naung usaha batas pt nama pt teras nusantara penelitian jual cafe inovasi beri strategi jual diskon promo promosi arah akibat manajer ingin tahan langgan datang cafe beli tempat dan temu sistem mudah langgan sampai keluh kritik saran mudah cafe urai butuh sistem informasi customer relationship management crm basis web mudah langgan akses sistem adapun crm bangun sistem analitikal harap solusi masalah hadap littlewings bookcafe keyword manajemen langgan jual kritik saran keluh cafe'),(517,'A','Sistem Monitoring Dan Evaluasai Kegiatan Diklat Di Pusat Pengembangan Pemberdayaan Pendidikan Dan Tenaga Kependudukan Ilmu Pengetahuan Alam Bandung . Pusat pengembangan pembardayaan pendidikan dan tenaga kependidikan ilmu pengetahuan alam (P4TK IPA) adalah sebuah institusi pemerintahan yang menaungi pelatihan bagi guru-guru IPA dari berbagai tingkatan, yang memiliki tujuan untuk mengembangkan sains melalui berbagai kegiatan pelatihan guru-guru ilmu pengetahuan alam di seluruh Indonesia, seperti dilakukannya pengkajian, penelitian, dan pengembangan bahan ajar, serta terus berusaha meningkatkan kualitas SDM bagi tenaga teknis dan tenaga fungsional. Permasalahan yang dihadapi adalah peserta kegiatan diklat memiliki permasalahan yang kerap terjadi pada proses diklat yaitu ketika proses pendaftaran, baik pendaftaran secara langsung maupun tidak langsung (undangan). Kemudian permasalahan widyaiswara selaku pemateri yaitu masalah dimana terdapat materi yang tidak relevan dijadikan bahan pelatihan, sehingga bahan ajar sulit dipahami oleh peserta. Serta keterbatasan kabid fasilitas dan peningkatan kompetensi dalam memonitoring kegiatan diklat. Metode pendekatan yang digunakan selama penelitian berlangsung adalah metode pendekatan berorientasi objek. Sistem ini dibangun dengan menggunakan PHP dan MySQL, dan menggunakan Sublime Text 3 dan MySQL Workbench sebagai alat bantu pembangunan sistem. Pembangunan Sistem monitoring dan evaluasi kegiatan diklat di P4TK IPA oni diharapkan dapat menunjang kebutuhan P4TK IPA dalam memonitoring dan evaluasi kegiatan diklat dengan lebih efektif dan efisien, dan menghasilkan output sesuai dengan yang diharapkan. Keyword : Penelitian, Monitoring, Evaluasi, Web','sistem monitoring evaluasai diklat pusat pengembangan daya didik tenaga duduk ilmu pengetahuan alam bandung pusat pengembangan pembardayaan didik tenaga didik ilmu pengetahuan alam p tk ipa institusi pemerintahan naung latih guru ipa tingkat tuju kembang sains latih guru ilmu pengetahuan alam indonesia laku kaji penelitian pengembangan bahan ajar usaha kualitas sdm tenaga teknis tenaga fungsional masalah hadap serta diklat masalah kerap diklat daftar daftar undang masalah widyaiswara sela materi mana dapat materi relevan jadi bahan latih bahan ajar sulit paham serta batas kabid fasilitas peningkatan kompetensi memonitoring diklat metode dekat penelitian metode dekat orientasi objek sistem bangun php mysql sublime text mysql workbench alat bantu bangun sistem bangun sistem monitoring evaluasi diklat p tk ipa oni harap tunjang p tk ipa memonitoring evaluasi diklat efektif efisien hasil output harap keyword penelitian monitoring evaluasi web'),(518,'A','Pembangunan Sistem Informasi Manajemen Keuangan Di Rumah Makan Sambel Hejo  Rumah makan Sambel Hejo merupakan salah satu bisnis di bidang kuliner. Rumah makan ini menawarkan menu khas sunda dengan rasa spesial yang menjadi produk unggulannya. Permasalahan-permasalahan yang sering terjadi di RM Sambel Hejo adalah kekurangan atau pun kelebihan bahan baku yang mengakibatkan Bagian Purchasing sering mengalami kesulitan dalam memonitoring persediaaan pengadaan bahan baku di RM Sambel Hejo, kurang seimbangnya antara pendapatan yang diperoleh dengan anggaran yang tersedia yang menyebabkan Bagian Keuangan kesulitan dalam memonitoring dana yang masuk dan dikeluarkan untuk anggaran belanja bahan baku. Berdasarkan permasalahan-permasalahan yang ada pada saat ini di RM Sambel Hejo, maka dibutuhkan suatu pembangunan sistem informasi manajemen keuangan. Tujuan pembangunan sistem informasi manajemen keuangan ini adalah untuk membantu Bagian Keuangan dalam memonitoring dana yang masuk dan dikeluarkan untuk anggaran belanja bahan baku dan memudahkan Bagian Purchasing untuk memonitoring persediaaan pengadaan bahan baku di RM Sambel Hejo. Dengan menerapkan Sistem Informasi Manajemen Keuangan pada Rumah Makan Sambel Hejo ini diharapkan akan menyelesaikan permasalahan yang ada melalui perencanaan, pelaksanaan, pemeriksaan dan evaluasi, sehingga tujuan untuk monitoring anggaran belanja bahan baku dan pengadaan persediaan bahan baku dan dapat dilaksanakan dengan baik. Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini sudah cukup membantu Bagian Keuangan dalam memonitoring anggaran belanja bahan baku dan pengadaan persediaan bahan baku.Keyword : SIM, Sistem Informasi Manajemen, Keuangan','bangun sistem informasi manajemen uang rumah makan sambel hejo rumah makan sambel hejo bisnis bidang kuliner rumah makan menawarkan menu khas sunda spesial produk unggul masalah rm sambel hejo kurang lebih bahan baku akibat purchasing sulit memonitoring persediaaan ada bahan baku rm sambel hejo kurang imbang dapat oleh anggar tersedia uang sulit memonitoring dana keluar anggar belanja bahan baku masalah rm sambel hejo butuh bangun sistem informasi manajemen uang tuju bangun sistem informasi manajemen uang uang memonitoring dana keluar anggar belanja bahan baku mudah purchasing memonitoring persediaaan ada bahan baku rm sambel hejo terap sistem informasi manajemen uang rumah makan sambel hejo harap selesai masalah rencana laksana pemeriksaan evaluasi tuju monitoring anggar belanja bahan baku ada sedia bahan baku laksana uji simpul sistem uang memonitoring anggar belanja bahan baku ada sedia bahan baku keyword sim sistem informasi manajemen uang'),(519,'D','Implementasi Teknologi LBS (Location Based Service) Dalam Membangun Aplikasi Pencarian Rute Terdekat Menggunakan Algoritma DIJKSTRA. Pencarian rute terpendek merupakan suatu masalah yang paling banyak dibahas dan dipelajari sejak akhir tahun 1950. Dalam kehidupan sehari-hari, pencarian jalur terpendek digunakan oleh pengendara kendaraan pribadi, pejalan kaki, pengguna angkutan umum dan perutean pada jaringan komputer. Untuk mencapai suatu tempat dengan waktu yang lebih cepat, pengguna akan mencari lintasan terpendek dari tempat asal ke tempat tujuan. Salah satu kendala dalam pencarian rute terdekat adalah perkiraan kondisi jalan yang macet atau tidak, dimana kondisi jalan macet atau tidak akan menjadi tolak ukur untuk mendapatkan waktu yang paling cepat agar sampai ke tempat tujuan. Oleh karena itu, solusi yang diusulkan adalah membangun suatu sistem yang dapat memberikan solusi bagi pengguna untuk memberikan informasi rute terdekat dalam transportasi, baik transportasi umum ataupun pribadi berdasarkan data yang ada seperti, rute jalan dan data kemacetan. Sistem pencarian rute terdekat menggunakan algoritma Dijkstra menjadi pilihan dalam penelitian ini untuk memberikan solusi, berdasarkan percobaan yang telah dilakukan dalam penelitian sebelumnya dinyatakan bahwa, untuk kasus yang jumlah node-nya kurang dari 1000, algoritma dijkstra mampu menghasilkan waktu eksekusi yang lebih cepat, yaitu kurang dari 1 detik. Setelah dilakukan pengujian dengan metode black box dan pengujian akurasi dapat disimpulkan bahwa sistem yang dibangun sudah sesuai dengan tujuan yang diharapkan dan dapat memberikan informasi rute terdekat serta memberikan informasi kondisi jalan berupa kondisi macet, macet parah dan lancar. Saran yang dapat diberikan adalah diharapkan aplikasi ini dapat lebih optimal dalam memberikan informasi kemacetan dan rute terdekat. Keyword : Pencarian rute terdekat, Dijkstra, Kemacetan','implementasi teknologi lbs location based service bangun aplikasi cari rute terdekat algoritma dijkstra cari rute terpendek bahas dipelajari hari cari jalur terpendek pengendara kendara pribadi pejal kaki guna angkut rute jaring komputer cepat guna lintas terpendek tuju kendala cari rute terdekat kira macet mana macet tolak ukur cepat tuju solusi usul bangun sistem solusi guna informasi rute terdekat transportasi transportasi atau pribadi data rute data macet sistem cari rute terdekat algoritma dijkstra pilih penelitian solusi coba penelitian nyata kasus node kurang algoritma dijkstra hasil eksekusi cepat kurang detik uji metode black box uji akurasi simpul sistem bangun tuju harap informasi rute terdekat informasi upa macet macet parah lancar saran berik harap aplikasi optimal informasi macet rute terdekat keyword cari rute terdekat dijkstra macet'),(520,'C','Pembangunan Aplikasi Pembelajaran Pengucapan Kata Pada Penderita Down Syndrome Menggunakan Teknologi Voice Recognition (studi Kasus Di Sekolah YPAC) . Metode pengajaran yang dilakukan untuk anak penderita down syndrome berbeda dengan anak-anak normal lainnya dibutuhkan suatu cara belajar yang berbeda dan menarik untuk merangsang daya ingatnya sehingga mereka tidak bosan. Sekolah khusus YPAC (Yayasan Pembinaan Anak Cacat) merupakan salah satu sekolah untuk menangani anak-anak yang berkebutuhan khusus, salah satunya adalah anak-anak down syndrome anak downsydrome membutuhkan suatu cara belajar yang berbeda dan menarik untuk merangsang daya ingatnya sehingga mereka tidak bosan. Solusi pembelajaran yang digunakan Voice Recognition, Voice Recognition merupakan teknologi yang digunakan untukmengidentifikasi suara. Teknologi Speech recognition merupakan proses yang dilakukan komputer untuk identifikasi suara yang diucapkan oleh seseorang tanpa memperdulikan identitasnya. Teknologi speech recognition ini memungkinkan suatu perangkat untuk mengenali dan memahami kata-kata yang diucapkan dengan cara digitalisasi kata dan mencocokan sinyal digital tersebut dengan suatu pola tertentu yang tersimpan dalam suatu perangkat.Berdasarkan hasil pengujian pengucapan kata yang dilakukan pada anak down syndrome dan hasil wawancara maka dapat diperoleh kesimpulan bahwa metode pembelajaran menggunakan teknologi voice recognition bahwa dapat membantu siswa dan guru dalam proses belajar. Keyword : Pembelajaran, Pengucapan Kata, Voice recognition, Down syndrome, Teknologi.','bangun aplikasi pembelajaran ucap derita down syndrome teknologi voice recognition studi kasus sekolah ypac metode ajar anak derita down syndrome beda anak normal butuh belajar beda tarik rangsang daya ingat bosan sekolah ypac yayasan bina anak cacat sekolah menangani anak butuh satu anak down syndrome anak downsydrome butuh belajar beda tarik rangsang daya ingat bosan solusi pembelajaran voice recognition voice recognition teknologi untukmengidentifikasi suara teknologi speech recognition komputer identifikasi suara ucap orang duli identitas teknologi speech recognition mungkin angkat kenal paham kata ucap digitalisasi cocok sinyal digital pola tertentu simpan perangkat berdasarkan uji ucap anak down syndrome wawancara oleh simpul metode pembelajaran teknologi voice recognition siswa guru belajar keyword pembelajaran ucap voice recognition down syndrome teknologi'),(521,'E','Perbandingan Perfomansi Metode Backpropagation Dan Radial Basis Function (RBF) Untuk Masalah Klasifikasi Peyakit Diabetes Mellitus. Jaringan syaraf tiruan merupakan salah satu metode yang dapat digunakan untuk melakukan klasifikasi suatu data. Metode jaringan syaraf tiruan yang sering digunakan untuk mengklasifikasikan penyakit diantaranya Backpropagation dan Radial Basis Function. Backpropagation menggunakan nilai error untuk mengubah bobot Â– bobotnya dalam dua arah yaitu arah mundur dan maju sehingga mendapat output yang baik. Radial Basis Function melakuan pembelajaran dengan dua tahap yaitu terawasi dan tidak terawasi. Penyakit diabetes merupakan penyakit yang umum yang di derita oleh masyarakat. Penyakit diabetes dibagi menjadi dua jenis yaitu diabetes mellitus insulin dan diabetes mellitus non insulin. Penanganan masing Â– masing jenis diabetes mellitus ini berbeda Â– beda, perlu adanya pemeriksaan sejak dini agar setiap pasien diabetes mellitus mendapat penanganan yang sesuai dengan jenis diabetes yang di derita. Berdasarkan hasil pengujian menggunakan metode k- fold cross validation dengan menggunakan data sebanyak 80 data. Berdasarkan hasil pengujian yang terlah dilakukan metode radial basis function memiliki nilai error yang lebih sedikit dibandingkan metode backpropagation dalam mengklasifikasikan penyakit diabetes mellitus. Error untuk metode radial basis function adalah 0,352 sedangkan nilai error untuk metode backpropagation adalah 0,4. Keyword : :Backpropagation , Radial Basis Function, k-fold cross validation','banding perfomansi metode backpropagation radial basis function rbf klasifikasi peyakit diabetes mellitus jaring syaraf tiru metode klasifikasi data metode jaring syaraf tiru klasifikasi sakit antara backpropagation radial basis function backpropagation nilai error ubah bobot bobot arah arah mundur maju output radial basis function laku pembelajaran tahap awas awas sakit diabetes sakit derita masyarakat sakit diabetes bagi diabetes mellitus insulin diabetes mellitus non insulin penanganan masing masing diabetes mellitus beda beda pemeriksaan dini pasien diabetes mellitus penanganan diabetes derita uji metode k fold cross validation data data uji ter metode radial basis function nilai error banding metode backpropagation klasifikasi sakit diabetes mellitus error metode radial basis function nilai error metode backpropagation keyword backpropagation radial basis function k cross validation'),(522,'A','Supply Chain Management Di PT Pupuk Kujang. PT Pupuk Kujang merupakan perusahaan Badan Usaha Milik Negara (BUMN) yang bergerak sebagai penghasil produksi pupuk dengan target pengiriman Provinsi Jawa Barat. PT Pupuk Kujang berdiri pada tanggal 9 Juni 1975 sebagai Badan Usaha Milik Negara (BUMN) PT Pupuk Kujang dituntut pemerintah untuk memenuhi kebutuhan permintaan pasokan pupuk bersubsidi bagi para petani demi suksesnya tujuan pemerintah untuk mensejahterakan sektor swasembada pangan. Dalam pelaksanaannya PT Pupuk Kujang masih kesulitan dalam menentukan jumlah bahan baku yang harus dibeli oleh pengadaan kepada supplier, bagian perencanaan pengendalian material (ppm) mengalami kesulitan karena adanya ketidakpastian pemesanan yang dilakukan produksi dalam pemakaian bahan baku. Juga departemen penjualan pso dalam pendistribusiannya dipengaruhi jumlah pupuk yang ditargetkan bulanan, jarak tempuh dari PT Pupuk Kujang ke gudang lini 3 cabang kabupaten dan jumlah kendaraan yang dipakai dalam pengiriman masih dirasa kurang efektif.Supply Chain Management di PT Pupuk Kujang merupakan suatu cara pengintegrasian sumber-sumber bisnis yang kompeten baik didalam maupun diluar perusahaan mendapatkan supply system yang kompetitif dan berfokus kepada singkronisasi aliran produk dan informasi untuk menciptakan nilai pelanggan (customer value) nilai tinggi. Sumber-sumber bisnis yang diintegrasikan meliputi pemasok (supplier), pabrikan, gudang, pengangkut, distributor, retailer dan konsumen yang bekerja secara efisien sehingga produk yang dihasilkan dan didistribusikan memenuhi tepat jumlah, kualitas, waktu dan lokasi. Berdasarkan hasil dari pengujian blackbox maupun beta yang telah dilakukan pada tahap implementasi dan pengujian dapat diambil kesimpulan bahwa sistem informasi supply chain management ini dapat membantu Bagian Perencanaan Pengendalian Material (PPM) agar mampu menentukan pembelian bahan baku yang harus dibeli oleh bagian pengadaan agar kegiatan produksi terus berlanjut dan mempermudah Bagian Penjualan PSO dalam menentukan pendistribusian produk pupuk ke gudang stok lini 3 sesuai dengan target pemesanan yang ditentukan oleh permentan. Keyword : upply Chain Management, SCM, PT Pupuk Kujang','supply chain management pt pupuk kujang pt pupuk kujang usaha usaha negara bumn gerak hasil produksi pupuk target pengiriman provinsi jawa pt pupuk kujang diri usaha negara bumn pt pupuk kujang tuntut pemerintah penuh minta pasok pupuk subsidi tan demi sukses tuju pemerintah sejahtera sektor swasembada pangan laksana pt pupuk kujang sulit tentu bahan baku beli ada supplier rencana pengendalian material ppm sulit ketidakpastian mesan produksi pemakaian bahan baku departemen jual pso distribusi pengaruh pupuk target bulan jarak tempuh pt pupuk kujang gudang lini cabang kabupaten kendara pakai pengiriman rasa kurang efektif supply chain management pt pupuk kujang integrasi sumber bisnis kompeten dalam luar usaha supply system kompetitif fokus singkronisasi alir produk informasi cipta nilai langgan customer value nilai sumber bisnis integrasi liput pemasok supplier pabrikan gudang angkut distributor retailer konsumen kerja efisien produk hasil distribusi penuh tepat kualitas lokasi uji blackbox beta tahap implementasi uji ambil simpul sistem informasi supply chain management rencana pengendalian material ppm tentu beli bahan baku beli ada produksi lanjut mudah jual pso tentu distribusi produk pupuk gudang stok lini target mesan tentu permentan keyword upply chain management scm pt pupuk kujang'),(523,'A','pembangunan Sistem Informasi Customer Relationship Management (CRM) Di PT. INDOTO MULIA. PT. Indoto Tirta Mulia merupakan salah satu perusahaan yang bergerak di bidang industri pengolahan sendal maupun sepatu wanita di Jawa Barat. Sebagai aset perusahaan, pelanggan merupakan salah satu aset yang berharga bagi setiap perusahaan sehingga kualitas layanan maupun produk dari perusahaan terus ditingkatkan dari waktu ke waktu untuk mempertahankan pelanggan dari perusahaan. Dilihat dari kondisi saat ini, adapun kendala dari PT. Indoto Tirta Mulia adalah kurangnya manajemen pelanggan dan pemasaran dalam perusahaan untuk mengurangi terjadinya perpindahan pelanggan ke perusahaan kompetitor yang bergerak dibidang industri sendal maupun sepatu wanita. Penelitian ini memberikan solusi dengan menerapkan konsep Customer Relationship Management (CRM) untuk menunjang kegiatan bisnis PT. Indoto Tirta Mulia dengan menggunakan Analisis Recency, Frequency, Monetary (RFM) yang dapat melakukan perhitungan segmentasi pelanggan berdasarkan transaksi pelanggan.Hasil dari penelitian ini adalah sebuah sebuah Sistem Informasi CRM yang berguna untuk membantu Direktur dalam mengevaluasi proses bisnis perusahaan, Wakil Direktur dalam mengolah data pelanggan yang mengambil hasil dari analisis RFM dan memudahkan pelanggan dalam memperoleh informasi. Dengan diterapkan sistem ini diharapkan dapat mempertahankan dan meningkatkan loyalitas dari setiap pelanggan PT. Indoto Tirta Mulia. Keyword : PT. Indoto Tirta Mulia, Sistem Informasi, Customer Relationship Management (CRM), Analisis Recency, Frequency, Monetary (RFM).','bangun sistem informasi customer relationship management crm pt indoto mulia pt indoto tirta mulia usaha gerak bidang industri olah sendal sepatu wanita jawa aset usaha langgan aset harga usaha kualitas layan produk usaha tingkat tahan langgan usaha lihat adapun kendala pt indoto tirta mulia kurang manajemen langgan pemasaran usaha urang jadi pindah langgan usaha kompetitor gerak bidang industri sendal sepatu wanita penelitian solusi terap konsep customer relationship management crm tunjang bisnis pt indoto tirta mulia analisis recency frequency monetary rfm hitung segmentasi langgan transaksi pelanggan hasil penelitian sistem informasi crm guna direktur evaluasi bisnis usaha wakil direktur o data langgan analisis rfm mudah langgan oleh informasi terap sistem harap tahan loyalitas langgan pt indoto tirta mulia keyword pt indoto tirta mulia sistem informasi customer relationship management crm analisis recency frequency monetary rfm'),(524,'E','Klasifikasi Emosi Pada Tekas Bahasa Indonesia Menggunakan Metode K-Nearest Neighbor Dengan Pembobotan Widf . Emosi merupakan sebuah ekspresi dari suatu keadaaan yang berkaitan dengan perasaan seseorang yang dipengaruhi berbagai faktor baik internal maupun eksternal. Dalam mengekpresikan sebuah emosi seseorang biasanya menggunakan berbagai cara salah satunya dalam sebuah tulisan. Sebuah tulisan yang mengandung emosi sangat sulit untuk ditafsirkan oleh pembaca karena dipengaruhi oleh sudut pandang yang berbeda antara penulis dan pembaca. Maka dari itu untuk memudahkan pembaca mengetahui emosi dari sebuah tulisan bisa menggunakan cara klasifikasi. Pada penelitian ini metode yang digunakan dalam mengklasifikasikan emosi pada teks yaitu K-Nearest Neighbor, pemilihan metode ini didasarkan pada penelitian yang dilakukan yang menjelaskan bahwa metode ini memiliki kinerja yang baik dengan hasil akurasi sampai 86%. Pada penelitian sebelumnya yang telah dilakukan dengan tahapan proses dari mulai preprocessing, pembobotan TF.IDF dan pengklasifikasian hasil akurasi yang didapat masih kurang sekitar 60%, hal ini dipengaruhi oleh beberapa kelemahan salah satunya dalam metode pembobotan yang digunakan. Oleh karena itu dalam penelitian ini metode pembobotan yang akan digunakan adalah WIDF yang memiliki kinerja yang baik dan pengembangan dari TF.IDF. Berdasarkan hasil pengujian dari penelitian ini yang mengimplementasikan lirik lagu bahasa Indonesia dalam mengklasifikasikan emosi dengan metode K-Nearest Neighbor dan pembobotan WIDF ke dalam lima kategori yaitu senang, takut, marah, sedih dan bersalah, menghasilkan akurasi sebesar 73.3% pada nilai K = 5. Untuk nilai relevansi dari setiap kategori emosi dengan menggunakan precision dan recall menghasilkan nilai rata-rata terbaik pada kategori Â“TakutÂ” untuk precision, dan kategori Â“MarahÂ” untuk recall. Keyword : Emosi, Klasifikasi, K-Nearest Neighbor, Pembobotan WIDF','klasifikasi emosi tekas bahasa indonesia metode k neighbor bobot widf emosi ekspresi keadaaan kait rasa orang pengaruh faktor internal eksternal mengekpresikan emosi orang satu tulis tulis kandung emosi sulit tafsir baca pengaruh sudut pandang beda penulis baca mudah baca emosi tulis klasifikasi penelitian metode klasifikasi emosi teks k neighbor pemilihan metode dasar penelitian metode kinerja akurasi penelitian tahap preprocessing bobot tf idf klasifikasi akurasi dapat kurang pengaruh lemah satu metode bobot penelitian metode bobot widf kinerja pengembangan tf idf uji penelitian implementasi lirik lagu bahasa indonesia klasifikasi emosi metode k neighbor bobot widf kategori senang takut marah sedih sa hasil akurasi nilai nilai relevansi kategori emosi precision recall hasil nilai rata baik kategori takut precision kategori marah recall keyword emosi klasifikasi k neighbor bobot widf'),(525,'D','Pembangunan Aplikasi Mobile Reservasi Paket Tour Dan Travel Menggunakan web Service Berbasis Android (Studi Kasus Jacktour). Jacktour merupakan sebuah perusahaan di Bandung yang bergerak di bidang jasa Tour dan Travel. Dalam melakukan kegiatan pelayanannya saat ini, Jacktour hanya menerima reservasi melalui web, e-mail, whatsapp dan telepon. Dengan begitu dibutuhkanlah aplikasi berbasis mobile untuk memudahkan customer melakukan reservasi secara fleksibel dan real time darimana saja. Metode yang digunakan dalam pembuatan Aplikasi Mobile Reservasi Paket Tour ini adalah metode pengumpulan data. Metode wawancara, observasi dan studi pustaka. Sedangkan metode pembangunan perangkat lunak ini yaitu menggunakan Waterfall. Dan perangkat lunak yang digunakan untuk membuat program aplikasi ini diantaranya Java Development Kit (JDK) 8 dan Java Runtime Environment (JRE), Integrated Development Environment (IDE) Android Studio 1.3, serta Android Software Development Kit (Android SDK). Hasil yang ingin dicapai adalah Aplikasi Mobile Reservasi Paket Tour yang dapat memudahkan customer untuk mendapatkan informasi paket tour, melakukan reservasi dan konfirmasi pembayaran pada Jacktour. Keyword : Tour, Travel, Reservasi, Web service, Android','bangun aplikasi mobile reservasi paket tour travel web service basis android studi kasus jacktour jacktour usaha bandung gerak bidang jasa tour travel layan jacktour reservasi web e whatsapp telepon butuh aplikasi basis mobile mudah customer reservasi fleksibel real time darimana metode buat aplikasi mobile reservasi paket tour metode pengumpulan data metode wawancara observasi studi pustaka metode bangun angkat lunak waterfall angkat lunak aplikasi antara java development kit jdk java runtime environment jre integrated development environment ide android studio android software development kit android sdk capai aplikasi mobile reservasi paket tour mudah customer informasi paket tour reservasi konfirmasi bayar jacktour keyword tour travel reservasi web service android'),(526,'A','Sistem Informasi Manajemen Proyek Konstruksi Pada Perusahaan Jasa Konstruksi (Studi Kasus PT. Lingga Persada). PT. Lingga Persada merupakan salah satu General Contractor, Interior dan Supplier di Indonesia yang khususnya bergerak dibidang jasa konstruksi dan sub bidang bangunan. Pada pelaksanaanya kontaktor sering mengalami proyek keterlambatan proyek. Keterlambatan tersebut disebabkan oleh beberapa hal yang terjadinya pada pelaksanaan proyek, antara lain terabaikannya resiko-resiko oleh project manager yang kemungkinan berdampak negatif pada pelaksanaan proyek. Penjadwalan yang dilakukan oleh site manager masih tradisional dan kurang optimal karena tidak menunjukan secara spesifik hubungan ketergantungan antar pekerjaan. Kurangnya pengawasan oleh project manager terhadap penyimpangan karena evaluasi kemajuan proyek hanya dilakukan satu bulan sekali, sehingga menyebabkan project manager mengalami kesulitan untuk melakukan tindakan pengendalian agar proyek tetap sesuai rencana. Melihat permasalahan tersebut, maka dibutuhkan sebuah Sistem Informasi Manajemen (SIM) berbasis web, untuk mempermudah proses manajemen di PT. Lingga Persada dalam perencanaan, pelaksanaan dan pengendalian proyek kontruksi dengan melakukan analisis resiko menggunakan metode Analisis Kualitatif, membuat jadwal yang optimal menggunakan Critical Path Method (CPM), membuat evaluasi yang terpadu menggunakan Earned Value Method (EVM) dan mempersiapkan tindakan pengendalian resiko menggunakan Time Cost Trade Off (TCTO). Berdasarkan hasil wawancara dan pengujian, sistem yang dibuat sudah cukup membantu project manager dalam mengindentifikasi resiko negatif proyek untuk memepersiapkan tindakan penanganannya, mempermudah evaluasi proyek serta membantu dalam memberikan alternatif tindakan pengendalian proyek. Membantu site manager membuat jadwal yang optimal dengan mencari pekerjaan kritis proyek. Keyword : Kontraktor, SIM, Proyek, Resiko, Jadwal, Evaluasi, Web','sistem informasi manajemen proyek konstruksi usaha jasa konstruksi studi kasus pt lingga persada pt lingga persada general contractor interior supplier indonesia khusus gerak bidang jasa konstruksi sub bidang bangun pelaksanaa kontaktor proyek lambat proyek lambat sebab jadi laksana proyek abai resiko project manager dampak negatif laksana proyek jadwal site manager tradisional kurang optimal tunjuk spesifik gantung antar kerja kurang awas project manager simpang evaluasi maju proyek project manager sulit tindak pengendalian proyek tetap rencana masalah butuh sistem informasi manajemen sim basis web mudah manajemen pt lingga persada rencana laksana pengendalian proyek kontruksi analisis resiko metode analisis kualitatif jadwal optimal critical path method cpm evaluasi padu earned value method evm siap tindak pengendalian resiko time cost trade off tcto wawancara uji sistem buat project manager mengindentifikasi resiko negatif proyek siap tindak penanganan mudah evaluasi proyek alternatif tindak pengendalian proyek site manager jadwal optimal kerja kritis proyek keyword kontraktor sim proyek resiko jadwal evaluasi web'),(527,'E','Implementasi K-Means Clustering Dan Learning Vector Quantization Untuk Optimasi Pengenalan Suara . Speaker verification adalah proses pengenalan suara untuk memverifikasi seorang pembicara, dalam penelitian ini metode yang digunakan untuk proses ekstraksi ciri suara pada speaker verification adalah metode Mel Frequency Cepstrum Coefficients (MFCC). Hasil keluaran pada MFCC yang tersebar tidak merata mempengaruhi banyaknya informasi yang diperoleh untuk mendapatkan karakter suara seseorang, dibutuhkan clustering untuk mengelompokan data hasil keluaran MFCC berdasarkan kemiripan dari hasil keluaran MFCC tersebut, salah satunya dengan menggunakan k-means clustering K-means Clustering dapat mengelompokan data hasil filter MFCC berdasarkan kemiripannya. K-Means Clustering memetakan vektor-vektor yang berada pada lingkup wilayah yang luas besar menjadi sejumlah tertentu (k) vektor. Vektor hasil clustering diperlukan untuk proses klasifikasi menggunakan Learning Vector Quantization (LVQ). LVQ melakukan pembelajaran atau pelatihan pada lapisan kompetitif yang terawasi. Hasil pembelajaran LVQ digunakan sebagai basis pengetahuan yang dibutuhkan untuk proses pencocokan suara menggunakan pengukuran jarak euclidean distance.Berdasarkan hasil pengujian menggunakan metode 10-fold cross validation dengan menggunakan data sebanyak 160 data. Diperoleh hasil bahwa penerapan k-means clustering dan LVQ dapat diterapkan untuk pengenalan suara. Hasil pengujian mendapatkan tingkat persentase rata-rata akurasi sebesar 79,375% dengan menggunakan nilai k pada k-means clustering (k=6) dan nilai parameter pada pembelajaran LVQ menggunakan learning rate(?=0,001), penurunan learning rate(dec ?=0,1) dan maksimum epoh=100. Keyword : speaker verification, suara, MFCC, k-means clustering, learning vector quantization, euclidean distance, k-fold cross validation','implementasi k clustering learning vector quantization optimasi pengenalan suara speaker verification pengenalan suara verifikasi bicara penelitian metode ekstraksi ciri suara speaker verification metode mel frequency cepstrum coefficients mfcc luar mfcc tersebar rata pengaruh banyak informasi oleh karakter suara orang butuh clustering kelompok data luar mfcc mirip luar mfcc satu k clustering k clustering kelompok data filter mfcc mirip k clustering eta vektor lingkup wilayah luas tertentu vektor vektor clustering perlu klasifikasi learning vector quantization lvq lvq pembelajaran latih lapis kompetitif awas pembelajaran lvq basis pengetahuan butuh cocok suara ukur jarak euclidean distance berdasarkan uji metode  cross validation data data oleh penerapan k clustering lvq terap pengenalan suara uji persentase rata akurasi nilai k clustering k= nilai parameter pembelajaran lvq learning rate  = penurunan learning rate dec maksimum epoh= keyword speaker verification suara mfcc k clustering learning vector quantization euclidean distance k cross validation'),(528,'C','Pembangunan Web Visual Map Tracking Pada Jasa Angkutan Barang Di PT. 4848 Irawan Sarpingi . PT.4848 Irawan Sarpingi merupakan sebuah perusahaan yang berorientasi pada usaha menjual jasa kepada masyarakat umum. Pelayanan jasa yang ditawarkan adalah angkutan penumpang dalam dan luar kota serta pengantaran paket atau barang antar kota. permasalahan yang ada pada pengiriman barang atau paket adalah minimnya informasi yang didapat oleh pihak pengirim dan penerima paket yang membuat kurangnya kepercayaan, maka untuk menambah kepercayaan pelanggan salah satunya dengan melakukan terobosan baru yaitu dengan cara memberikan informasi keberadaan paket atau barang secara realtime yang akan ditampilkan di web visual map tracking.Dalam membangun aplikasi dilakukan dengan cara kegiatan observasi ke lokasi penelitian, merumuskan masalah, maksud dan tujuan, melakukan pengumpulan data berupa wawancara studi litelatur yang berhubungan dengan pembangunan visual map tracking pada jasa layanan angkutan barang, analisis sistem dilakukan dengan cara menganalisis sistem yang sedang berjalan, analisis aturan bisnis, analisis masalah, analisis jaringan, analisis kebutuhan sistem yang akan dibangun, perancangan sistem yang dibangun, implementasi, pengujian yang dilakukan pengujian black box, wawancara ke Staff Manager HRD dan kuisioner dan penarikan kesimpulan. Aplikasi yang dibuat terdiri dari web pelanggan untuk menampilkan informasi keberadaan paket, web oprasional untuk mengelola data pengiriman dan penerimaan paket, aplikasi android sebagai alat pelacak keberadaan kurir dan sebagai alat input informasi data penerimaan paket. Sistem yang dibangun mampu berjalan dengan baik setelah melakukan pengujian black box dan aplikasi yang dibangun mampu menampilkan informasi untuk keperluan pelanggan, aplikasi yang dibangun mampu menampilkan lokasi keberadaan paket atau barang dan kurir secara realtime. Keyword : Web Visual Map Tracking, Tracking Barang, Android, Web.','bangun web visual map tracking jasa angkut pt irawan sarpingi pt irawan sarpingi usaha orientasi usaha jual jasa masyarakat layan jasa ditawarkan angkut penumpang kota antar paket antar kota masalah pengiriman paket minim informasi dapat pengirim penerima paket kurang percaya tambah percaya langgan satu terobos informasi rada paket realtime tampil web visual map tracking dalam bangun aplikasi observasi lokasi penelitian rumus maksud tuju pengumpulan data upa wawancara studi litelatur hubung bangun visual map tracking jasa layan angkut analisis sistem analisis sistem analisis atur bisnis analisis analisis jaring analisis sistem bangun rancang sistem bangun implementasi uji uji black box wawancara staff manager hrd kuisioner penarikan simpul aplikasi buat diri web langgan tampil informasi rada paket web oprasional kelola data pengiriman penerimaan paket aplikasi android alat lacak rada kurir alat input informasi data penerimaan paket sistem bangun uji black box aplikasi bangun tampil informasi perlu langgan aplikasi bangun tampil lokasi rada paket kurir realtime keyword web visual map tracking tracking android web'),(529,'B','Pembangunan Data Warehouse Pada PT. Perkebunan Nusantara (PTPN) VIII Kebun Ciater . PT. Perkebunan Nusantara (PTPN) VIII Kebun Ciater merupakan salah satu cabang perusahaan PT. Perkebunan Nusantara VIII yang berkantor pusat di Bandung dan merupakan bagian dari Manajer Grup Teh I yang berkantor pusat di Sukabumi. Kebun Ciater salah satu Perkebunan yang menghasilkan teh berkwalitas tinggi, hasil jadi teh dijual hampir 90% ke luar negeri diantaranya ke negara-negara Eropa dan 10% dijual ke perusahaan lokal dan sudah mendapatkan predikat pengolahan teh terbaik di Indonesia. Data warehouse menjadikan data perusahaan yang tersebar menjadi terintegrasi sehingga membantu pihak perusahaan dalam menganalisis data yang ada untuk pengambilan keputusan yang bersifat strategis secara cepat dan tepat. Pembangunan data warehouse ini menggunakan pemodelan skema Fact constellations dan perancangan OLAP (On-Line Analytical Processing) untuk pengolahan dan analisis datanya dengan menggunakan teknik Roll-Up dan Drill-Down. Setelah melakukan pengujian hasill penelitian ini diharapkan dapat membantu pihak perusahaan dalam menganalisis data dalam jumlah besar sehingga memudahkan dalam mengambil sebuah keputusan strategi bisnis untuk mengetahui kebutuhan perusahaan. Keyword : Data warehouse, Fact Constellations, OLAP','bangun data warehouse pt kebun nusantara ptpn viii kebun ciater pt kebun nusantara ptpn viii kebun ciater cabang usaha pt kebun nusantara viii kantor pusat bandung manajer grup teh kantor pusat sukabumi kebun ciater kebun hasil teh berkwalitas teh jual neger antara negara eropa jual usaha lokal predikat olah teh baik indonesia data warehouse jadi data usaha tersebar integrasi usaha analisis data ambil sifat strategis cepat tepat bangun data warehouse model skema fact constellations rancang olap on analytical processing olah analisis data teknik roll drill uji hasill penelitian harap usaha analisis data mudah strategi bisnis usaha keyword data warehouse fact constellations olap'),(530,'C','Pembangunan Simulasi Pembelajaran Interaktif Manajemen Asfiksia Bayi Baru Lahir (Studi Kasus: Poltekes TNI AU Ciumbuleuit). POLTEKES TNI AU Ciumbuleuit merupakan salah satu institusi pendidikan yang menghasilkan tenaga kesehatan termasuk bidan yang didirikan untuk memenuhi harapan masyarakat akan pelayanan tenaga kesehatan yang berkualitas. Manajemen Asfiksia Bayi Baru Lahir merupakan salah satu materi kuliah yang berada di POLTEKES TNI AU Ciumbuleuit. Berdasarkan hasil wawancara dengan Ibu Marjani Khairunnisa.SST.,M.Keb selaku Kaprodi kebidanan mengatakan bahwa pada praktikum resusitasi bayi baru lahir dibutuhkan sarana dan prasarana yang memadai. Begitu pula dengan hasil kuesioner penelitian awal terhadap mahasiswa POLTEKES TNI AU Ciumbuleuit dapat disimpulkan bahwa materi pembelajaran yang disampaikan kurang menarik dan kekurangan alat peraga, menyebabkan banyak mahasiswa yang mengalami kesulitan dalam memahami mata kuliah manajemen asfiksia bayi baru lahir.Aplikasi Simulasi Pembelajaran Interaktif Manajemen Asfiksia Bayi Baru Lahir merupakan salah satu media pembelajaran yang berbasis desktop untuk membantu kekurangan dari alat peraga dan membantu mahasiswa dalam memahami materi yang disampaikan pengajar dengan memberikan media alat bantu pembelajaran, Metode pembangunan aplikasi multimedia interaktif pembelajaran yang dipakai adalah menurut luther sutopo dimana tahapannya adalah konsep, desain, pengumpulan materi, perancangan dan pengujian. Pada aplikasi ini terdapat empat menu utama yaitu menu materi manajemen asfiksia bayi baru lahir, menu simulasi, menu evaluasi serta menu video. Pengujian aplikasi dilakukan dengan menggunakan metode Black box, kuesioner dan wawancara. Berdasarkan hasil yang didapat dari penelitian yang dilakukan maka dapat diperoleh kesimpulan bahwa aplikasi ini sudah dapat membantu mahasiswi dalam memahami pembelajaran manajemen asfiksia bayi baru lahir dengan memberikan media alat bantu pembelajaran yang lebih menarik serta interaktif dan membantu dari kekurangan alat peraga saat praktikum resusitasi serta membantu mahasiswi memenuhi kompetensi dari mata kuliah manajemen asfiksia bayi baru lahir yang dinilai berdasarkan hasil ujian praktikum. Keyword : Asfiksia, Simulasi, Interaktif, Pembelajaran, Resusitasi','bangun simulasi pembelajaran interaktif manajemen asfiksia bayi lahir studi kasus poltekes tni au ciumbuleuit poltekes tni au ciumbuleuit institusi didik hasil tenaga sehat bidan diri penuh harap masyarakat layan tenaga sehat kualitas manajemen asfiksia bayi lahir materi kuliah poltekes tni au ciumbuleuit wawancara ibu marjani khairunnisa sst  m keb sela kaprodi bidan praktikum resusitasi bayi lahir butuh sarana prasarana memadai kuesioner penelitian mahasiswa poltekes tni au ciumbuleuit simpul materi pembelajaran sampai kurang tarik kurang alat raga mahasiswa sulit paham mata kuliah manajemen asfiksia bayi lahir aplikasi simulasi pembelajaran interaktif manajemen asfiksia bayi lahir media pembelajaran basis desktop kurang alat raga mahasiswa paham materi sampai ajar media alat bantu pembelajaran metode bangun aplikasi multimedia interaktif pembelajaran pakai luther sutopo mana tahap konsep desain pengumpulan materi rancang uji aplikasi dapat menu menu materi manajemen asfiksia bayi lahir menu simulasi menu evaluasi menu video uji aplikasi metode black box kuesioner wawancara dapat penelitian oleh simpul aplikasi mahasiswi paham pembelajaran manajemen asfiksia bayi lahir media alat bantu pembelajaran tarik interaktif kurang alat raga praktikum resusitasi mahasiswi penuh kompetensi mata kuliah manajemen asfiksia bayi lahir nilai uji praktikum keyword asfiksia simulasi interaktif pembelajaran resusitasi'),(531,'C','Aplikasi Sistem Parkir kendaraan Bermotor Dan Makan Siang Dengan Menggunakan RFID Di PT. Surya Toto Indonesia TBK. PT Surya Toto Indonesia Tbk merupakan salah satu produsen perlengkapan saniter terbesar di Asia Tenggara. Perusahaan ini memproduksi bermacam-macam perlengkapan saniter dan plumbing fitting untuk pasar dalam dan luar negeri. PT Surya Toto Indonesia Tbk memiliki karyawan sebanyak kurang lebih 2800, sehingga pihak perusahaan mengalami kesulitan dalam mengatur biaya operasional dan pelaporan data sehari-hari, khususnya pada sistem perparkiran dan sistem makan siang karyawan karena selama ini masih menggunakan cara manual menggunakan stiker dan kupon. Maka dari itu dibuatkan sistem yang dapat mengatasi masalah dengan menggunakan teknologi RFID (Radio Frequency Identifacation) terintegrasi, sehingga pendataan parkir dan makan siang karyawan dapat dengan mudah dipantau oleh pimpinan dan dapat mengurangi resiko kecurangan serta jauh lebih aman dari sistem sebelumnya.Keyword : Saniter, Plumbing Fitting, Parkir, Makan Siang, RFID.','aplikasi sistem parkir kendara motor makan siang rfid pt surya toto indonesia tbk pt surya toto indonesia tbk produsen lengkap saniter terbesar asia tenggara usaha produksi macam lengkap saniter plumbing fitting pasar neger pt surya toto indonesia tbk karyawan kurang usaha sulit atur biaya operasional lapor data hari khusus sistem parkir sistem makan siang karyawan manual stiker kupon buat sistem atas teknologi rfid radio frequency identifacation integrasi data parkir makan siang karyawan mudah pantau pimpin urang resiko curang aman sistem sebelumnya keyword saniter plumbing fitting parkir makan siang rfid'),(532,'C','Pengembangan Aplikasi Pembelajaran Biologi Untuk Kelas IX SMP Al-Falah Dago Menggunakan Metode Computer Based Instruction Dan Computerv Asissed Instruction Berbasis Desktop. Media pembelajaran adalah alat, metode dan teknik yang digunakan dalam rangka lebih mengefektifkan komunikasi dan interaksi antara guru dan siswa dalam proses pendidikan dan pengajaran di sekolah. Association for Education and Communication Technology (AET) mendefinisikan media yaitu segala bentuk yang dipergunakan untuk suatu proses penyaluran informasi. Sedangkan Education Association (NEA) mendefinisikan sebagai benda yand dapat dimanipulasi, dilihat, didengar, dibaca atau dibicarakan beserta instrument yang dipergunakan dengan baik dalam kegiatan belajar mengajar, dapat mempengaruhi efektifitas program instruksional. Madia pembelajaran berbantuan komputer mempunyai peran penting dalam proses belajar mengajar. Salah satu salah satu pembelajaran berbantuan komputer adalah Computer Assisted Instruction (CAI). Computer Assisted Instruction merupakan pengembangan daripada teknologi informasi terpadu yaitu komunikasi (interaktif), audio, video, penampilan citra (image) yang dikemas dengan sebutan teknologi multimedia. Masalah yang ada adalah kurangnya buku paket saat ini yang tidak berimbang dengan jumlah siswa dan juga kurangnya pemahaman siswa dalam memahami materi biologi serta siswa kesulitan dalam melakukan letihan-latihan soal. Untuk itu dibutuhkan solusi solusi yang tepat dalam penyelesaian permasalahan tersebut. Dengan dibangunnya aplikasi pembelajaran biologi ini dapat membantu menyelesaikan masalah yang terdapat di SMP AL-falah Dago yang memberi mafaat kepada siswa lebih mudah memehami materi biologi. eyword : Media pembelajaran , Interaktif, Computer Assisted Instructions (CAI).','pengembangan aplikasi pembelajaran biologi kelas ix smp al dago metode computer based instruction computerv asissed instruction basis desktop media pembelajaran alat metode teknik rangka efektif komunikasi interaksi guru siswa didik ajar sekolah association for education and communication technology aet definisi media segala guna salur informasi education association nea definisi benda yand manipulasi lihat dengar baca bicara beserta instrument guna belajar ajar pengaruh efektifitas instruksional madia pembelajaran bantu komputer peran belajar ajar pembelajaran bantu komputer computer assisted instruction ca computer assisted instruction pengembangan daripada teknologi informasi padu komunikasi interaktif audio video penampilan citra image kemas sebut teknologi multimedia kurang buku paket imbang siswa kurang pemahaman siswa paham materi biologi siswa sulit letih soal butuh solusi solusi tepat selesai masalah bangun aplikasi pembelajaran biologi selesai dapat smp al dago mafaat siswa mudah ham materi biologi eyword media pembelajaran interaktif computer assisted instructions ca'),(533,'D','Pembangunan Mobile Application Store Alisha Fancy Shop Memanfaatkan Sistem Push Notification Dan Location Based Service (LBS) Berbasis Android . CV. Alisha Kreasi Cemerlang atau yang dikenal dengan Alisha Fancy Shop merupakan toko yang menyediakan kerudung dan pashmina serta perlengkapan busana muslim terlengkap dengan harga terjangkau. Merupakan salah satu tujuan wisata belanja di kota Bandung Diterapkannya Location Based Service (LBS) dan Push Notification pada apliaksi mobile store Alisha Fancy Shop adalah untuk menghindari kesulitan pelanggan dalam mendapatkan informasi mengenai promosi produk baru, diskon, dan event-event yang diadakan, dan pencarian lokasi toko-toko yang terutama bagi pelanggan yang luar kota yang sedang berkunjung ke kota Bandung. Didasari hal tersebut maka dilakukan penelitian untuk mengimplementasikan push notification dan location based service pada sistem operasi Android untuk aplikasi mobile store Alisha Fancy Shop. Pada penelitian ini aplikasi akan dibuat menggunakan bahasa Java dan menggunakan Android Studio. Pemodelan sistem menggunakan pemodelan berorientasi objek dengan UML (Unified Modeling Language). Hasil implementasi, pengujian alpha dan beta pada penelitian ini menunjukan bahwa Push Notification dan Location Based Service dapat membantu pelanggan dalam mendapatkan informasi mengenai informasi produk baru, adanya diskon, event yang diadakan dan informasi mengenai lokasi toko Alisha terdekat dari pelanggan berada. Keyword : mobile store Alisha Fancy Shop, Push Notification, Location Based Service','bangun mobile application store alisha fancy shop manfaat sistem push notification location based service lbs basis android cv alisha kreasi cemerlang kenal alisha fancy shop toko sedia kerudung pashmina lengkap busana muslim terlengkap harga jangkau tuju wisata belanja kota bandung terap location based service lbs push notification apliaksi mobile store alisha fancy shop hindar sulit langgan informasi promosi produk diskon event adakan cari lokasi toko langgan kota kunjung kota bandung dasar penelitian implementasi push notification location based service sistem operasi android aplikasi mobile store alisha fancy shop penelitian aplikasi buat bahasa java android studio model sistem model orientasi objek uml unified modeling language implementasi uji alpha beta penelitian tunjuk push notification location based service langgan informasi informasi produk diskon event adakan informasi lokasi toko alisha terdekat langgan keyword mobile store alisha fancy shop push notification location based service'),(534,'C','Pengembangan Layanan SMS Gateway Pada Sistem Informasi Kesiswaan Di SMK Sumatra 40 Bandung . SMK Sumatra 40 bandung merupakan sekolah menengah kejuruan yang baru didirikan pada tahun 2007 di Jalan Sumatra, yang sekarang berpindah tempat berada di Jalan pahlawan no.21 Kota Bandung. SMK Sumatra 40 mempunyai sistem informasi berbasis web yaitu digunakan untuk menyediakan layanan informasi SMK Sumatra 40 seperti informasi kegiatan ekstrakurikuler, informasi prestasi sekolah, pengumuman seputar sekolah, informasi ujian masuk perguruan tinggi, informasi lowongan kerja untuk lulusan SMK, Informasi Kesiswaan dan lainnya. Berdasarkan hasil wawancara dengan kepala sekolah SMK Sumatra 40, Bapak Frans Ngadilan sistem informasi di SMK Sumatra 40 hanya untuk siswa siswi yang memiliki Nomer Induk Siswa(NIS), . informasiÂ–informasi tersebut tidak akan tersampaikan ke semua siswa jika mereka tidak mengakses website SMK Sumatra 40 apalagi dengan orang tua/wali yang bahkan tidak tahu adanya website SMK Sumatra 40, Informasi Kesiswaan ini dibutuhkan oleh orang tua/wali dimana orang tua ingin mengetahui informasi seputar nilai anaknya, absen, pembayaran dan lainnya. Masalah yang ada tersebut untuk mengatasinya diperlukan suatu sistem yang nantinya akan menjembatani antara sistem informasi kesiswaan dan orangtua/wali siswa agar informasi yang ada di SMK Sumatra 40 dapat di akses dimanapun oleh orang tua/wali siswa secara cepat, akurat tanpa terikat waktu dan tempat, untuk mengatasi kelemahan dan kekurangan sistem informasi kesiswaan ini maka penulis ingin mengembangkan layanan informasi melalui media Short Message Service (SMS) Gateway pada sistem informasi kesiswaan di SMK Sumatra 40, karena setiap handphone walaupun bukan smartphone pasti ada layanan SMS tentunya akan sangat efektif dikarenakan orang tua tidak harus membeli alat pendukung lainnya dan hampir seluruh siswa dan orang tua/wali siswa sudah mempunyai handphone. Keyword : SMS Gateway , Pengembangan Layanan SMS Gateway','pengembangan layan sms gateway sistem informasi siswa smk sumatra bandung smk sumatra bandung sekolah tengah juru diri sumatra pindah pahlawan no kota bandung smk sumatra sistem informasi basis web sedia layan informasi smk sumatra informasi ekstrakurikuler informasi prestasi sekolah umum putar sekolah informasi uji guru informasi lowong lulus smk informasi siswa wawancara kepala sekolah smk sumatra bapak frans ngadilan sistem informasi smk sumatra siswa siswi nomer induk siswa nis informasi  informasi sampai siswa akses website smk sumatra tua wali website smk sumatra informasi siswa butuh tua wali mana tua informasi putar nilai anak absen bayar atas perlu sistem nanti jembatan sistem informasi siswa orangtua wali siswa informasi smk sumatra akses mana tua wali siswa cepat akurat ikat atas lemah kurang sistem informasi siswa penulis kembang layan informasi media short message service sms gateway sistem informasi siswa smk sumatra handphone walaupun smartphone layan sms tentu efektif karena tua beli alat dukung siswa tua wali siswa handphone keyword sms gateway pengembangan layan sms gateway'),(535,'A','Penerapan Knowledge Management System Pada Bagian Unit Desa (KUD) Sarwa Mukti Cisarua Bandung Barat. Koperasi Unit Desa (KUD) Sarwa Mukti merupakan koperasi primer di Kecamatan Cisarua Kabupaten Bandung Barat yang bergerak dibidang usaha pengelolaan susu sapi perah. Salah satu bagian yang berperan penting terhadap kegiatan usaha di KUD Sarwa Mukti adalah Bagian Kesehatan Hewan karena hampir seluruh anggota koperasi terdiri dari peternak sapi perah, sehingga kebutuhan para anggota koperasi terhadap kesehatan sapi perahnya sangat tinggi. Saat ini terdapat permasalahan yang terjadi pada bagian kesehatan hewan yakni pengelolaan pengetahuan yang kurang baik sehingga untuk mencari pengetahuan yang dibutuhkan akan memakan waktu yang lama karena pemberian pengetahuan hanya berupa lisan saja. Hal ini mengakibatkan bagi petugas baru sulit beradaptasi dalam pekerjaannya, untuk itu diperlukan suatu wadah pengelolaan pengetahuan dengan menerapkan knowledge management system. Berdasarkan permasalahan yang ada, maka dibutuhkan suatu sistem untuk mengelola pengetahuan agar pengetahuan tersebut dapat tersimpan dengan baik. Knowlede management system yang dibangun menerapkan sistem pakar dengan menggunakan metode CBR (Case Based Reasoning) untuk mencari solusi terbaik untuk mengatasi suatu permasalahan berdasarkan kasus penyakit sapi perah yang sudah ada. Berdasarkan hasil penelitian dan setelah dilakukannya pengujian menggunakan metode pengujian blackbox dan beta terhadap sistem yang telah dibuat, dapat diketahui bahwa sistem dapat membantu petugas kesehatan hewan dalam pengelolaan pengetahuan dan menyelesaikan permasalahan penyakit sapi perah berdasarkan penyakit yang telah ada. eyword : KUD Sarwa Mukti, Knowledge Management Sytem, pengetahuan, Kesehatan Hewan','penerapan knowledge management system unit desa kud sarwa mukti cisarua bandung koperasi unit desa kud sarwa mukti koperasi primer camat cisarua kabupaten bandung gerak bidang usaha pengelolaan susu sapi perah peran usaha kud sarwa mukti sehat hewan anggota koperasi diri ternak sapi perah anggota koperasi sehat sapi perah dapat masalah sehat hewan pengelolaan pengetahuan kurang pengetahuan butuh akan beri pengetahuan upa lisan akibat tugas sulit adaptasi kerja perlu wadah pengelolaan pengetahuan terap knowledge management system masalah butuh sistem kelola pengetahuan pengetahuan simpan knowlede management system bangun terap sistem pakar metode cbr case based reasoning solusi baik atas masalah kasus sakit sapi perah penelitian laku uji metode uji blackbox beta sistem buat tahu sistem tugas sehat hewan pengelolaan pengetahuan selesai masalah sakit sapi perah sakit eyword kud sarwa mukti knowledge management sytem pengetahuan sehat hewan'),(536,'E','Implementasi Metode Lexical Chain Dengan Word Sense Disambiguation Untuk Peringkasan Artikel Kesehatan . Text Summarization adalah suatu proses untuk menghasilkan ringkasan dari suatu artikel, tetapi tetap memiliki gambaran atau dengan kata lain tidak menghilangkan inti informasi dari artikel. Ada beberapa metode untuk melakukan peringkasan teks, diantaranya Metode Lexical chain yang memiliki performansi yang baik untuk peringkasan teks single document, namun penggunaan Metode Lexical chain ini masih memiliki kelemahan yaitu tidak bisa mengidentifikasi kata yang berambigu dalam pembentukan rantai leksikal. Oleh karena itu untuk memperbaiki kelemahan tersebut Metode Lexical chain dilengkapi dengan Word sense disambiguation. Metode lexical chain dengan Word sense disambiguation merupakan metode pengembangan dari metode original lexical chain. Dalam metode ini setiap kandidat kata yang digunakan untuk membangun rantai leksikal akan dilakukan pengecekan ambiguitas makna terlebih dahulu. Pengecekan ini dilakukan untuk memperoleh keakuratan dalam menentukan hubungan leksikal yang sesuai dengan konteks kalimat. Perbedaan mendasar dari metode lexical chain dengan word sense disambiguation dibandingkan dengan original lexical chain yaitu jika metode lexical chain dengan word sense disambiguation dilakukan pengecekan ambiguitas sebelum menentukan rantai leksikal sedangan metode original lexical chain tidak dilakukan pengecekan ambiguitas. Metode lexical chain dengan Word sense disambiguation diimplementasikan terhadap peringkasan artikel kesehatan. Dari hasil penelitian dapat disimpulkan bahwa Metode lexical chain dengan Word sense disambiguation dapat memperbaiki kelemahan pada metode sebelumnya karena metode lexical chain dengan Word sense disambiguation dapat mengidentifikasi makna yang berambigu dan menghasilkan ringkasan yang lebih baik akurasinya. Kata kunci: Text Summarization, Metode lexical chain, Word Sense Disambiguation, Metode lexical chain dengan Word Sense Disambiguation. Keyword : Text Summarization, Metode lexical chain, Word Sense Disambiguation, Metode lexical chain dengan Word Sense Disambiguation.','implementasi metode lexical chain word sense disambiguation ringkas artikel sehat text summarization hasil ringkas artikel tetap gambar hilang inti informasi artikel metode ringkas teks antara metode lexical chain performansi ringkas teks single document metode lexical chain lemah identifikasi ambigu bentuk rantai leksikal baik lemah metode lexical chain lengkap word sense disambiguation metode lexical chain word sense disambiguation metode pengembangan metode original lexical chain metode kandidat bangun rantai leksikal ecek ambiguitas makna terlebih dahulu ecek oleh akurat tentu leksikal konteks kalimat beda dasar metode lexical chain word sense disambiguation banding original lexical chain metode lexical chain word sense disambiguation ecek ambiguitas tentu rantai leksikal dang metode original lexical chain ecek ambiguitas metode lexical chain word sense disambiguation implementasi ringkas artikel sehat penelitian simpul metode lexical chain word sense disambiguation baik lemah metode metode lexical chain word sense disambiguation identifikasi makna ambigu hasil ringkas akurasi kunci text summarization metode lexical chain word sense disambiguation metode lexical chain word sense disambiguation keyword text summarization metode lexical chain word sense disambiguation metode lexical chain word sense disambiguation'),(537,'A','Supply Chain Management Di PT. Sherish Cipta Interindo . PT. Sherish Cipta Interindo merupakan perusahaan yang bergerak di bidang furniture. PT. Sherish Cipta Interindo melakukan pengadaan bahan baku kepada supplier untuk memenuhi kebutuhan produk yang dipesan oleh konsumen. Penentuan jumlah bahan baku, seringkali mengalami kesulitan dikarenakan ketidak pastian pemesanan yang dilakukan konsumen. Waktu yang diperlukan dalam pengadaan bahan baku ke supplier sampai bahan baku diterima memerlukan waktu tunggu sekitar tujuh sampai sepuluh hari, akibatnya tidak dapat memenuhi pemesanan produk.. Berdasarkan Permasalahan yang ada saat ini maka dibutuhkan suatu pembanguan sistem informasi Supply Chain Management di PT. Sherish Cipta Interindo. Tujuannya adalah untuk mempermudah bagian gudang dalam menentukan jumlah bahan baku yang dipesan ke supplier untuk memenuhi kebutuhan produk yang dipesan oleh konsumen dan mempermudah menjadwalkan pendistribusian produk ke setiap konsumen. Metode peramalan yang digunakan adalah Single Exponential Smoothing. Perhitungan dalam menentukan jumlah persedian produk menggunakan safety stock. Berdasarkan hasil pengujian blackbox dan beta yang telah dilakukan pada tahap implementasi dan pengujian dapat diambil kesimpulan bahwa sistem informasi supply chain management ini dapat membantu Kepala Gudang dalam menentukan jumlah bahan baku yang harus dipesan ke supplier, untuk memenuhi kebutuhan produk yang dipesan oleh konsumen dan mempermudah bagian marketting dalam penjadwalan pendistribusian produk kepada konsumen yang telah melakukan pemesanan produk. Keyword : Supply Chain Management, Single Exponential Smoothing, Safety Stock','supply chain management pt sherish cipta interindo pt sherish cipta interindo usaha gerak bidang furniture pt sherish cipta interindo ada bahan baku supplier penuh produk pesan konsumen penentuan bahan baku seringkali sulit karena tidak pasti mesan konsumen perlu ada bahan baku supplier bahan baku terima perlu tunggu tujuh puluh akibat penuh mesan produk masalah butuh pembanguan sistem informasi supply chain management pt sherish cipta interindo tuju mudah gudang tentu bahan baku pesan supplier penuh produk pesan konsumen mudah jadwal distribusi produk konsumen metode ramal single exponential smoothing hitung tentu dian produk safety stock uji blackbox beta tahap implementasi uji ambil simpul sistem informasi supply chain management kepala gudang tentu bahan baku pesan supplier penuh produk pesan konsumen mudah marketting jadwal distribusi produk konsumen mesan produk keyword supply chain management single exponential smoothing safety stock'),(538,'E','Implementasi Metode Support Vector machine Dan Metode Maximum Marginal Relevance Untuk Menghasilkan Rangkuman Dari Kumpulan Dokumen Berita Dengan Topik Sejenis . Informasi yang ada pada saat ini tidak hanya bersumber dari satu dokumen saja, melainkan dari beberapa dokumen. Selain itu beberapa informasi dapat mempunyai pandangan yang berbeda tentang suatu topik yang sama. Salah satu informasi yang terdapat dalam dokumen adalah berita. Dokumen berita bisa bersumber dari beberapa media. Saat ini banyak sekali media yang memuat berita serta dipublikasikan memiliki pembahasan yang sama dalam satu topik sejenis, tetapi hanya ditulis dengan tata bahasa dan cara penyampaiannya yang berbeda. Ringkasan merupakan teks singkat dan padat yang dapat dianggap pengganti dari keseluruhan dokumen, karena tetap mempertahankan kandungan informasi penting yang dimiliki dari sumber dokumennya. Ringkasan dapat membantu menghasilkan rangkuman singkat yang diambil dari beberapa dokumen berita. Diperlukan suatu proses untuk menghasilkan ringkasan multi-document melalui lima tahap utama, yaitu: proses preprocessing, pembobotan tf-idf perhitungan cosine similarity, klasifikasi kalimat menggunakan metode suppport vector machine dan pembentukan ringkasan menggunakan metode maximum marginal relevance. Berdasarkan hasil pengujian menggunakan metode evaluasi intrinstik terhadap hasil ringkasan yang dihasilkan. Dapat disimpulkan bahwa penggunaan metode svm dan mmr dapat diimplementasikan untuk menghasilkan sebuah ringkasan multi-document, dengan nilai performansi recall 64%, precision 90% dan f-measure 75%. Keyword : ringkasan multi-document, preprocessing, tf-idf, cosine similarity, suppport vector machine, maximum marginal relevance, recall, precision, f-measure','implementasi metode support vector machine metode maximum marginal relevance hasil rangkum kumpul dokumen berita topik jenis informasi sum dokumen lain dokumen informasi pandang beda topik informasi dapat dokumen berita dokumen berita sum media media muat berita publikasi bahas topik jenis tulis tata bahasa sampai beda ringkas teks singkat padat anggap ganti seluruh dokumen tetap tahan kandung informasi milik dokumen ringkas hasil rangkum singkat ambil dokumen berita perlu hasil ringkas multi tahap preprocessing bobot tf hitung cosine similarity klasifikasi kalimat metode suppport vector machine bentuk ringkas metode maximum marginal relevance uji metode evaluasi intrinstik ringkas hasil simpul metode svm mmr implementasi hasil ringkas multi nilai performansi recall precision f keyword ringkas multi preprocessing tf cosine similarity suppport vector machine maximum marginal relevance recall precision f'),(539,'B','Penerapan Data Mining Menggunakan Metode Association Rule Pada Data Transaksi Kartika Kosmetik . Kartika Kosmetik merupakan toko penjualan produk-produk penunjang kecantikan dan kebutuhan salon. Dalam melakukan strategi penjualannya, toko Kartika Kosmetik seringkali membuat suatu paket penjualan kosmetik yaitu beberapa produk kosmetik yang dijual secara bersamaan. Namun dalam proses pembuatan paket penjualan produk kosmetiknya, pihak kartika kosmetik belum memiliki informasi yang sesuai dengan kriteria yang diinginkan oleh konsumen Untuk memecahkan masalah tersebut, dibuatlah solusi yaitu dengan membangun sebuah aplikasi yang dapat mengolah data transaksi penjualan toko kartika kosmetik yang akan menghasilkan informasi mengenai pasangan produk yang sering dibeli oleh konsumen. Dari informasi tersebut, perusahaan dapat menentukan daftar rekomendasi paket penjualan produknya. Aplikasi ini dibentuk dengan mengimplementasikan Data Mining dengan metode Association Rules menggunakan algoritma CT-Pro. Dengan dibangunanya aplikasi yang menerapkan Data Mining ini, pihak pemasaran Kartika Kosmetik dapat memahami pola pembelian konsumen dan dapat membantu untuk merekomendasikan paket produk kosmetiknya yang akan digunakan sebagai strategi penjualan untuk meningkatkan penjualan. Keyword : Data mining, Association rule, Algoritma CT-Pro','penerapan data mining metode association rule data transaksi kartika kosmetik kartika kosmetik toko jual produk penunjang cantik salon strategi jual toko kartika kosmetik seringkali paket jual kosmetik produk kosmetik jual sama buat paket jual produk kosmetik kartika kosmetik informasi kriteria ingin konsumen pecah buat solusi bangun aplikasi o data transaksi jual toko kartika kosmetik hasil informasi pasang produk beli konsumen informasi usaha tentu daftar rekomendasi paket jual produk aplikasi bentuk implementasi data mining metode association rules algoritma ct dibanguna aplikasi terap data mining pemasaran kartika kosmetik paham pola beli konsumen rekomendasi paket produk kosmetik strategi jual jual keyword data mining association rule algoritma ct'),(540,'C','Implementasi Ethernet Over IP (EOIP) Tunnel Mikrotik Routeros Pada Layanan Voice IP (VOIP) Di PT. Akurasi KUATMEGA. PT. Akurasi Kuatmega adalah perusahaan yang sudah lama bergerak di bidang telekomunikasi dan sekarang merambah ke dunia pariwisata sebagai contoh objek wisata maribaya di kota bandung. Perusahaan ini memiliki banyak karyawan dan memiliki beberapa kantor cabang. Atas dasar itu, media komunikasi menjadi sarana yang paling penting untuk menjaga komunikasi antar karyawan di kantor pusat dengan karyawan kantor cabang maribaya. Sebelumnya, media komunikasi yang digunakan oleh PT. Akurasi Kuatmega adalah telepon kabel. Akan tetapi, dalam penerapaanya masih sering terjadi gangguan koneksi dan biaya telepon yang dikeluarkan besar. Oleh karena itu diperlukan media yang mampu mengoptimalkan sistem komunikasi antar karyawan pada PT. Akurasi Kuatmega.Salah satu cara untuk mengoptimalkan sistem komunikasi tersebut adalah dengan mengimplementasikan Voice Over Internet Protokol (VoIP) dengan Ethernet Over Internet Protokol sebagai penghubung antar jaringan kantor. Voice Over Internet Protokol (VoIP) adalah teknologi yang mampu melewatkan Â“panggilan suaraÂ”, video dan data melalui jaringan IP dengan menggunakan Asterisk sebagai server dan softphone x-lite sebagai client. Dengan menggunakan sistem komunikasi melalui jaringan internet memiliki keuntungan dari segi biaya perawatan yang jauh lebih murah dibandingkan dengan biaya yang dibutuhkan jaringan telepon biasa. Dalam implementasi ini, dilakukan analisis layanan aspek QoS (Quality of Service) dengan parameter delay, jitter, dan packet loss yang berkaitan dengan peranan protokol Ethernet over IP tunnel Mikrotik RouterOS terhadap performansi jaringan tersebut yang dilakukan pada bandwidth sebesar 512 Kbps, 256 Kbps dan 128 Kbps. Dari hasil pengujian yang dilakukan dengan skema percobaan yang sama, secara umum nilai dari parameter Qos yang didapat ketika menggunakan EoIP kurang baik dibandingkan tanpa menggunakan EoIP. Keyword : VoIP, Ethernet over IP, X-Lite Softphone, Asterisk','implementasi ethernet over ip eoip tunnel mikrotik routeros layan voice ip voip pt akurasi kuatmega pt akurasi kuatmega usaha gerak bidang telekomunikasi rambah dunia pariwisata contoh objek wisata maribaya kota bandung usaha karyawan kantor cabang dasar media komunikasi sarana jaga komunikasi antar karyawan kantor pusat karyawan kantor cabang maribaya media komunikasi pt akurasi kuatmega telepon kabel penerapaa ganggu koneksi biaya telepon keluar perlu media optimal sistem komunikasi antar karyawan pt akurasi kuatmega sa optimal sistem komunikasi implementasi voice over internet protokol voip ethernet over internet protokol hubung antar jaring kantor voice over internet protokol voip teknologi lewat panggil suara video data jaring ip asterisk server softphone x client sistem komunikasi jaring internet untung segi biaya rawat murah banding biaya butuh jaring telepon implementasi analisis layan aspek qos quality service parameter delay jitter packet loss kait r protokol ethernet over ip tunnel mikrotik routeros performansi jaring bandwidth kbps kbps kbps uji skema coba nilai parameter qos dapat eoip kurang banding eoip keyword voip ethernet over ip x softphone asterisk'),(541,'E','Implementasi Algoritma Fuzzy Logic Pada Autonomous Mobile Robot Untuk Kasus Pendeteksian Halangan . Autonomous mobile robot merupakan sebuah robot yang dapat bernavigasi secara mandiri tanpa bantuan manusia dengan menanamkan algoritma tertentu sebagai pengatur gerak robot . Robot jenis ini dapat melakukan tugasnya dengan baik karena memiliki kecerdasan yang menyerupai kecerdasan manusia seperti menghindari halangan yang berada di depan, halangan kondisi jalan berlubang dan halangan tinggi yang menyerupai terowongan. Kecerdasan buatan yang ditanamkan pada autonomous mobile robot akan membantu robot untuk mengambil keputusan serta beradaptasi pada lintasannya untuk menghindari setiap halangan. Tujuan dari penelitian ini adalah membangun autonomous mobile robot penghindar halangan dan menanamkan algoritma fuzzy logic kepada mobile robot sebagai pengatur gerak mobile robot dengan memanfaatkan pendeteksian sensor ultrasonic agar mobile robot dapat menghidar dari setiap halangan yang terdeteksi. Hasil pendeteksian sensor diproses di dalam mikrokontroler yang telah ditanamkan terlebih dahulu dengan metode fuzzy logic dan menghasilkan sebuah keluaran yang berupa jenis gerakan yang akan dilakukan mobile robot. Dari hasil pengujian menunjukan bahwa mobile robot penghindar halangan yang dibangun telah berfugsi dengan baik sesuai dengan rancangan yang dibuat dengan tingkat keberhasilan 98,8%.  Keyword : autonomous mobile robot, penghindar halangan, sensor ultrasonic, mikrokontroler, fuzzy logic.','implementasi algoritma fuzzy logic autonomous mobile robot kasus deteksi halang autonomous mobile robot robot navigasi mandiri bantu manusia tanam algoritma tertentu atur gerak robot robot tugas cerdas rupa cerdas manusia hindar halang halang lubang halang rupa terowongan cerdas buat tanam autonomous mobile robot robot adaptasi lintas hindar halang tuju penelitian bangun autonomous mobile robot hindar halang tanam algoritma fuzzy logic mobile robot atur gerak mobile robot manfaat deteksi sensor ultrasonic mobile robot menghidar halang terdeteksi deteksi sensor proses mikrokontroler tanam terlebih dahulu metode fuzzy logic hasil luar upa gerak mobile robot uji tunjuk mobile robot hindar halang bangun berfugsi rancang buat hasil keyword autonomous mobile robot hindar halang sensor ultrasonic mikrokontroler fuzzy logic'),(542,'B','Implementasi Business Intelligence Di Rumah Makan Sari Rasa Sambel Hejo Cipaganti . Rumah Makan Sari Rasa Sambel Hejo Cipaganti (SRSHC) merupakan rumah makan yang telah diresmikan pada tanggal 1 April 2015. Saat ini Rumah Makan SRSHC belum tersedia suatu sistem yang dapat mengawasi perkembangan dan rencana bisnisnya baik itu dalam hal keuangan, produk, maupun pegawai. Sehingga pemilik Rumah Makan SRSHC kesulitan mengawasi perkembangan bisnisnya dan beliau disibukkan dengan pengelolaan omset tiap harinya saja, serta tujuan bisnisnya seperti meningkatkan produk, profit, dan perkembangan pegawaiharus dikesampingkan. Serta, data dan informasi-informasi yang sudah ada tidak dapat dimanfaatkan dengan baik dikarenakan data dan informasi-informasi yang tidak terorganisasi. Suatu keilmuan yang dapat menyelesaikan kasus tersebut yaitu dengan mengimplementasikan Business Intelligence yang dapat mengorganisasikan data dan informasi-informasi yang ada menjadi pengetahuan yang dapat membantu pemilik mengawasi perkembangan dan rencana bisnisnya baik dalam hal kepegawaian, produk, maupun keuangan, serta Scorecard dan Dashboard yang digunakan sebagai reporting tools. Pengimplementasian Business Intelligence dapat mengorganisasikan data dan informasi-informasi yang ada menjadi pengetahuan serta menggambarkan dengan jelas dan akurat perkembangan bisnis di Rumah Makan SRSHC. Sehingga sistem business intelligence ini dapat membantu pemilik dalam mengawasi perkembangan bisnisnya dalam hal kepegawaian, produk, dan keuangan. Keyword : Business Intelligence, Data Warehouse, ETL, Reporting Tools','implementasi business intelligence rumah makan sari sambel hejo cipaganti rumah makan sari sambel hejo cipaganti srshc rumah makan resmi april rumah makan srshc tersedia sistem awas kembang rencana bisnis uang produk gawai milik rumah makan srshc sulit awas kembang bisnis beliau sibuk pengelolaan omset tiap hari tuju bisnis produk profit kembang pegawaiharus samping data informasi manfaat karena data informasi organisasi ilmu selesai kasus implementasi business intelligence organisasi data informasi pengetahuan milik awas kembang rencana bisnis gawai produk uang scorecard dashboard reporting tools implementasi business intelligence organisasi data informasi pengetahuan gambar akurat kembang bisnis rumah makan srshc sistem business intelligence milik awas kembang bisnis gawai produk uang keyword business intelligence data warehouse etl reporting tools'),(543,'E','Implementasi Metode RUN length Dan Simple Naive Bayes Untuk Klasifikasi Penyakit Leukemia Berdasarkan Citra Darah . Penyakit leukemia adalah penyakit dalam klasifikasi kanker pada darah.Penyakit leukemia memiliki suatu ciri yang berbeda. Mengenali perbedaan tekstur pada citra penyakit leukemia merupakan suatu cara untuk membedakan ciri tersebut. Ada beberapa metode untuk memperoleh ciri-ciri tekstur dalam suatu citra, salah satu metode untuk memperoleh ciri-ciri citra tekstur adalah dengan menggunakan metode run length. Ciri-ciri yang terdapat pada metode run length adalah SRE (Short Run Emphasis), LRE (Long Run Emphasis), GLU (Grey Level Uniformity), RLU (Run Length Uniformity) dan RPC (Run Percentage). Dari hasil ciri-ciri tersebut kemudian algoritma naïve bayes akan menentukan hasil klasifikasi berdasarkan nilai probabilitas terbesar. Citra yang diuji adalah citra darah yang teridentifikasi penyakit leukemia.Berdasarkan penelitian yang telah dilakukan, dapat ditarik kesimpulan bahwa:algoritma naïve bayes dapat melakukan klasifikasi citra penyakit leukemia erdasarkan tekstur yang diekstraksi dengan metode run length. Data hasil ekstraksi ciri metode run length adalah berupa data kontinu, sehingga data hasil ekstraksi ciri tersebut dapat langsung digunakan sebagai masukan dalam klasifikasi naïve bayes. Berdasarkan hasil pengujian, kesimpulan yang didapatkan adalah algoritma naïve bayes dapat mengklasifikasikan citra penyakit leukemia berdasarkan hasil ekstraksi citra darah menggunakan metode run length dan menghasilkan tingkat keakurasian 91.25% dengan total 20 data latih dan 20 data uji. Dikarenakan data hasil ekstraksi ciri tekstur penyakit leukemia dengan metode run-length memiliki keunggulan membedakan antara tekstur halus dan tekstur kasar, sehingga klasifikasi naïve bayes dapat berjalan lebih maksimal saat melakukan klasifikasi citra darah yang teridentifikasi penyakit leukemia. Keyword : penyakit leukemia, citra darah, metode run length, algoritma naïve bayes','implementasi metode run length simple naive bayes klasifikasi sakit leukemia citra darah sakit leukemia sakit klasifikasi kanker darah penyakit leukemia ciri beda kenal beda tekstur citra sakit leukemia bedak ciri metode oleh ciri tekstur citra metode oleh ciri citra tekstur metode run length ciri dapat metode run length sre short run emphasis lre long run emphasis glu grey level uniformity rlu run length uniformity rpc run percentage ciri algoritma na ve bayes tentu klasifikasi nilai probabilitas terbesar citra uji citra darah identifikasi sakit leukemia berdasarkan penelitian tarik simpul bahwa algoritma na ve bayes klasifikasi citra sakit leukemia erdasarkan tekstur ekstraksi metode run length data ekstraksi ciri metode run length upa data kontinu data ekstraksi ciri masuk klasifikasi na ve bayes uji simpul dapat algoritma na ve bayes klasifikasi citra sakit leukemia ekstraksi citra darah metode run length hasil akurasi total data latih data uji karena data ekstraksi ciri tekstur sakit leukemia metode run unggul bedak tekstur halus tekstur kasar klasifikasi na ve bayes maksimal klasifikasi citra darah identifikasi sakit leukemia keyword sakit leukemia citra darah metode run length algoritma na ve bayes'),(544,'E','Klasifikasi Penyakit Ikan Di Karantina kelautan Dan perikanan Badan Karantina Ikan, Pengendalian Mutu Dan keamanan Hasil Perikanan (BKIPM-KKP) kelas II Bandung Menggunakan Hidden Mark Ov Model . Ikan merupakan salah satu hewan air yang selalu bersentuhan dengan lingkungan perairan sehingga mudah terinfeksi penyakit baik itu bertipe patogen maupun non patogen melalui air. Ada beberapa faktor yang sering mengakibatkan ikan mengalami kematian yakni faktor internal dan external. BKIPM-KKP sering melalukan tinjauan terhadap penangkaran-penangkaran yang ada di wilayah Jawa Barat, dan terkadang pada saat tinjauan terhadap penangkaran tersebut mengalami kesulitan pada saat mengklasifikasikan penyakit yang diderita ikan yang ada di penangkaran, karena untuk mengetahui penyakit tersebut harus melalui tahap laboratorium BKIPM-KKP terlebih dahulu dan hasil dari laboratorium tidak akan keluar pada saat itu juga untuk proses klasifikasi. Berdasarkan dari penelitian melalui observasi terhadap laboratorium BKIPM-KKP, wawacara kepada stasiun dan pihak laboratorium, dan pengumpulan data yang dibutuhkan untuk menyelesaikan masalah yang sedang terjadi, serta beberapa jurnal dan sumber lainnya yang berkaitan tentang klasifikasi menggunakan Hidden Markov Model (HMM). Citra yang digunakan merupakan citra hasil dari mikroskopis baik bertipe .jpg maupun .png, dimana citra tersebut akan diproses menggunakan pengolahan citra mulai dari grayscale, edge detection canny dan ekstraksi, setelah citra melalui tahap ekstraksi maka tahap selanjutnya yaitu proses klasifikasi menggunakan Hidden Markov Model (HMM) Setelah melakukan pengujian dengan citra yang didapat dari hasil mikroskopis menggunakan metode Hidden Markov Model (HMM) bahwa menggunakan proses pengolahan citra saja sudah cukup untuk menentukan ciri dari citra penyakit ikan, sehingga apabila hanya menggunakan prose pengolahan citra saja, keakuratan yang didapat hanya 69% dari 100 data citra yang diuji dalam proses klasifikasi. Keyword : Klasifikasi penyakit ikan, penyakit, ikan, Hidden Markov models, image processing, BKIPM-KKP, laboratorium, mikroskopis','klasifikasi sakit ikan karantina kelautan ikan karantina ikan pengendalian mutu aman ikan bkipm kelas i bandung hidden mark ov model ikan hewan air sentuh lingkung air mudah infeksi sakit tipe patogen non patogen air faktor akibat ikan mati faktor internal external bkipm lalu tinjau penangkaran wilayah jawa kadang tinjau penangkaran sulit klasifikasi sakit derita ikan penangkaran sakit tahap laboratorium bkipm terlebih dahulu laboratorium klasifikasi penelitian observasi laboratorium bkipm wawacara stasiun laboratorium pengumpulan data butuh selesai jurnal kait klasifikasi hidden markov model hmm citra citra mikroskopis tipe jpg png mana citra proses olah citra grayscale edge detection canny ekstraksi citra tahap ekstraksi tahap lanjut klasifikasi hidden markov model hmm uji citra dapat mikroskopis metode hidden markov model hmm olah citra tentu ciri citra sakit ikan apabila prose olah citra akurat dapat data citra uji klasifikasi keyword klasifikasi sakit ikan sakit ikan hidden markov models image processing bkipm laboratorium mikroskopis'),(545,'D','Perancangan Aplikasi Pengukuran Ketinggian Dan Kemiringan Objek Menggunakan Accelerometer Berbasis Android . Perancangan aplikasi pengukur ketinggian dan kemiringan objek menggunakan Accelerometer berbasis Android merupakan aplikasi alat ukur ketinggian dan kemiringan objek pada ponsel android dengan teknologi kamera, GPS, dan Accelerometer yang dapat meningkatkan efisiensi waktu dan tenaga dalam mengukur ketinggian bangunan yang sulit diukur, sehingga dapat mengurangi resiko dalam pekerjaan pengukuran bangunan tinggi dan tidak perlu lagi mengukur secara manual menggunakan alat ukur biasa.Prinsip kerja aplikasi ini adalah berdasar data koordinat GPS, kamera, dan nilai sensor Accelerometer. Perancangan aplikasi ini meliputi prinsip kerja dari GPS, Accelerometer, dan perhitungan Trigonometri. Sistem aplikasi ini merupakan aplikasi yang mampu menentukan nilai jarak User terhadap bangunan melalui koordinat GPS, nilai sudut dan kemiringan ponsel terhadap bangunan melalui sensor Accelerometer, dan nilai ketinggian bangunan yang diukur melalui perhitungan Trigonometri berdasarkan nilai jarak dari koordinat GPS dan nilai sudut dari Accelerometer ponsel. Hasil pengujian menunjukkan bahwa aplikasi yang dibangun telah dapat berfungsi dengan baik, ditunjukkan oleh nilai error hasil perbandingan pengukuran ketinggian pada aplikasi dengan alat ukur biasa yaitu ±0,234 meter. Aplikasi lebih efektif digunakan di luar ruangan, karena di dalam ruangan terkadang sinyal GPS sulit didapatkan. Keyword : alat ukur, ketinggian, kemiringan, GPS, Accelrometer, Trigonometri','rancang aplikasi ukur tinggi miring objek accelerometer basis android rancang aplikasi ukur tinggi miring objek accelerometer basis android aplikasi alat ukur tinggi miring objek ponsel android teknologi kamera gps accelerometer efisiensi tenaga ukur tinggi bangun sulit ukur urang resiko kerja ukur bangun ukur manual alat ukur biasa prinsip aplikasi dasar data koordinat gps kamera nilai sensor accelerometer rancang aplikasi liput prinsip gps accelerometer hitung trigonometri sistem aplikasi aplikasi tentu nilai jarak user bangun koordinat gps nilai sudut miring ponsel bangun sensor accelerometer nilai tinggi bangun ukur hitung trigonometri nilai jarak koordinat gps nilai sudut accelerometer ponsel uji aplikasi bangun fungsi tunjuk nilai error banding ukur tinggi aplikasi alat ukur meter aplikasi efektif ruang ruang kadang sinyal gps sulit dapat keyword alat ukur tinggi miring gps accelrometer trigonometri'),(546,'E','Implementasi Metode Generalized Vector Space Model (GVSM) Menggunakan Algoritma Lesk Pada Sistem Temu Kembali . Sistem Temu Kembali (Information Retrieval System) dirancang untuk menemukan data (file) atau informasi yang diperlukan. Sistem Temu Kembali (Information Retrieval System) bertujuan untuk menjembatani kebutuhan informasi dengan sumber informasi yang tersedia secara relevan. Generalized Vector Space Model (GVSM) merupakan salah satu model Sistem Temu Kembali (Information Retrieval System). Terkadang apa yang dicari tidak relevan dengan apa yang diinginkan, terdapat beberapa penyebab yang mengakibatkan apa yang dicari tidak relevan dengan apa yang diinginkan, salah satunya adalah kata kunci (keyword) yang ambigu. Solusi yang dapat digunakan untuk mengoptimalkan kata kunci (keyword) adalah dengan mengimplementasikan algoritma lesk. Algoritma lesk merupakan algoritma yang digunakan untuk menemukan makna kata yang berkaitan dengan kata kunci utama, dengan kata lain terdapat kata yang tidak dimasukan kedalam query tapi masuk kedalam kata pencarian. Berdasarkan hasil penelitian yang telah dilakukan dapat dilihat bahwa penambahan algoritma lesk untuk sistem temu kembali (Information Retrieval System) bisa diimplementasikan dan bekerja dengan cukup baik. Algoritma lesk dapat bekerja sesuai yang diharapkan sebagai masukan sistem temu kembali (Information Retrieval System) dalam menghilangkan ambiguitas. Nilai yang dihasilkan oleh algoritma lesk sangat berpengaruh terhadap bobot similiaritas. Tidak hanya bobot similiaritas yang bertambah, tetapi nilai recall dan precission pun ikut meningkat. Berdasarkan penelitian terhadap 30 dokumen, nilai recall dan precission tanpa menggunakan algoritma lesk sebesar 94.736% dan 78.26% sedangkan menggunakan algoritma lesk sebesar 100% dan 82.608%. Keyword : Information Retrieval System, Generalized Vector Space Model, Algoritma Lesk, Keyword, Query.','implementasi metode generalized vector space model gvsm algoritma lesk sistem temu sistem temu information retrieval system rancang temu data file informasi perlu sistem temu information retrieval system tuju jembatan informasi informasi tersedia relevan generalized vector space model gvsm model sistem temu information retrieval system kadang cari relevan ingin dapat sebab akibat cari relevan ingin satu kunci keyword ambigu solusi optimal kunci keyword implementasi algoritma lesk algoritma lesk algoritma temu makna kait kunci dapat masuk dalam query dalam cari penelitian lihat penambahan algoritma lesk sistem temu information retrieval system implementasi kerja algoritma lesk kerja harap masuk sistem temu information retrieval system hilang ambiguitas nilai hasil algoritma lesk pengaruh bobot similiaritas bobot similiaritas tambah nilai recall precission tingkat penelitian dokumen nilai recall precission algoritma lesk algoritma lesk keyword information retrieval system generalized vector space model algoritma lesk keyword query'),(547,'E','Pengindentifikasian Suara Tinggi Dan Rendah Pada Pria Dan Wanita Ditinjau Dari Pitch Dan Formant Menggunakan Metode Support Vector Machine . Pengenalan suara merupakan proses identifikasi suara berdasarkan kata yang diucapkan seseorang yang ditangkap oleh perangkat input suara untuk dikenali dan kemudian diterjemahkan menjadi sebuah data yang dipahami oleh komputer. Ketika manusia mengeluarkan suara, saat itulah suara tersebut menyampaikan beberapa informasi di dalam kata yang diucapkan melalui gelombang suara. Informasi suara tersebut dapat diketahui melalui fitur suara itu sendiri, diantaranya dengan pitch dan formant, dimana pitch adalah frekuensi fundamental dari sinyal suara yang dihasilkan karena getaran pita suara, dan formant adalah frekuensi resonansi akustik dari bidang suara manusia. Kedua fitur  tersebut merupakan fitur suara yang sangat penting untuk mengidentifikasi suara yang diucapkan dari seseorang. Tahapan analisis pengidentifikasian suara ini dengan tahap pre-processing, feature extraction, dan classification. Tahapan pre-processing dengan preemphasis, frame blocking, dan hamming window dari sinyal suara. Tahapan feature extraction dengan autocorrelation untuk menentukan pitch dan linear predictive coding untuk menentukan formant, serta tahapan classification dengan support vector machine untuk mengklasifikasikan fitur suara yang akan digunakan untuk mengidentifikasi suara tinggi dan rendah. Berdasarkan hasil pengujian terhadap simulator dengan kesimpulan bahwa rata-rata nilai pitch pria untuk suara tinggi maupun rendah lebih rendah dari wanita, rata-rata nilai formant ke-1 dan formant ke-2 wanita untuk suara tinggi dan rendah lebih tinggi dari pria, rata-rata formant ke-3 pria untuk suara tinggi dan rendah lebih tinggi dari wanita, fitur suara yang lebih cocok merepresentasikan suara tinggi untuk pria dan wanita adalah pitch, kisaran pitch dan formant untuk suara pria adalah 191.1435 Hz (F0), 503.9955 Hz (F1), 956.9225 Hz (F2), dan 1561.43 Hz (F3). Untuk suara wanita adalah 268.51 Hz (F0), 534.871 Hz (F1), 1080.4475 Hz (F2), dan 1690.835 Hz (F3). Simulator mampu memprediksi suara tinggi dan rendah baik untuk pria dan wanita dengan persentase akurasi sebesar 70% untuk suara pria dan 100% untuk suara wanita. Keyword : Pitch, Formant, Linear Predictive Coding, Support Vector Machine.','pengindentifikasian suara rendah pria wanita tinjau pitch formant metode support vector machine pengenalan suara identifikasi suara ucap orang tangkap angkat input suara kenal terjemah data paham komputer manusia keluar suara itu suara sampai informasi ucap gelombang suara informasi suara tahu fitur suara antara pitch formant mana pitch frekuensi fundamental sinyal suara hasil getar pita suara formant frekuensi resonansi akustik bidang suara manusia fitur fitur suara identifikasi suara ucap orang tahap analisis identifikasi suara tahap pre feature extraction classification tahap pre preemphasis frame blocking hamming window sinyal suara tahap feature extraction autocorrelation tentu pitch linear predictive coding tentu formant tahap classification support vector machine klasifikasi fitur suara identifikasi suara rendah uji simulator simpul rata nilai pitch pria suara rendah rendah wanita rata nilai formant ke formant ke wanita suara rendah pria rata formant ke pria suara rendah wanita fitur suara cocok representasi suara pria wanita pitch kisar pitch formant suara pria hz hz hz hz suara wanita hz hz hz hz simulator prediksi suara rendah pria wanita persentase akurasi suara pria suara wanita keyword pitch formant linear predictive coding support vector machine'),(548,'B','Implementasi Data Mining Dalam Pemaketan Produk Menggunakan Metode Association Rule Di Minimarket Warga Tunggal Bandung . Minimarket Warga Tunggalmerupakan Minimarket yang menjual keperluan sehari - hari. Dari waktu ke waktu data penjualan yang ada semakin banyak dan hanya menjadi arsip saja tanpa adanya pengolahan untuk mendapatkan informasi didalamnya. Minimarket Warga Tunggal dalam strategi bisnisnya melakukan penjualan produk dalam bentuk paket dengan harga yang lebih murah dibandingkan dengan produk yang dijual dalam bentuk satuan. Namun penjualan Minimarket Warga Tunggal beberapa bulan ke belakang mengalami penurunan karena paket yang tawarkan kurang diminati pelanggan. Association rule merupakan salah satu teknik data mining yang berfungsi untuk menemukan hubungan antar variabel yang ada didalam suatu data transaksi. Proses pemampatan data dengan model struktur data pohon untuk menghindari pengulangan scanning database tanpa memerlukan candidate generation, dilanjutkan dengan proses algoritma FP-Growth yang dapat langsung mengekstrak frequent itemset dari FP-Tree yang telah berbentuk dengan menggunakan prinsip divide and conquer. Maka dari itu Minimarket Warga Tunggal memerlukan suatu metode untuk dapat memanfaatkan data penjualan yang ada untuk menentukan produk apa saja yang bisa dijual dalam bentuk paket. Berdasarkan pengujian yang telah dilakukan dengan pengujian beta dan fungsional, aplikasi yang dibangun dapat membantu Minimarket Warga Tunggal untuk mengetahui pola pembelian pelanggan. Keyword : Data mining, association rule, algoritma FP-Growth, frequent itemset, divide and conquer','implementasi data mining maket produk metode association rule minimarket warga tunggal bandung minimarket warga tunggalmerupakan minimarket jual perlu hari data jual arsip olah informasi dalam minimarket warga tunggal strategi bisnis jual produk paket harga murah banding produk jual satu jual minimarket warga tunggal penurunan paket tawarkan kurang minat langgan association rule teknik data mining fungsi temu antar variabel dalam data transaksi pemampatan data model struktur data pohon hindar ulang scanning database perlu candidate generation lanjut algoritma fp ekstrak frequent itemset fp bentuk prinsip vide and conquer minimarket warga tunggal perlu metode manfaat data jual tentu produk jual paket uji uji beta fungsional aplikasi bangun minimarket warga tunggal pola beli langgan keyword data mining association rule algoritma fp frequent itemset vide and conquer'),(549,'B','Implementasi Web Usage Mining Menggunakan Association Rule Untuk Menemukan Pola Pengunjung Website (Studi Kasus E-KOSAN.COM). e-kosan.com merupakan website penyedia layanan informasi kos-kosan. Tujuannya untuk membantu mahasiswa atau perantau dalam menemukan koskosan dan pemilik kost dapat menyebarkan informasi kosan. Rata-rata penguna ekosan adalah mahasiswa. Pengunjung masih kesulitan mendapatkan kosan yang sesuai dengan kriteria yang berada didaerah kampus terdekat. Di mana saat ini ekosan belum memiliki rekomendasi informasi kosan akibatnya untuk mendapatkan kostan sesuai kriteria yang dicari, pengunjung harus melakukan filtering pencarian berulang-ulang sampai informasi kosan tersebut didapat Untuk mempercepat pencarian informasi kosan yang sesuai dengan kriteria maka dibutuhkan suatu fitur ekomendasi yang berdasarkan daerah kampus terdekat dan pola kebiasaan pengunjung website e-kosan.com. Pola pengguna dari sebuah web didapatkan dengan menggunakan teknik web usage mining, web usage mining merupakan teknik data mining yang mengungkap pola pengguna dari halaman web. Dalam tahapannya dibutuhkan metode untuk menemukan pola penggunaan pada halaman web dan metode tersebut adalah association rule. Algoritma yang digunakan dalam association rule ini menggunakan algoritma CT-Pro yang berfungsi membantu menemukan pola penggunaan pada halaman web. Hasil pola pengguna dari implementasi web usage mining ini digunakan untuk aturan rekomendasi. Berdasarkan hasil pengujian penelitian bahwa kost-kosan yang direkomendasikan dapat memudahkan pengunjung e-kosan menemukan kostkostan yang sesuai pola kebiasaan pengunjung dan sesuai kriteria yang dicari didaerah terdekat dengan tempat mahasiswa belajar. Kata kunci: Web usage mining, data mining, association rule, CT-Pro, Kos-kosan. Keyword : Web usage mining, data mining, association rule, CT-Pro, Kos-kosan','implementasi web usage mining association rule temu pola unjung website studi kasus e e website sedia layan informasi kos tuju mahasiswa rantau temu koskosan milik kost sebar informasi kosan rata penguna ekosan mahasiswa unjung sulit kosan kriteria daerah kampus terdekat ekosan rekomendasi informasi kosan akibat kostan kriteria cari unjung filtering cari ulang informasi kosan dapat cepat cari informasi kosan kriteria butuh fitur ekomendasi daerah kampus terdekat pola biasa unjung website e pola guna web dapat teknik web usage mining web usage mining teknik data mining ungkap pola guna halaman web tahap butuh metode temu pola halaman web metode association rule algoritma association rule algoritma ct fungsi temu pola halaman web pola guna implementasi web usage mining atur rekomendasi uji penelitian kost rekomendasi mudah unjung e temu kostkostan pola biasa unjung kriteria cari daerah terdekat mahasiswa belajar kunci web usage mining data mining association rule ct kos keyword web usage mining data mining association rule ct kos'),(550,'A','Analisis Perilaku Pengguna Pada Website Sistem Informasi Akademik Universitas Langlangbuana Dengan Menggunakan Technology Acceptance Model (TAM). Universitas Langlangbuana adalah salah satu univeristas yang menerapkan sistem informasi akademik untuk mempermudah proses perkuliahan. Sistem informasi akademik tersebut sudah diterapkan sejak tahun 2013, setelah berjalan selama 3 tahun penggunaan sistem infromasi akademik atau disingkat SIAK tersebut digunakan oleh mahasiswa dirasa belum maksimal. Divisi SIAK selaku pengurus sistem informasi akademik di Universitas Langlanguana menyarankan diadakannya penelitian pada pengguna SIAK untuk mendapatkan respon dan saran dari pengguna SIAK yang berguna untuk pengembangan sistem infromasi akademik dikemudian hari. Technology Acceptance Model atau TAM adalah sebuah model yang digunakan untuk mengukur penerimaan pengguna terhadap suatu teknologi. Model tersebut akan digunakan untuk mengukur penerimaan pengguna terhadap SIAK Universtias Langlanguana. Populasi yang digunakan adalah mahasiswa Universitas Langlangbuana dari berbagai fakultas sebagai pengguna SIAK dengan jumlah sampel 200 responden. Faktor Â– faktor yang digunakan dalam penelitian yaitu perceived usefulness (PU), perceived ease of use (PEOU), attitude toward using (ATU), behavioral intention (BI), dengan tambahan faktor eksternal yaitu gender (G), experience (E), complexity (C), dan voluntariness (V). Hasil yang diperoleh dari penelitian ini yaitu hubungan antar setiap faktor yang mempengaruhi penerimaan seorang user ketika menggunakan SIAK untuk keperluan perkuliahan secara online, faktor kegunaan sistem (PU) berpengaruh secara signifikan terhadap niat dari penggunaan sistem (BI), dan faktor kemudahan dari sistem (PEOU) berpengaruh secara signifikan terhadap faktor sikap pada saat menggunakan sitem (ATU). Keyword : SIAK, TAM, PU, PEOU, ATU, BI , Voluntariness','analisis perilaku guna website sistem informasi akademik universitas langlangbuana technology acceptance model tam universitas langlangbuana univeristas terap sistem informasi akademik mudah kuliah sistem informasi akademik terap sistem infromasi akademik singkat siak mahasiswa rasa maksimal divisi siak sela urus sistem informasi akademik universitas langlanguana saran adakan penelitian guna siak respon saran guna siak guna pengembangan sistem infromasi akademik kemudian technology acceptance model tam model ukur penerimaan guna teknologi model ukur penerimaan guna siak universtias langlanguana populasi mahasiswa universitas langlangbuana fakultas guna siak sampel responden faktor faktor penelitian perceived usefulness pu perceived ease use peou attitude toward using atu behavioral intention bi tambah faktor eksternal gender experience complexity voluntariness oleh penelitian antar faktor pengaruh penerimaan user siak perlu kuliah online faktor guna sistem pu pengaruh signifikan niat sistem bi faktor mudah sistem peou pengaruh signifikan faktor sikap sitem atu keyword siak tam pu peou atu bi voluntariness'),(551,'A','Penerapan Knowledge Management System Di SMP Al Falah Dago . SMP Al Falah Dago merupakan salah satu lembaga pendidikan yang berada dibawah naungan Yayasan Pesantren Islam Al Falah. Meningkatkan kualitas seorang pengajar yang baik, SMP Al Falah mengirim guru untuk melakukan pelatihan atau workshop, pelatihan yang diikuti oleh guru merupakan pelatihan kurikulum, pelatihan guru profesional dan In House Training. Permasalahan-permasalahan yang terjadi di SMP Al Falah adalah guru yang tidak ikut pelatihan tidak dapat mengetahuan hasil pelatihan dan guru piket kesulitan untuk mengetahui materi yang akan diberikan di kelas hal ini akan mengakibatkan guru tidak dapat mengetahui perkembangan pengetahuan yang baru. Berdasarkan permasahan-permasalahan yang ada pada saat ini di SMP Al Falah, maka dibutuhkan suatu sistem untuk menyimpan hasil pelatihan, menyimpan materi dan sharing materi, Tujuan pembangunan sistem ini memudahkan guru untuk mengetahui hasil pelatihan dan memudahkan guru piket untuk mengetahui materi yang akan disampaikan di kelas. Knowledge Management System (KMS) yang merupakan salah satu implementasi dari e-learning. Sistem ini mempunyai konsep yang dapat mengumpulkan semua unsur pengetahuan yang tersebar dalam berbagai bentuk baik yang mudah dikelola karena berbentuk file (explicit) dan pengetahuian atau pengalaman yang dimiliki orang lain (tacit). Knowledge Management System (KMS) dapat membantu guru untuk menyimpan hasil pelatihan, menyimpan materi dan sharing materi, sehingga guru yang tidak mengikuti pelatihan atau guru yang tidak masuk bisa mengambil hasil pelatihan dan materi. Knowledge Management System yang akan dibangun akan dibuat sistem Artificial Intelligence (AI) untuk pencarian dokumen. Pencarian ini untuk mencari dokumen materi atau expilicit knowledge dan tacit knowledge yang ada pada knowledge management system. Pencarian dokumen ini dibangun menggunakan meode text mining dan informatioan Retrieval (IR). Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini sudah membantu guru yang tidak mengikuti pelatihan untuk mengetahui hasil pelatihan dan guru piket untuk mengetahui materi yang akan disampaikan di kelas. Keyword : Knowledge Management System, Artificial Intelligence, text mining, Informatioan Retrieval','penerapan knowledge management system smp al falah dago smp al falah dago lembaga didik bawah naung yayasan pesantren islam al falah kualitas ajar smp al falah kirim guru latih workshop latih ikut guru latih kurikulum latih guru profesional in house training masalah smp al falah guru latih tahu latih guru piket sulit materi berik kelas akibat guru kembang pengetahuan permasahan smp al falah butuh sistem simpan latih simpan materi sharing materi tuju bangun sistem mudah guru latih mudah guru piket materi sampai kelas knowledge management system kms implementasi e sistem konsep kumpul unsur pengetahuan tersebar mudah kelola bentuk file explicit pengetahuian alam milik tacit knowledge management system kms guru simpan latih simpan materi sharing materi guru ikut latih guru latih materi knowledge management system bangun buat sistem artificial intelligence a cari dokumen cari dokumen materi expilicit knowledge tacit knowledge knowledge management system cari dokumen bangun ode text mining informatioan retrieval ir uji simpul sistem guru ikut latih latih guru piket materi sampai kelas keyword knowledge management system artificial intelligence text mining informatioan retrieval'),(552,'A','Analisa Penerimaan Pengguna pada Sistem ERP Menggunakan Technology Acceptance Model (TAM) Pada PT Astra International TBK (ASTRAWORLD) Cabang Pasteur Bandung . PT. Astra International Tbk merupakan salah satu perusahaan besar di Indonesia yang bergerak di bidang otomotif, agrobisnis, dan lain sebagainya. Di bidang otomotif meliputi penjualan, suku cadang (sparepart), dan servis mobil. Pada bulan Februari tahun 2001, PT. Astra International Tbk mendirikan sales operation baru yaitu AstraWorld sales operation yang bergerak di bidang membership dan layanan darurat. PT. Astra International Tbk telah mengimplementasikan sistem ERP di semua divisi dan anak perusahaan, salah satunya adalah Astraworld. PT Astra International Tbk (AstraWorld) cabang Pasteur Bandung, tetapi tidak semua karyawan bagian kantor memanfaatkan sistem ERP secara maksimal, maka di susunlah penelitian ini untuk mengetahui faktor-faktor penerimaan teknologi informasi yang mempengaruhi penerimaan pengguna dalam menggunakan teknologi informasi. Technology Acceptance Model atau TAM adalah sebuah model yang digunakan untuk mengukur penerimaan pengguna terhadap suatu teknologi. TAM pertama kali di temukan oleh Davis dimana pada awal mula TAM terdapat dua variabel awal yaitu pengaruh kegunaan dan pengaruh mudah digunakan. Model TAM yang digunakan dalam penelitian ini adalah model TAM yang telah dikembangkan oleh (Gardner & Amoroso) untuk variabel Pengalaman dan (Venkatesh & Davis) untuk Kualitas Informasi, dimana faktor-faktor lain yang digunakan yaitu Perceived Ease of Use (PEOU), Perceived Usefulness (PU), Attitude Toward Use (ATU), Behaviour Intention to Use (BI) dan Actual Use System (ASU). Hasil yang di peroleh dari penelitian ini yaitu hubungan antar setiap faktor yang mempengaruhi penerimaan seorang karyawan ketika menggunakan sistem ERP, yaitu ATU berpengaruh terhadap ASU, ATU berpengaruh terhadap BI, BI berpengaruh terhadap ASU, IQ berpengaruh terhadap PEU, IQ berpengaruh terhadap PU, PEU berpengaruh terhdapa PU dan PU berpengaruh terhadap BI. Keyword : PT. Astra International Tbk, AstraWorld , (TAM), ASU, ATU, IQ, PEU, PU, EX','analisa penerimaan guna sistem erp technology acceptance model tam pt astra international tbk astraworld cabang pasteur bandung pt astra international tbk usaha indonesia gerak bidang otomotif agrobisnis bagai bidang otomotif liput jual suku cadang sparepart servis mobil februari pt astra international tbk diri sales operation astraworld sales operation gerak bidang membership layan darurat pt astra international tbk implementasi sistem erp divisi anak usaha satu astraworld pt astra international tbk astraworld cabang pasteur bandung karyawan kantor manfaat sistem erp maksimal susun penelitian faktor penerimaan teknologi informasi pengaruh penerimaan guna teknologi informasi technology acceptance model tam model ukur penerimaan guna teknologi tam temu davis mana mula tam dapat variabel pengaruh guna pengaruh mudah model tam penelitian model tam kembang gardner amoroso variabel alam venkatesh davis kualitas informasi mana faktor perceived ease use peou perceived usefulness pu attitude toward use atu behaviour intention to use bi actual use system asu oleh penelitian antar faktor pengaruh penerimaan karyawan sistem erp atu pengaruh asu atu pengaruh bi bi pengaruh asu iq pengaruh u iq pengaruh pu u pengaruh terhdapa pu pu pengaruh bi keyword pt astra international tbk astraworld tam asu atu iq u pu ex'),(553,'A','Pembangunan Customer Relationship Management Di Calysta Skin Care Clinic . Calysta adalah sebuah perusahaan yang bergerak di bidang perdagangan barang dan jasa pelayanan kesehatan, jasa yang diberikan berupa perawatan kecantikan. Banyak jenis barang dan jasa perawatan yang ditawarkan Calysta tentunya banyak pelanggan yang berminat untuk melakukan perawatan dan membeli barang yang mereka butuhkan. Jumlah pelanggan yang melakukan perawatan secara berkala hanya 12% atau 190 dari keseluruhan pelanggan untuk cabang kopo, sementara 88% pelanggan tidak kembali lagi untuk melakukan pelayanan jasa perawatan dan pembelian barang. Banyaknya pelanggan Calysta mengakibatkan Spv Cabang masih kurang memahami karakteristik pelanggan, karena belum adanya proses segmentasi dalam penentuan jenis pelanggan untuk mengetahui prilaku setiap pelanggan sehingga sulit dalam menyesuaikan pelayanan berupa pemberian diskon yang tepat berdasarkan jenis pelanggan. Dengan menerapkan konsep Customer Relationship management (CRM) Calysta dapat melihat aktifitas pelanggan saat melakukan transaksi barang atau jasa apa saja yang sering digunakanan pelanggan, untuk itu perlu adanya proses segmentasi pelanggan dan melihat skala kedatangan pelanggan dalam melakukan transaksi. Tujuan dari proses segmentasi pelanggan adalah untuk mengetahui perilaku pelanggan dalam penggunaan layanan Calysta. RFM merupakan model untuk menentukan segmentasi konsumen berdasarkan Recency, Frequency, dan Monetary yaitu teknik pengelompokan pelanggan dari data transaksi berdasarkan transaksi terakhir dilakukan, banyaknya transaksi yang dilakukan dalam jangka waktu tertentu dan rata-rata total pembelian yang dilakukan dalam jangka waktu tertentu.Berdasarkan hasil pengujian aplikasi yang dibangun telah mencapai tujuan yaitu melakukan proses segmentasi dalam penentuan jenis pelanggan untuk menyesuaikan pelayanan berupa pemberian diskon yang tepat berdasarkan jenis pelanggan.  Keyword : Pelanggan, CRM, segmentasi, RFM','bangun customer relationship management calysta skin care clinic calysta usaha gerak bidang dagang jasa layan sehat jasa berik upa rawat cantik jasa rawat ditawarkan calysta tentu langgan minat rawat beli butuh langgan rawat kala seluruh langgan cabang kopo langgan layan jasa rawat beli banyak langgan calysta akibat spv cabang kurang paham karakteristik langgan segmentasi penentuan langgan prila langgan sulit suai layan upa beri diskon tepat langgan terap konsep customer relationship management crm calysta aktifitas langgan transaksi jasa digunakanan langgan segmentasi langgan skala datang langgan transaksi tuju segmentasi langgan perilaku langgan layan calysta rfm model tentu segmentasi konsumen recency frequency monetary teknik pengelompokan langgan data transaksi transaksi banyak transaksi jangka tertentu rata total beli jangka tertentu berdasarkan uji aplikasi bangun tuju segmentasi penentuan langgan suai layan upa beri diskon tepat langgan keyword langgan crm segmentasi rfm'),(554,'E','Implementasi Algoritma Back propagation Untuk Klasifikasi jenis Sidik Jari Berdasarkan Ekstraksi Ciri Matriks Co-Occurrence . Dalam mengklasifikasikan citra jenis sidik jari keakurasian sangatlah penting karena untuk menghasilkan suatu sistem pendeteksi citra sidik jari dibutuhkan keakurasian yang baik. Metode yang digunakan untuk mendeteksi citra sidik jari pun dijadikan suatu pertimbangan. Metode yang akan digunakan pada penelitian ini adalah metode Matrik Co-occurence untuk ekstraksi ciri dan metode Back Propagation untuk klasifikasinya. Sebelumnya telah dilakukan penelitian yang membuktikan bahwa metode matriks co-occurrence dapat mengekstraksi ciri tekstur dengan baik, matriks co-occurrence menghasilkan hasil ekstraksi ciri berupa data angka, hasil pengukuran atau disebut data continues, berupa kontras, homogenitas, dissimilarity, energy, dan entropy. Selanjutnya ada pula penelitian yang mengimplementasikan metode Backpropagation untuk klasifikasi sidik jari. Keduanya menggunakan data continue sebagai data masukan terhadap metode Backpropagation, dan menghasilkan keakuratan yang baik. Dari yang telah dijelaskan terbukti dengan dilakukannya pengujian menggunakan metode confusion matrix didapat tingkat akurasi 90% dengan learning rate 0,5 dan error 0,01, itu dikarena semakin banyak data latih, maka tingkat akurasi akan semakin baik.Keyword : sidik jari, ekstraksi ciri, matrix co-occurrrence, klasifikasi backpropagation.','implementasi algoritma back propagation klasifikasi sidik jari ekstraksi ciri matriks co klasifikasi citra sidik jari akurasi sangat hasil sistem deteksi citra sidik jari butuh akurasi metode deteksi citra sidik jari jadi timbang metode penelitian metode matrik co ekstraksi ciri metode back propagation klasifikasi penelitian bukti metode matriks co ekstraksi ciri tekstur matriks co hasil ekstraksi ciri upa data angka ukur sebut data continues upa kontras homogenitas dissimilarity energy entropy lanjut penelitian implementasi metode backpropagation klasifikasi sidik jari dua data continue data masuk metode backpropagation hasil akurat jelas bukti laku uji metode confusion matrix dapat akurasi learning rate error karena data latih akurasi baik keyword sidik jari ekstraksi ciri matrix co klasifikasi backpropagation'),(555,'C','Pengembangan SIMPPTSP Dengan Penambahan Fitur QR Code Dan Transport Layer Security Untuk Verifikasi Perizinan Di Kabupaten Bandung Barat . BPMPPT Kabupaten Bandung Barat memanfaatkan Sistem Informasi Manajemen Pelayanan Perizinan Terpadu Satu Pintu (SIMPPTSP) untuk melayani proses pengajuan perizinan dari mulai pencetakan resi sampai pencetakan perizinan. Berdasarkan wawancara yang dilakukan dengan pihak BPMPPT, didapatkan informasi bahwa perizinan seringkali dipalsukan oleh pihak tidak bertanggung jawab, informasi lainnya yang didapat adalah verifikasi perizinan masih dilakukan secara manual sehingga memakan waktu, berdasarkan informasi tersebut disimpulkan bahwa dibutuhkan penambahan fitur verifikasi perizinan pada SIMPPTSP sehingga perizinan lebih sulit dipalsukan dan datanya dapat diverifikasi secara cepat dan tepat. Solusi dari masalah tersebut adalah dengan menambahkan QR code pada warkah perizinan yang berfungsi sebagai tanda pengenal dan media akses cepat verifikasi perizinan, sehingga perizinan lebih sulit dipalsukan dan dapat diverifikasi dengan cepat dan tepat, namun QR code sendiri memiliki kelemahan yaitu mudah dipalsukan, oleh karena itu diterapkan digital signature pada QR code yang disertakan pada warkah perizinan sehingga keaslian dan intergritas dari QR code dapat terjaga. Merujuk pada penelitian sejenis yang dilakukan oleh Irawan Afrianto, M.T dkk yang berjudul Â“Pemanfaatan QR code Sebagai Akses Cepat Verifikasi Ijazah UnikomÂ” diberikan saran bahwa perlu diperhatikan dari sisi keamanan internet, dikarenakan verifikasi dilakukan secara online, oleh karena itu pada penelitian ini akan diterapkan TLS yang berfungsi untuk mengamankan sesi komunikasi. Dengan diterapkanya fitur verifikasi perizinan berbasis QR code setiap perizinan yang sudah disertai QR code lebih sulit dipalsukan dan dapat diverifikasi baik melalui aplikasi mobile verifikasi perizinan ataupun halaman web verifikasi perizinan dan dengan diterapkanya TLS seluruh sesi komunikasi baik dari dan menuju SIMPPTSP terenkripsi sehingga lebih aman.  Keyword : Verifikasi, Perizinan, Pemalsuan, Sistem, Informasi, SIMPPTSP, Barcode, QRCode, Keamanan, Signature, ECDSA, Enkripsi, TLS','pengembangan simpptsp penambahan fitur qr code transport layer security verifikasi izin kabupaten bandung bpmppt kabupaten bandung manfaat sistem informasi manajemen layan izin padu pintu simpptsp layan aju izin cetak resi cetak izin wawancara bpmppt dapat informasi izin seringkali palsu tanggung jawab informasi dapat verifikasi izin manual akan informasi simpul butuh penambahan fitur verifikasi izin simpptsp izin sulit palsu data verifikasi cepat tepat solusi tambah qr code war izin fungsi tanda pengenal media akses cepat verifikasi izin izin sulit palsu verifikasi cepat tepat qr code lemah mudah palsu terap digital signature qr code serta war izin asli intergritas qr code jaga rujuk penelitian jenis irawan afrianto m t dkk judul manfaat qr code akses cepat verifikasi ijazah unikom berik saran hati sisi aman internet karena verifikasi online penelitian terap tls fungsi aman sesi komunikasi diterapka fitur verifikasi izin basis qr code izin serta qr code sulit palsu verifikasi aplikasi mobile verifikasi izin atau halaman web verifikasi izin diterapka tls sesi komunikasi tuju simpptsp enkripsi aman keyword verifikasi izin pemalsuan sistem informasi simpptsp barcode qrcode aman signature ecdsa enkripsi tls'),(556,'A','Penerapan Knowledge Management System Pada Bidang Pelayanan Siswa Di SMA Negeri 1 Soreang . Dalam proses pelayanan siswa masih ditemukan kesulitan baik dari penerapan SOP kerja, pengolahan pengetahuan baru maupun lama berupa pengalaman maupun modul pelayanan siswa, masih sulitnya sharing ilmu pengetahuan antar staff guru dan tempat penyimpanan yang terbatas. Sistem knowledge management di bidang pelayanan siswa ini merupakan solusi yang tepat untuk menjawab masalah tersebut. Dengan fitur yang tersedia diharapkan mempermudah staff guru dalam mengolah pengetahuan, menjadikan SOP sebagai acuan pelayanan dan menjadi wadah untuk sharing antar staff guru. Kelebihan dari aplikasi ini yaitu staff guru dapat melakukan pengolahan pengetahuan, penyelesaian masalah siswa, berbagi pengalaman dan diskusi. Aplikasi knowledge management system pada bidang pelayanan siswa di SMA NEGERI 1 SOREANG ini memberikan kemudahan pada bidang pelayanan siswa dalam pengelolaan pengetahuan dalam bentuk prosedur kerja (SOP), tugas tanggung jawab dan pengalaman sehingga pengetahuan yang ada mudah digunakan, mudah untuk disimpan, mudah dikelola , mudah diciptakan, mudah diperbaharui. Aplikasi knowledge management system pada bidang pelayanan siswa di SMA NEGERI 1 SOREANG ini membantu dan mempermudah untuk menentukan solusi terbaik dari masalah dalam pelayanan akademik siswa oleh staff guru dan staff pelayanan siswa. Keyword : Knowledge Management System, KMS, pelayanan, siswa, SMA NEGERI 1 SOREANG. ','penerapan knowledge management system bidang layan siswa sma neger soreang layan siswa sulit penerapan sop olah pengetahuan upa alam modul layan siswa sulit sharing ilmu pengetahuan antar staff guru simpan batas sistem knowledge management bidang layan siswa solusi tepat jawab fitur tersedia harap mudah staff guru o pengetahuan jadi sop acu layan wadah sharing antar staff guru lebih aplikasi staff guru olah pengetahuan selesai siswa bagi alam diskusi aplikasi knowledge management system bidang layan siswa sma neger soreang mudah bidang layan siswa pengelolaan pengetahuan prosedur sop tugas tanggung jawab alam pengetahuan mudah mudah simpan mudah kelola mudah cipta mudah baharu aplikasi knowledge management system bidang layan siswa sma neger soreang mudah tentu solusi baik layan akademik siswa staff guru staff layan siswa keyword knowledge management system kms layan siswa sma neger soreang'),(557,'A','Enterprise Architecture Planning (EAP) Untuk Pengembangan Sistem Informasi Pada Divisi Marketing PT. Mahadana Asta Berjangka . PT Mahadana Asta Berjangka adalah perusahaan yang bergerak di bidang jasa pengelolaan dana atau transaksi perdagangan alternatif. PT Mahadana Asta Berjangka menjembatani dan memfasilitasi bagi masyarakat yang ingin bertransaksi di Bursa Berjangka Jakarta (BBJ). PT Mahadana Asta Berjangka memiliki divisi marketing dan terdapat sistem informasi Metatrader. Namun tidak semua kegiatan atau aktivitas bisnis divisi marketing bisa ditangani hanya dengan sistem informasi Metatrader. Sistem informasi Metatrader ini memiliki potensi untuk dikembangkan atau dibangun sistem baru yang bisa diintegrasi dengan sistem lama sehingga dapat menghasilkan sistem yang dinamis dan dapat menunjang kegiatan di divisi marketing PT Mahadana Asta Berjangka. Keinginan untuk pengembangan sistem telah tercetus oleh divisi marketing dan terbengkalai dalam pengerjaannya karena perencanaan yang kurang matang. Karena permasalahan tersebut, perlu dilakukan pengembangan sistem informasi memerlukan perencanaan untuk melengkapi arah strategi bisnis perusahaan. Perencanaan dibangun dengan mendefinisikan arsitektur data, aplikasi dan teknologi dalam penggunaan informasi untuk mendukung business process kemudian perancangan arsitektur untuk mendeinisi dan mengidentifikasi kebutuhan dan membuat skema arsitektur serta membuat rencana untuk implementasinya. Hasil perencanaan arsitektur enterprise berupa pemodelan (cetak biru) sistem informasi untuk data, aplikasi dan teknologi. Pemodelan (cetak biru) sistem informasi berguna sebagai landasan bagi pengembangan sistem informasi secara keseluruhan yang lebih baik dalam business process perusahaan. Dengan dibuatnya architecture enterprise planning ini, dapat diambil kesimpulan bahwa dalam pengembangan sistem informasi perlu dilakukan pendefinisian dan pengidentifikasi kebutuhan sistem informasi sebelum dilakukan implementasi atau pembangunan sistem informasi. Hal ini dapat mengantisipasi terjadinya kegagalan atau ketidaksesuaian implementasi sistem informasi dengan kebutuhan dan aktivitas bisnis perusahaan. Keyword : enterprise architecture planning, arsitektur data, arsitektur aplikasi, arsitektur teknologi.','enterprise architecture planning eap pengembangan sistem informasi divisi marketing pt mahadana asta jangka pt mahadana asta jangka usaha gerak bidang jasa pengelolaan dana transaksi dagang alternatif pt mahadana asta jangka jembatan fasilitas masyarakat transaksi bursa jangka jakarta bbj pt mahadana asta jangka divisi marketing dapat sistem informasi metatrader aktivitas bisnis divisi marketing ditangani sistem informasi metatrader sistem informasi metatrader potensi kembang bangun sistem integrasi sistem hasil sistem dinamis tunjang divisi marketing pt mahadana asta jangka ingin pengembangan sistem tercetus divisi marketing terbengkalai pengerjaan rencana kurang matang masalah pengembangan sistem informasi perlu rencana lengkap arah strategi bisnis usaha rencana bangun definisi arsitektur data aplikasi teknologi informasi dukung business process rancang arsitektur mendeinisi identifikasi skema arsitektur rencana implementasi rencana arsitektur enterprise upa model cetak biru sistem informasi data aplikasi teknologi model cetak biru sistem informasi guna landas pengembangan sistem informasi seluruh business process usaha buat architecture enterprise planning ambil simpul pengembangan sistem informasi definisi identifikasi sistem informasi implementasi bangun sistem informasi antisipasi jadi gagal ketidaksesuaian implementasi sistem informasi aktivitas bisnis usaha keyword enterprise architecture planning arsitektur data arsitektur aplikasi arsitektur teknologi'),(558,'A','Pembangunan Customer Relationship Management Di P-Trans. P-Trans adalah sebuah perusahaan yang bergerak di bidang jasa transportasi. Keadaan yang ada saat ini di P-Trans adalah pelanggan yang memiliki frekuensi transaksi banyak saja yang mendapatkan diskon. Sementara untuk pelanggan yang memiliki jumlah total pembelian yang besar diskon yang diberikan tidak berbeda. Hal tersebut membuat pelanggannya tidak melakukan transaksi lagi dengan p-trans. Selain itu, dalam menentukan rekomendasi jenis paket tour, ptrans mengambil dari jenis paket tour yang paling banyak dipesan oleh pelanggan. Masalahnya adalah dalam mencari jenis paket tour yang paling banyak diinginkan oleh pelanggan tidak mudah. Hal tersebut menyebabkan Ptrans kesulitan dalam menentukan jenis paket tour yang akan ditawarkan kepada pelanggan. Dengan menerapkan konsep CRM (Customer Relationship Management), perusahaan dapat mengidentifikasi pelanggan melalui segmentasi pelanggan. Tujuan dari proses segmentasi pelanggan adalah untuk mengetahui perilaku pelanggan dan menerapkan pelayanan yang tepat sehingga mendatangkan keuntungan bagi perusahaan. Model RFM merupakan model untuk menentukan segmentasi pelanggan berdasarkan recency, frequency, dan monetary. Yaitu teknik pengelompokan pelanggan berdasarkan transaksi terakhir, banyaknya transaksi yang dilakukan dalam jangka waktu tertentu dan rata-rata total pembelian yang dilakukan dalam jangka waktu tertentu. Berdasarkan hasil pengujian aplikasi yang dibangun telah mencapai tujuan yaitu membantu dalam menentukan diskon produk (tour dan shuttle) yang ditawarkan kepada pelanggan berdasarkan segmentasi pelanggan dan dalam menentukan jenis paket tour yang akan ditawarkan kepada pelanggan berdasarkan transaksi.  Keyword : Diskon, Rekomendasi, Pelanggan, CRM, segmentasi, RFM','bangun customer relationship management p p usaha gerak bidang jasa transportasi ada p langgan frekuensi transaksi diskon langgan total beli diskon berik beda langgan transaksi p tentu rekomendasi paket tour ptrans paket tour pesan langgan masa paket tour ingin langgan mudah ptrans sulit tentu paket tour ditawarkan langgan terap konsep crm customer relationship management usaha identifikasi langgan segmentasi langgan tuju segmentasi langgan perilaku langgan terap layan tepat datang untung usaha model rfm model tentu segmentasi langgan recency frequency monetary teknik pengelompokan langgan transaksi banyak transaksi jangka tertentu rata total beli jangka tertentu uji aplikasi bangun tuju tentu diskon produk tour shuttle ditawarkan langgan segmentasi langgan tentu paket tour ditawarkan langgan transaksi keyword diskon rekomendasi langgan crm segmentasi rfm');

